(1, 1, 'आज बोट क्लब पर खेलो इंडिया यूथ गेम्स का समापन कार्यक्रम, CM , केंद्रीय खेल मंत्री और राज्य मंत्री मंडल के सदस्य भी होंगे शामिल', 'today-the-closing-program-of-khelo-india-youth-games-at-boat-club-cm-union-sports-minister-and-members-of-the-state-council-of-ministers-will-also-participate', NULL, NULL, 'खेलो इंडिया यूथ गेम्स का समापन कार्यक्रम शनिवार को बोट क्लब पर आयोजित होगा। इसमें मुख्यमंत्री शिवराज सिंह चौहान, केंद्रीय खेल मंत्री और राज्य मंत्री मंडल के सदस्य भी शामिल होंगे। कार्यक्रम को देखते हुए दोपहर 3 बजे से कार्यक्रम खत्म होने तक बोट क्लब की ओर वाहनों का प्रवेश प्रतिबंधित रहेगा। केवल पैदल यात्री बोट क्लब की ओर आ-जा सकेंगे।', '<p class=\"\">भोपाल: खेलो इंडिया यूथ गेम्स का समापन कार्यक्रम शनिवार को बोट क्लब पर आयोजित होगा। इसमें मुख्यमंत्री शिवराज सिंह चौहान, केंद्रीय खेल मंत्री और राज्य मंत्री मंडल के सदस्य भी शामिल होंगे। कार्यक्रम को देखते हुए दोपहर 3 बजे से कार्यक्रम खत्म होने तक बोट क्लब की ओर वाहनों का प्रवेश प्रतिबंधित रहेगा। केवल पैदल यात्री बोट क्लब की ओर आ-जा सकेंगे। इसके लिए डायवर्सन प्लान तैयार किया गया है।</p>\r\n<p class=\"\">कार्यक्रम में शामिल होने वाले लोग अपने वाहन पॉलिटेक्निक कॉलेज परिसर, मानस भवन परिसर, भारत भवन के सामने स्ट्रीट पार्किंग और टैगोर गर्ल्स हॉस्टल परिसर में पार्क कर पैदल बोट क्लब की ओर जा सकेंगे। किलोल पार्क से बोट क्लब की ओर रहवासियों के अतिरिक्त सामान्य वाहनों का आवागमन प्रतिबंधित रहेगा। ये लोग पॉलिटेक्निक चौराहा से पॉलिटेक्निक कॉलेज, मानस भवन परिसर, भारत भवन के सामने स्ट्रीट पार्किंग और टैगोर गर्ल्स हॉस्टल परिसर स्थल पर वाहन पार्क कर बोट क्लब की ओर पैदल जाएंगे। डायवर्सन के चलते बोट क्लब के आसपास के मार्गों पर यातायात का दबाव रहेगा।</p>', 1, 'uploads/images/202302/image_870x580_63e73e65d0345.jpg', 'uploads/images/202302/image_870x_63e73e65dd3bc.jpg', 'uploads/images/202302/image_694x532_63e73e65ea51a.jpg', 'uploads/images/202302/image_430x256_63e73e65f1704.jpg', 'uploads/images/202302/image_140x98_63e73e65f3ef0.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-11 12:37:25'),
(2, 1, 'उत्तराखंड में पेपर लीक मामले में सख्त नकल विरोधी कानून का आदेश जारी, नकल करने पर 10 साल तक की कैद साथ 10 लाख जुर्माना भी', 'strict-anti-copying-law-order-issued-in-uttarakhand-paper-leak-case-up-to-10-years-imprisonment-along-with-10-lakh-fine-for-copying', NULL, NULL, 'उत्तराखंड में पेपर लीक मामले में सख्त नकल विरोधी कानून का आदेश जारी किया गया है। राज्यपाल ने लेफ्टिनेंट जनरल गुरमीत सिंह (सेनि) ने शुक्रवार को उत्तराखंड प्रतियोगी परीक्षा अध्यादेश 2023 पर मुहर लगा दी। सरकार को उम्मीद है कि इससे आगे घटनाओं में कमी आएगी।', '<p>उत्तराखंड में पेपर लीक मामले में सख्त नकल विरोधी कानून का आदेश जारी किया गया है। राज्यपाल ने लेफ्टिनेंट जनरल गुरमीत सिंह (सेनि) ने शुक्रवार को उत्तराखंड प्रतियोगी परीक्षा अध्यादेश 2023 पर मुहर लगा दी। सरकार को उम्मीद है कि इससे आगे घटनाओं में कमी आएगी।</p>\r\n<p>इस कानून के तहत अगर कोई प्रिटिंग प्रेस, कोचिंग इंस्टीट्यूट या मैनेजमेंट सिस्टम नकल कराने पर दोषी पाया जाता है, तो उसे उम्र कैद की सजा हो सकती है। साथ उसे 10 करोड़ रुपए जुर्माना भी भरना पड़ेगा। इसके अलावा अगर कोई व्यक्ति संगठित रूप से परीक्षा कराने वाली संस्था के साथ मिलकर षडयंत्र करता है ,तो उसके लिए भी सजा का प्रावधान किया गया है।</p>\r\n<p>बता दें कि राज्य में प्रतियोगी परीक्षाओं पर नकेल लगाने के लिए सरकार सख्त कानून बना रही है। इसी के तहत मुख्यमंत्री पुष्कर सिंह धामी एक आदेश को मंजूरी देने के बाद राज्यपाल के पास भेजा था। राज्यपाल ने इसे गंभीरता से लेते हुए 24 घंटे के भीतर इस कानून को हरी झंडी दे दी।</p>\r\n<p>प्रतियोगी परीक्षा अध्यादेश 2023 के लागू होने के बाद छात्र अगर नकल करते या कराते पकड़ा गया तो उसे 3 साल कारावास और 5 लाख तक जुर्माना देना पड़ सकता है। वह छात्र दोबारा पकड़ा गया तो उसे कम से कम 10 साल की सज़ा और 10 लाख तक के जुर्माना देना पड़ सकता है।इसके अलावा परीक्षा के दौरान अनुचित साधनों के इस्तेमाल करते पाए जाने पर अर्जित संपत्ति की कुर्की की जाएगी।</p>\r\n<p>मुख्यमंत्री धामी ने इस अध्यादेश को मंजूरी देने के लिए राज्यपाल का आभार जताया। धामी ने ट्वीट किया- हमारी सरकार की तरफ से भेजे गए देश के सबसे सख्त नकल विरोधी कानून के अध्यादेश को माननीय राज्यपाल ने स्वीकृति दे दी है। अब प्रदेश में होने वाली सभी प्रतियोगी परीक्षा में नकल विरोधी कानून लागू होगा। युवाओं के हितों को ध्यान में रखते हुए हम नकल माफिया को जड़ से उखाड़ने हेतु पूर्ण रूप से प्रतिबद्ध हैं।</p>', 1, 'uploads/images/202302/image_870x580_63e7433fd8a95.jpg', 'uploads/images/202302/image_870x_63e7433fe665f.jpg', 'uploads/images/202302/image_694x532_63e7433fefce2.jpg', 'uploads/images/202302/image_430x256_63e74340001ba.jpg', 'uploads/images/202302/image_140x98_63e7434001cd9.jpg', 'jpg', 'local', NULL, 3, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-11 12:57:11'),
(3, 1, '6 सप्ताह बाद हॉस्पिटल से बाहर निकल कर चलते नजर आए ऋषभ पंत, फोटो शेयर कर लिखा -\'एक कदम आगे, एक कदम स्ट्रॉन्गर, एक कदम बेहतर\'', 'rishabh-pant-was-seen-walking-out-of-the-hospital-after-6-weeks-shared-the-photo-and-wrote-one-step-forward-one-step-stronger-one-step-better', NULL, NULL, 'भारत के विकेटकीपर बैटर ऋषभ पंत हॉस्पिटल से बाहर निकल कर चलते नजर आए। उन्होंने बैसाखी के सहारे चलने के कुछ फोटोज सोशल मीडिया पर शेयर किए हैं। इन फोटोज के साथ उन्होंने कैप्शन में लिखा, \'एक कदम आगे, एक कदम स्ट्रॉन्गर, एक कदम बेहतर।\'', '<p>भारत के विकेटकीपर बैटर ऋषभ पंत हॉस्पिटल से बाहर निकल कर चलते नजर आए। उन्होंने बैसाखी के सहारे चलने के कुछ फोटोज सोशल मीडिया पर शेयर किए हैं। इन फोटोज के साथ उन्होंने कैप्शन में लिखा, \'एक कदम आगे, एक कदम स्ट्रॉन्गर, एक कदम बेहतर।\'</p>\r\n<p>पिछले साल 30 दिसंबर को कार एक्सीडेंट में घायल होने के बाद पंत ने पहली बार खुद के फोटो शेयर किए। मुंबई के कोकिलाबेन अस्पताल में उनका ट्रीटमेंट अभी चल रहा है।</p>\r\n<p>ऋषभ पंत ने शुक्रवार शाम करीब 6:30 बजे अपने सोशल मीडिया अकाउंट पर 2 फोटो शेयर किए। इन फोटोज में पंत व्हाइट टी-शर्ट और ब्लैक शॉर्ट्स पहने दिखे। वह दोनों हाथों से बैसाखी पकड़कर चलते नजर आ रहे हैं।पंत के फोटोज पोस्ट करते ही कई फैंस के रिएक्शन आने शुरू हो गए। कुछ ने उनके जल्द ही स्वस्थ होकर टीम इंडिया में वापसी करने की दुआ मांगी तो कुछ ने लिखा, \'आप जल्द ही धमाकेदार वापसी करेंगे।\'</p>\r\n<p>पिछले साल 30 दिसंबर को पंत का एक्सीडेंट हो गया था। वह अपनी कार से उत्तराखंड के रुड़की शहर जा रहे थे, जहां उनका परिवार रहता है, लेकिन रुड़की से पहले ही रास्ते में उनकी कार का एक्सीडेंट हो गया। उनकी कार में आग भी लग गई। इस दौरान पंत खुद ही कार से किसी तरह बाहर निकाले। हादसा देख जब कुछ लोग वहां पहुंचे तो पंत ने उन्हें अपना परिचय भी दिया। फिर लोगों ने उनको हॉस्पिटल पहुंचाया।</p>\r\n<p>देहरादून में कुछ समय इलाज कराने के बाद BCCI ने पंत को बेहतर इलाज के लिए मुंबई स्थित कोकिलाबेन हॉस्पिटल में शिफ्ट करा दिया। जहां BCCI की मेडिकल टीम की निगरानी में उनका ट्रीटमेंट शुरू हुआ।</p>\r\n<p>एक्सीडेंट के बाद 16 जनवरी को पंत ने पहली बार सोशल मीडिया पर अपने ठीक होने का मैसेज पोस्ट किया था। पंत ने हादसे के बाद खुद को हॉस्पिटल पहुंचाने वालों को धन्यवाद भी कहा था।</p>', 1, 'uploads/images/202302/image_870x580_63e747d7d1489.jpg', 'uploads/images/202302/image_870x_63e747d7dd7b8.jpg', 'uploads/images/202302/image_694x532_63e747d7e6f10.jpg', 'uploads/images/202302/image_430x256_63e747d7ebec4.jpg', 'uploads/images/202302/image_140x98_63e747d7edf31.jpg', 'jpg', 'local', NULL, 2, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-11 13:16:45'),
(4, 1, 'इंदौर की प्लास्टिक फाइबर फैक्ट्री में लगी भीषण आग, लगा 33 टैंकर से भी ज्यादा पानी , पर आग पे काबू पाना मुश्किल', 'fierce-fire-broke-out-in-indores-plastic-fiber-factory-more-than-33-tankers-used-water-but-it-is-difficult-to-control-the-fire', NULL, NULL, 'लसूडिया इलाके में प्लास्टिक फाइबर फैक्ट्री में भीषण आग लग गई। जिससे इलाके में अफरा तफरी मच गई। आग इतनी भीषण थी कि कई किमी दूर से ही आग का धुआं नजर आया। कई लोग घटना का वीडियो बनाते नजर आए। आग लगते ही लोगों ने फायर ब्रिगेड को सूचना दी।', '<p>इंदौर: लसूडिया इलाके में प्लास्टिक फाइबर फैक्ट्री में भीषण आग लग गई। जिससे इलाके में अफरा तफरी मच गई। आग इतनी भीषण थी कि कई किमी दूर से ही आग का धुआं नजर आया। कई लोग घटना का वीडियो बनाते नजर आए। आग लगते ही लोगों ने फायर ब्रिगेड को सूचना दी। संबंधित थाना क्षेत्र की पुलिस और फायर ब्रिगेड भी मौके पर पहुंच गई। दमकल कर्मी आग पर काबू पाने की कोशिश कर रहे है। हालांकि आग कैसे लगी ये स्पष्ट नहीं हो सका है।</p>\r\n<p>मिली जानकारी के मुताबिक शनिवार सुबह आग प्लास्टिक फाइबर फैक्ट्री में लगी है। जिसके कारण आग ने भयावह रूप ले लिया। आग की लपटें काफी ऊपर तक उठती रही। टीआई संतोष दूधी के मुताबिक फैक्ट्री में फाइबर व प्लास्टिक का काम होता है। यहां टंकियां बनाई जाती है। सुबह के वक्त ज्यादा मजदूर नहीं थे। ऑफिशियल स्टाफ ही मौजूद था। 10-15 गाड़ियों से आग बुझाने का काम जारी है। जल्द ही आग पर काबू पा लिया जाएगा। पुलिस का कहना है कि आग कैसे लगी ये सामने नहीं आया है। जांच के बाद ही स्पष्ट हो सकेगा कि कैसे आग लगी। इधर, आसपास के इलाके को भी कवर कर लिया है, ताकि आग ज्यादा न फैले। फिलहाल फायर ब्रिगेड कर्मी आग पर काबू पाने में लगे है।</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63e751d127894.jpg\" alt=\"\"></p>\r\n<p>फैक्ट्री के अंदर कई ब्लास्ट होने की भी सूचना सामने आ रही है। जिससे क्षेत्र में अफरा-तफरी मची। कोई जनहानि नहीं हुई है। अभी तक 33 टैंकर से ज्यादा पानी आग बुझाने के लिए डाला जा चुका है, लेकिन आग नहीं बुझी है। आसपास चाकलेट, मेडिसिन की फैक्ट्रियां है उनमें किसी प्रकार का नुकसान नहीं हुआ है।</p>', 1, 'uploads/images/202302/image_870x580_63e751bf5705d.jpg', 'uploads/images/202302/image_870x_63e751bf650e3.jpg', 'uploads/images/202302/image_694x532_63e751bf6eabf.jpg', 'uploads/images/202302/image_430x256_63e751bf735e8.jpg', 'uploads/images/202302/image_140x98_63e751bf754db.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-11 13:59:31'),
(5, 1, 'खेल-खेल में बच्चे की मौत, छत पर दरवाजा बंद करने की रस्सी से गले में फंदा लगा', 'childs-death-while-playing-the-rope-to-lock-the-door-on-the-roof-got-strangulated', NULL, NULL, 'अंबाला में 8 साल के मासूम की खेलते समय गले में रस्सी फंसने से मौत हो गई। घटना अंबाला सिटी के न्यू इंद्रपुरी कॉलोनी की है। बच्चा शुक्रवार शाम को अपने घर की छत पर खेल रहा था, जब परिजनों ने संभाला तो बेसुध हालत में पड़ा था', '<p>अंबाला: हरियाणा के अंबाला में 8 साल के मासूम की खेलते समय गले में रस्सी फंसने से मौत हो गई। घटना अंबाला सिटी के न्यू इंद्रपुरी कॉलोनी की है। बच्चा शुक्रवार शाम को अपने घर की छत पर खेल रहा था, जब परिजनों ने संभाला तो बेसुध हालत में पड़ा था।</p>\r\n<p>परिजन अफरा-तफरी में अंबाला सिटी सिविल अस्पताल लेकर पहुंचे। यहां डॉक्टरों ने मृत घोषित कर दिया। पुलिस ने आज शव का पोस्टमॉर्टम कराकर परिजनों को सौंप दिया।</p>\r\n<p>जानकारी के मुताबिक, 8 वर्षीय वंश खेलने के लिए छत पर गया था। उस दौरान खेलते वक्त उसके गले में रबड़ वाली रस्सी अचानक फंस गई। रस्सी मोंटी वाले दरवाजे पर लगी हुई थी। बच्चे के पिता दीवान धोबी हैं। वंश की दो बड़ी बहने हैं।</p>\r\n<p>दीवान चंद ने बताया कि उसका बड़ा बेटा वंश घर पर पहली मंजिल पर बने कमरे में रस्सी से खेल रहा था। उसकी बहन भी उसके साथ खेल रही थी। कुछ देर खेलने के बाद बहन नीचे चली गई। वंश अकेला ही रस्सी से खेल रहा था। यह रस्सी सीढ़ियों के साथ लगे दरवाजे को बंद होने से रोकने के लिए बांधी हुई थी।</p>\r\n<p>इसी दौरान रस्सी वंश के गले से फंस गई। इसी बीच उसकी वंश की छोटी बहन अपने भाई के साथ खेलने कमरे में पहुंची तो वंश बेहोशी की हालत में तड़प रहा था। वंश को ऐसी हालत में देख छोटी बहन ने शोर मचा दिया। बच्ची का शोर सुनकर परिजन मौके पर पहुंचे। अफरा-तफरी में अस्पताल लेकर पहुंचे। यहां डॉक्टर ने उसे मृत घोषित कर दिया।</p>', 1, 'uploads/images/202302/image_870x580_63e756c324974.jpg', 'uploads/images/202302/image_870x_63e756c3338c1.jpg', 'uploads/images/202302/image_694x532_63e756c340116.jpg', 'uploads/images/202302/image_430x256_63e756c3469e3.jpg', 'uploads/images/202302/image_140x98_63e756c34862b.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-11 14:20:19'),
(6, 1, 'मुरैना में पथराव  और फायरिंग, लोगों ने की फायरिंग, महिलाओं ने छत से चलाए पत्थर', 'stone-pelting-and-firing-in-morena-people-fired-women-threw-stones-from-the-roof', NULL, NULL, 'इस्लामपुरा मोहल्ले में दो पक्षों के बीच फायरिंग और पथराव हुआ। एक पक्ष की ओर से लगभग आधे घंटे तक सड़क से फायरिंग और पथराव किया गया। इस पर मोहल्ले की महिलाओं ने भी छतों पर से पथराव किया।', '<p>मुरैना: इस्लामपुरा मोहल्ले में दो पक्षों के बीच फायरिंग और पथराव हुआ। एक पक्ष की ओर से लगभग आधे घंटे तक सड़क से फायरिंग और पथराव किया गया। इस पर मोहल्ले की महिलाओं ने भी छतों पर से पथराव किया। दोनों तरफ से होने वाले पथराव का नतीजा यह हुआ कि इस्लामपुरा की सड़कों पर पत्थर ही पत्थर बिखरे पड़े थे।</p>\r\n<p>कोतवाली थाना पुलिस को जैसे ही इस घटना का पता चला, तो स्टेशन रोड सहित अन्य थानों का पुलिस बल वहां सीएसपी अतुल सिंह के नेतृत्व में जा पहुंचा, लेकिन जब तक पुलिस पहुंची उपद्रव करने वाले भाग चुके थे। पुलिस ने घरों में घुसकर उपद्रवियों की तलाश की लेकिन वे नहीं मिले।</p>\r\n<p>स्थानीय लोगों ने बताया कि रात 8 बजे के बाद दो दर्जन से अधिक नकाबपोश मुस्लिम बस्ती इस्लामपुरा में दाखिल हुए। वहां घुसते ही उन्होंने सड़क पर से ही ताबड़तोड़ फायरिंग शुरू कर दी और पत्थर फेंकने लगे। उन युवकों के हाथ में कट्&zwnj;टे और बंदूकें थीं। उनके फायरिंग व पथराव करते ही बस्ती के लोग दहशत में आ गए। उन्होंने भी उन युवकों पर पथराव शुरू कर दिया। फायरिंग और पथराव लगभग आधे घंटे तक चली। इस दौरान मोहल्ले की औरतों और बच्चों में चीख-पुकार मच गई।</p>\r\n<p>हमलावरों ने मोहल्ले की स्ट्रीट लाइट में पत्थर मारे, दरवाजों पर मौजूद बल्ब को तोड़ दिया, जिससे पूरे मोहल्ले में अंधेरा छा गया। अंधेरा होने के बाद उन्होंने फायरिंग की, जिस पर लोग और अधिक घबरा गए। मोहल्ले के निवासी इकबाल खान के घर का छज्जा तक टूट गया।</p>\r\n<p>अब पुलिस मोहल्ले में लगे सीसीटीवी कैमरों के फुटेज खंगाल रही है। फुटेज के आधार पर उपद्रवियों की तलाश की जाएगी।</p>', 1, 'uploads/images/202302/image_870x580_63e75a5ca1bb6.jpg', 'uploads/images/202302/image_870x_63e75a5cb156a.jpg', 'uploads/images/202302/image_694x532_63e75a5cbb31e.jpg', 'uploads/images/202302/image_430x256_63e75a5cc16b2.jpg', 'uploads/images/202302/image_140x98_63e75a5cc3f2a.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-11 14:35:50'),
(7, 1, 'राजस्थान में फिर बढ़ी ठंड, टेम्परेचर 4 डिग्री गिरा, 18 फरवरी तक रहेगा सर्द हवाओं का असर,', 'the-cold-increased-again-in-rajasthan-the-temperature-dropped-by-4-degrees-the-effect-of-cold-winds-will-remain-till-february-18', NULL, NULL, 'राजस्थान में एक बार फिर मौसम में बदलाव हो सकता है। पहाड़ों में हो रही बर्फबारी से आज और कल सर्दी बढ़ सकती है। हालांकि, इसका असर कल शाम से ही दिखना शुरू हो गया है', '<p>राजस्थान में एक बार फिर मौसम में बदलाव हो सकता है। पहाड़ों में हो रही बर्फबारी से आज और कल सर्दी बढ़ सकती है। हालांकि, इसका असर कल शाम से ही दिखना शुरू हो गया है।</p>\r\n<p>तापमान में भी तीन-चार डिग्री की गिरावट देखने को मिली है। मौसम विभाग के अनुसार मौसम में हो रहे बदलाव का असर 16 फरवरी तक रह सकता है।</p>\r\n<p>मौसम एक्सपर्ट ने बताया कि कश्मीर, हिमाचल, लद्दाख एरिया में हुई भारी बर्फबारी हुई है। पहाड़ों से चलने वाली हवाओं के असर के कारण शनिवार को मैदानी राज्यों के कई हिस्सों में रात का तापमान गिरा है, जिससे यहां रात में ठंड बढ़ गई है।</p>\r\n<p>सबसे ज्यादा बीकानेर, सीकर, चूरू, झुंझुनूं में मिनिमम टेम्परेचर 4 डिग्री गिरा है। मौसम विशेषज्ञों के मुताबिक अगले 6 दिन सर्द हवाओं का असर रहेगा।</p>\r\n<p>मौसम केन्द्र जयपुर से जारी रिपोर्ट देखें तो आज बीकानेर, चूरू, चित्तौड़गढ़, सीकर, अजमेर, पिलानी, गंगानगर में आज तापमान 1 से लेकर 4 डिग्री तक कम हुआ है।</p>\r\n<p>सीकर में मिनिमम टेम्परेचर 4.5 डिग्री सेल्सियस गिरकर 12.5 पर पहुुंच गया। इसके अलावा सीकर के आसपास के एरिया में आज सुबह हल्का कोहरा भी देखने को मिला, जिसके साथ हल्की सर्द हवा भी चली। इसी तरह बीकानेर में भी शनिवार को मिनिमम टेम्परेचर 15.1 से गिरकर 11.7 डिग्री सेल्सियस पर पहुंच गया।</p>\r\n<p>राजस्थान में अभी तापमान में उतार-चढ़ाव का दौर जारी है। एक तरफ उत्तरी राजस्थान में जहां रात और दिन के टेम्प्रेचर कल मामूली गिरे है वहीं, दक्षिण-पूर्वी राजस्थान में दिन में गर्मी थोड़ी बढ़ी है।</p>\r\n<p>हाड़ौती क्षेत्र में कोटा, बारां, बूंदी में तापमान 31 डिग्री सेल्सियस से ऊपर चला गया है। कोटा में कल दिन का तापमान 3 डिग्री सेल्सियस बढ़कर 34.8 पर दर्ज हुआ, जो राजस्थान में कल सबसे ज्यादा तापमान रहा। इसी तरह चित्तौड़गढ़ में टेम्परेचर 33.1, उदयपुर में 31.6, डूंगरपुर में 32 और बारां में 31.9 डिग्री सेल्सियस दर्ज हुआ।</p>\r\n<p>बर्फबारी के बाद शुरू हुई ठंडी उत्तरी हवाओं का असर राजस्थान में 15 फरवरी तक रहेगा। 16 फरवरी से राज्य में तापमान फिर से बढ़ने लगेगा।</p>\r\n<p>संभावना है कि इस बार टेम्परेचर बाड़मेर, जोधपुर समेत कई जगहों पर 35 डिग्री सेल्सियस या उससे ऊपर जा सकता है।</p>', 1, 'uploads/images/202302/image_870x580_63e760a6c74ea.jpg', 'uploads/images/202302/image_870x_63e760a6d590a.jpg', 'uploads/images/202302/image_694x532_63e760a6de7d2.jpg', 'uploads/images/202302/image_430x256_63e760a6e2ac6.jpg', 'uploads/images/202302/image_140x98_63e760a6e49e4.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-11 15:02:33'),
(8, 1, 'टेस्ट के तीसरे ही दिन कंगारुओं ने टेके घुटने, भारत ने 132 रन से जीता पहला टेस्ट', 'kangaroos-kneel-on-the-third-day-of-the-test-india-won-the-first-test-by-132-runs', NULL, NULL, 'टीम इंडिया ने बॉर्डर-गावस्कर ट्रॉफी का पहला मुकाबला पारी और 132 रनों से जीत लिया है। इसके साथ ही भारतीय टीम ने चार मैचों की सीरीज में 1-0 की बढ़त हासिल कर ली है। सीरीज का दूसरा मुकाबला 17 फरवरी से दिल्ली में खेला जाएगा।', '<p>टीम इंडिया ने बॉर्डर-गावस्कर ट्रॉफी का पहला मुकाबला पारी और 132 रनों से जीत लिया है। इसके साथ ही भारतीय टीम ने चार मैचों की सीरीज में 1-0 की बढ़त हासिल कर ली है। सीरीज का दूसरा मुकाबला 17 फरवरी से दिल्ली में खेला जाएगा।</p>\r\n<p>नागपुर के जामथा क्रिकेट स्टेडियम में शनिवार को भारतीय गेंदबाजों ने दूसरी पारी में ऑस्ट्रेलिया को 91 रनों पर ऑलआउट कर दिया। कंगारू टीम से स्टीव स्मिथ ने सबसे ज्यादा 24 रन बनाए। मार्नस लाबुशेन 17 रन का योगदान दिया। जबकि डेविड वॉर्नर और एलेक्स कैरी 10-10 रन बनाकर आउट हुए। भारतीय स्पिनर रविचंद्रन अश्विन ने 5 विकेट हासिल किए। मोहम्मद शमी और रवींद्र जडेजा ने दो-दो विकेट लिए। अक्षर पटेल को एक विकेट मिला।</p>\r\n<p>इससे पहले, भारत की पहली पारी 400 रन पर समाप्त हुई। ऐसे में मेजबानों को पहली पारी में 223 रनों की बढ़त मिली थी। कप्तान रोहित शर्मा ने 120, अक्षर पटेल ने 84 रन बनाए। रवींद्र जडेजा ने 70 और मोहम्मद शमी ने 37 रन की उपयोगी पारी खेली। ऑस्ट्रेलिया के लिए डेब्यू कर रहे टॉड मर्फी ने 7 विकेट लिए। ऑस्ट्रेलिया की पहली पारी 177 रन पर सिमटी थी।</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63e76290285f4.jpg\" alt=\"\"></p>\r\n<p>यह प्लेयर्स रहे जीत के हीरो:</p>\r\n<p>रवींद्र जडेजा: हरफनमौला खिलाड़ी रवींद्र जडेजा ने बैट और बॉल दोनों से प्रदर्शन किया। उन्होंने दोनों पारियों में 7 विकेट चटकाए। इतना ही नहीं, जरूरत पड़ने पर जडेजा ने 70 रनों की उपयोगी पारी भी खेली। जडेजा ने अक्षर के साथ 88 रनों की पार्टनरशिप की।</p>\r\n<p>रविचंद्रन अश्विन: दोनों पारियों में 8 विकेट चटकाए। साथ ही 23 रन भी बनाए। पहले दिन नाइटवॉचमैन के रूप में उतरे अश्विन ने दूसरे दिन के पहले सेशन तक विकेट गिरने नहीं दिया।</p>\r\n<p>रोहित शर्मा: ओपन करने आए भारतीय कप्तान ने 120 रनों की शतकीय पारी खेलकर टीम इंडिया को मजबूत शुरुआत दिलाई। उन्होंने केएल राहुल के साथ 76 रनों की ओपनिंग पार्टनरशिप की।</p>', 1, 'uploads/images/202302/image_870x580_63e76278cf29b.jpg', 'uploads/images/202302/image_870x_63e76278d9f23.jpg', 'uploads/images/202302/image_694x532_63e76278e556d.jpg', 'uploads/images/202302/image_430x256_63e76278ebb1a.jpg', 'uploads/images/202302/image_140x98_63e76278ee496.jpg', 'jpg', 'local', NULL, 3, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-11 15:13:16'),
(9, 1, 'काम से घर लौट रहा था युवक, कार टकराने से मौत', 'youth-was-returning-home-from-work-died-due-to-car-collision', NULL, NULL, 'हरियाणा के पानीपत जिले में रिफाइनरी टाउनशिप के नजदीक तेज रफ्तार कार ने बाइक को सामने से टक्कर मार दी। हादसे में घायल युवक को उसका बड़ा भाई सिविल अस्पताल लेकर पहुंचा। जहां डॉक्टरों ने उसे मृत घोषित कर दिया', '<p>हरियाणा: पानीपत जिले के रिफाइनरी टाउनशिप के नजदीक तेज रफ्तार कार ने बाइक को सामने से टक्कर मार दी। हादसे में घायल युवक को उसका बड़ा भाई सिविल अस्पताल लेकर पहुंचा। जहां डॉक्टरों ने उसे मृत घोषित कर दिया। वहीं हादसे के बाद आरोपी मौके से फरार हो गया।<br>भाई की की शिकायत के आधार पर आरोपी के खिलाफ गैर इरादतन हत्या का केस दर्ज कर लिया है।</p>\r\n<p>सदर थाना पुलिस को दी शिकायत में प्रवीन ने बताया कि वह करनाल के गांव रायपुर जाटान का रहने वाला है। वह रिफाइनरी 2G प्लांट में नौकरी करता है। उसका छोटा भाई प्रदीप (30) था। जोकि चीमा एंड कंपनी में रिफाइनरी में काम करता था। 9 फरवरी को उसका भाई प्रदीप ड्यूटी खत्म करने के बाद अपनी बाइक पर सवार होकर घर जा रहा था। उसके पीछे वह खुद अपनी अलग बाइक पर चल रहा था।</p>\r\n<p>जब वे दोनों टाउनशिप रोड पर खिल्लन मोटर के सामने पहुंचे तो सामने से एक तेज रफ्तार बोलेरो गाड़ी आई। उसने सीधे प्रदीप की बाइक को टक्कर मार दी। टक्कर लगते ही प्रदीप बाइक सहित सड़क पर गिर गया।</p>\r\n<p>हादसा के बाद प्रवीन भी मौके पर पहुंच गया। जिस दौरान उसने देखा कि आरोपी कार HR45D-0697 चालक कुछ दूर जाकर रुका और फिर वहां से फरार हो गया। वह घायल अवस्था में अपने भाई को तुरंत सिविल अस्पताल ले गया। जहां डॉक्टरों ने उसके भाई को मृत घोषित कर दिया।</p>', 1, 'uploads/images/202302/image_870x580_63e78a7b9e293.jpg', 'uploads/images/202302/image_870x_63e78a7ba8f1b.jpg', 'uploads/images/202302/image_694x532_63e78a7bb2057.jpg', 'uploads/images/202302/image_430x256_63e78a7bb6b97.jpg', 'uploads/images/202302/image_140x98_63e78a7bb8803.jpg', 'jpg', 'local', NULL, 3, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-11 18:01:21'),
(10, 1, 'तुर्किये में मलबे से बाहर आ रही जिंदगियाँ, कोई अपना यूरिन पी कर ज़िंदा तो कोई गाने से अपना मन बहला रहा', 'lives-coming-out-of-the-rubble-in-turkey-some-alive-by-drinking-their-own-urine-and-some-amused-themselves-by-singing', NULL, NULL, '6 फरवरी को तुर्किये-सीरिया में आए 7.8 तीव्रता के भूकंप से अब तक 24 हजार से लोगों की मौत हो चुकी है। 95 से ज्यादा देश यहां मदद भेज रहे हैं। रेस्क्यू ऑपरेशन जारी है। तुर्किये में अब तक 30 हजार से ज्यादा लोगों को बचा लिया गया है।', '<p>6 फरवरी को तुर्किये-सीरिया में आए 7.8 तीव्रता के भूकंप से अब तक 24 हजार से लोगों की मौत हो चुकी है। 95 से ज्यादा देश यहां मदद भेज रहे हैं। रेस्क्यू ऑपरेशन जारी है। तुर्किये में अब तक 30 हजार से ज्यादा लोगों को बचा लिया गया है।</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63e78d4ace08d.jpg\" alt=\"\"></p>\r\n<p>भूकंप के केंद्र तुर्किये का गाजियांटेप शहर था। यहां तबाही के 94 घंटे बाद रेस्क्यू टीम ने 17 साल के लड़के को जिंदा बाहर निकाला। अदनान मुहम्मद कोरकुट ने बाहर निकलने के बाद बताया कि 4 दिन मलबे के बीच जिंदा कैसे रहा।</p>\r\n<p>उसने कहा- मैंने जिंदा रहने के लिए अपना पेशाब पीया और आस-पास बिखरे पड़े कुछ फूल खाए। उसने कहा- भूकंप के समय मैं अपने परिवार के साथ घर में सो रहा था। आंख खुली तो सब तबाह हो चुका था। मलबे के बीच फंसे रहने के दौरान मुझे लोगों की आवाज सुनाई दे रही थी। लेकिन मुझे लग रहा था कि वो लोग मेरी आवाज नहीं सुन पा रहे हैं। 4 दिन बाद मुझे रेस्क्यू किया गया।</p>\r\n<p>तुर्किये में भूकंप से 10 शहर सबसे ज्यादा प्रभावित हुए। इनमें से एक कहरामनमारस शहर है। यहां एक बहुमंजिला इमारत के मलबे से शनिवार को दो बच्चों का रेस्क्यू किया गया। दोनों की उम्र 10 साल से कम है। तबाही के 5 दिन इन बच्चों ने न तो पानी पीया और न ही कुछ खाया।</p>\r\n<p>भूखे-प्यासे ये दोनों बच्चे कड़ाके की ठंड में मदद का इंतजार कर रहे थे। रेस्क्यू ऑपरेशन के दौरान सिक्योरिटी फोर्सेस, डॉक्टर और मेडिकल स्टाफ मौजूद था। जैसे ही बच्चों को बाहर निकाला गया, मेडिकल टीम ने एंबुलेंस में उनका इलाज किया।</p>\r\n<p>इसकेंदेरून शहर में दो बहनें अपने माता-पिता के साथ सो रही थीं। तभी भूकंप से उनका घर तबाह हो गया। सब मलबे में दब गए। रेस्क्यू टीम जब मदद के लिए पहुंची तो दोनों बच्चियां काफी डरी हुई थीं। उन्होंने बताया कि खुद को शांत करने के लिए वो पॉप सॉन्ग सुन रही थीं। उन्होंने कहा- हम बस बाहर आना चाहते थे। मदद का इंतजार करते-करते काफी समय हो गया था। अपने डर पर काबू पाने के लिए हमने गाना सुनना शुरू कर दिया।</p>', 2, 'uploads/images/202302/image_870x580_63e78d38b1e2e.jpg', 'uploads/images/202302/image_870x_63e78d38bf106.jpg', 'uploads/images/202302/image_694x532_63e78d38c8bb5.jpg', 'uploads/images/202302/image_430x256_63e78d38cd8ca.jpg', 'uploads/images/202302/image_140x98_63e78d38cf651.jpg', 'jpg', 'local', NULL, 4, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-11 18:13:18'),
(11, 1, 'खेलो इंडिया मे  महाराष्ट्र पहले , हरयाणा दूसरे पर  और मध्य प्रदेश तीसरे पायदान पर रहा', 'maharashtra-stood-first-haryana-second-and-madhya-pradesh-third-in-khelo-india', NULL, NULL, 'खेलो इंडिया गेम्स में मध्य प्रदेश 29 गोल्ड मेडल के साथ तीसरे स्थान पर रहा।  इस लिस्ट में पहले पायदान पर महाराष्ट्र ने अभी तक कुल 135 और हरियाणा ने 99 मेडल जीते हैं। खेलो इंडिया में सबसे आखिरी पायदान पर त्रिपुरा और गोवा रहे इन्होंने सिर्फ 1-1 मेडल जीते।', '<p>खेलो इंडिया गेम्स में मध्य प्रदेश 29 गोल्ड मेडल के साथ तीसरे स्थान पर रहा। मध्य प्रदेश ने 29 गोल्ड मेडल के अलावा 18 सिल्वर और 26 ब्रॉन्ज समेत कुल 73 मेडल जीते हैं। इस लिस्ट में पहले पायदान पर महाराष्ट्र ने अभी तक कुल 135 और हरियाणा ने 99 मेडल जीते हैं। इसमें महाराष्ट्र के पास 45 गोल्ड 49 सिल्वर और 41 ब्रॉन्ज मेडल हैं। हरियाणा के पास 38 गोल्ड 25 सिल्वर और 36 ब्रॉन्ज मेडल जीते हैं। खेलो इंडिया में सबसे आखिरी पायदान पर त्रिपुरा और गोवा रहे इन्होंने सिर्फ 1-1 मेडल जीते।</p>\r\n<p>इस बारे में बात करते हुए प्रमुख सचिव खेल दीप्ति गौड मुखर्जी ने बताया कि शनिवार शाम 5.30 बजे ओपन बस में सभी विजेता खिलाड़ी टीटी नगर स्टेडियम से शाम 5.45 बजे सीमए हाउस तक जाएंगे। इसके बाद एक परेड करते हुए खिलाड़ी करीब 6.45 बजे बोट क्लब पहुंचेंगे। यहां खेलों इंडिया की क्लोजिंग सेरेमनी आयोजित होगी। इस दौरान मुख्यमंत्री शिवराज सिंह चौहान, खेल मंत्री अनुराग ठाकुर, प्रदेश खेल मंत्री यशोधरा राजे सिंधिया मौजूद रहेंगी। यह क्लोजिंग सेरेमनी करीब एक घंटे तक चलेगी।</p>\r\n<p>खेलो इंडिया मध्य प्रदेश के 8 शहरों में आयोजित किया गया। इसमें भोपाल, इंदौर, उज्जैन, ग्वालियर, जबलपुर, मण्डला, बालाघाट और खरगोन (महेश्वर) शामिल हैं। एक गेम (साइकिलिंग) दिल्ली में हुआ। 13 दिन चलने वाले खेलो इंडिया में 27 खेल 23 गेम वेन्यू रहे। इसमें करीब 6 हजार खिलाड़ियों ने भाग लिया। इसके अलावा इस पूरे गेम में करीब 2 हजार वॉलंटियर भी शामिल रहे।</p>', 5, 'uploads/images/202302/image_870x580_63e79157c7386.jpg', 'uploads/images/202302/image_870x_63e79157d5359.jpg', 'uploads/images/202302/image_694x532_63e79157e0ae8.jpg', 'uploads/images/202302/image_430x256_63e79157e701f.jpg', 'uploads/images/202302/image_140x98_63e79157e94f1.jpg', 'jpg', 'local', NULL, 2, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-11 18:30:27'),
(12, 1, 'PM ने राजस्थान में किया चुनावी शंखनाद, भाषण में राजनीति से ज्यादा विकास पर फोकस', 'pm-did-election-conch-shell-in-rajasthan-focus-on-development-more-than-politics-in-speech', NULL, NULL, 'प्रधानमंत्री नरेंद्र मोदी ने दौसा में अपनी सभा के साथ राजस्थान में चुनावी शंखनाद कर दिया। मोदी का यह पिछले 3.5 महीने में तीसरा राजस्थान दौरा था। इसमें से यह पहला दौरा था जिसमें बीजेपी के मंच से मोदी ने लोगों को सम्बोधित किया।', '<p>प्रधानमंत्री नरेंद्र मोदी ने दौसा में अपनी सभा के साथ राजस्थान में चुनावी शंखनाद कर दिया। मोदी का यह पिछले 3.5 महीने में तीसरा राजस्थान दौरा था। इसमें से यह पहला दौरा था जिसमें बीजेपी के मंच से मोदी ने लोगों को सम्बोधित किया। अपने भाषण में प्रधानमंत्री ने यूं तो तमाम पहलुओं को छुआ। मगर मोदी की सभा और भाषण के पीछे का बड़ा मकसद तीन दिन पहले आए राजस्थान के लोक-लुभावन बजट को डायल्यूट करना था।</p>\r\n<p>प्रधानमंत्री ने अपने भाषण में उसी वर्ग पर फोकस किया जिस वर्ग को केंद्र में रखकर सीएम अशोक गहलोत ने अपना बजट पेश किया था। गहलोत का बड़ा फोकस युवाओं और किसानों पर था। बजट में उनके लिए महत्वपूर्ण घोषणाएं की गई थीं। ऐसे में पीएम ने भी अपने भाषण में दिल्ली-मुम्बई एक्सप्रेस वे को किसानों और युवाओं से जोड़कर उनके लिए फायदेमंद बताया।</p>\r\n<p>मोदी के मकसद को इसी से समझा जा सकता है कि बीजेपी की सभा होने के बावजूद अपने भाषण में पीएम ने लगभग 80 प्रतिशत तक भाषण सिर्फ विकास की बातों पर दिया। पीएम ज्यादातर समय तक सड़कों, पुल, पोर्ट, रेल, रोजगार, इंडस्ट्री, किसानी की बातें ही करते रहे। अंत में कुछ समय उन्होंने कांग्रेस को घेरा और राजस्थान के विकास के लिए डबल इंजन की सरकार की बात कह कर बीजेपी के पक्ष में वोट करने की लोगों से अपील की।</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63e9ef936a54a.jpg\" alt=\"\"></p>\r\n<p>PM &nbsp;ने की हर वर्ग की बाते&nbsp;</p>\r\n<p>युवा : पीएम ने अपने भाषण की शुरुआत युवाओं से की। दिल्ली से दौसा एक्सप्रेस वे को युवाओं के लिए सबसे महत्वपूर्ण बताया। केंद्र सरकार के राजस्थान में रोड और रेल प्रोजेक्टस की बात करते हुए बताया कि रोड और रेल से ही युवाओं के लिए रोजगार बढ़ते हैं। राेड और रेल का जिक्र करते हुए बताया कि राजस्थान टूरिस्ट्स के आकर्षक का केंद्र पहले से ही है, अब रोड और रेल नेटवर्क बेहतर होगा तो टूरिस्ट ज्यादा आएंगे और इससे युवाओं का रोजगार बढ़ेगा।</p>\r\n<p>किसान : एक्सप्रेस वे को मोदी ने किसानों से भी जोड़ा। फायदा गिनाते हुए कहा कि फल सब्जी उगाने वाले छोटे किसानों को इससे फायदा होगा। उनके लिए दिल्ली का बाजार अब नजदीक होगा। बाजरे का जिक्र करके भी किसानों को साधने की कोशिश की। बाजरे को श्रीअन्न नाम देते हुए किसानों को इंटरनेशनल बाजार तक पहुंच के बारे में बताया।</p>\r\n<p>सैनिक : राजस्थान में बड़ी संख्या में नौजवान सेना में भर्ती होते हैं। ऐसे में अपने भाषण में पीएम ने सैनिकों पर भी फोकस किया। सैनिकों ने नाम से अंडमान में द्वीप बनाए जाने की बात कही। इसके अलावा सीमा से सटे इलाकों में सड़कें और ट्रांसपोर्ट तंत्र विकसित करने को कहा। राजस्थान से सेना में जाने वाले ज्यादातर जवान किसान परिवार से होते हैं। ऐसे में इस बहाने पीएम ने उन्हें भी साधने की कोशिश की।</p>\r\n<p>पीएम मोदी का दौसा में यह कार्यक्रम पहले 4 फरवरी को होना था। मगर बाद में इसे बढ़ाकर 12 फरवरी किया गया। कार्यक्रम आगे बढ़ने से यह राजस्थान के बजट के बाद का रहा। पीएम ने बजट में गहलोत के पुराना बजट पढ़ने का जिक्र तो किया, मगर बजट में गहलोत ने जो घोषणाएं की उसे लेकर सवाल नहीं उठाया। वहीं केंद्र सरकार की योजनाओं और प्रोजेक्टस के बूते विकास की बात की।</p>', 7, 'uploads/images/202302/image_870x580_63e9efa47b032.jpg', 'uploads/images/202302/image_870x_63e9efa489742.jpg', 'uploads/images/202302/image_694x532_63e9efa4969e5.jpg', 'uploads/images/202302/image_430x256_63e9efa49da2b.jpg', 'uploads/images/202302/image_140x98_63e9efa4a0ae4.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, NULL, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, '2023-02-13 13:40:32', '2023-02-13 13:37:17'),
(13, 1, 'बालाजी सरकार के दर्शन  करने बागेश्वर धाम पहुंचे  कमलनाथ , पं. धीरेंद्र शास्त्री से की मुलाकात', 'kamal-nath-reached-bageshwar-dham-to-visit-balaji-sarkar-met-pt-dhirendra-shastri', NULL, NULL, 'पूर्व मुख्यमंत्री और प्रदेश कांग्रेस अध्यक्ष कमलनाथ सोमवार को छतरपुर के गढ़ा स्थित बागेश्वर धाम पहुंचे। यहां उन्होंने बालाजी सरकार के दर्शन किए। इसके बाद बागेश्वर धाम के पीठाधीश्वर पंडित पंडित धीरेंद्र कृष्ण शास्त्री से मिलने पहुंचे। मुलाकात के बाद उन्होंने धीरेंद्र शास्त्री के हिंदू राष्ट्र बनाने की मांग को लेकर बड़ा बयान दिया।', '<p>पूर्व मुख्यमंत्री और प्रदेश कांग्रेस अध्यक्ष कमलनाथ सोमवार को छतरपुर के गढ़ा स्थित बागेश्वर धाम पहुंचे। यहां उन्होंने बालाजी सरकार के दर्शन किए। इसके बाद बागेश्वर धाम के पीठाधीश्वर पंडित पंडित धीरेंद्र कृष्ण शास्त्री से मिलने पहुंचे। मुलाकात के बाद उन्होंने धीरेंद्र शास्त्री के हिंदू राष्ट्र बनाने की मांग को लेकर बड़ा बयान दिया।</p>\r\n<p>कमलनाथ से जब मीडियाकर्मियों ने पूछा कि पं. धीरेंद्र शास्त्री तो भारत को हिंदू राष्ट्र बनाने की बात कहते हैं। आप क्या कहेंगे? इस पर पूर्व सीएम बोले- भारत अपने संविधान के अनुसार चलता है। बाबा साहब आंबेडकर ने संविधान बनाया था। वही भारत का संविधान है।</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63ea0641a771b.jpg\" alt=\"\"></p>\r\n<p>कमलनाथ ने आगे कहा, मैंने छिंदवाड़ा में सबसे बड़ा हनुमान मंदिर बनवाया है। 101 फीट से भी ऊंचा। यहां मैंने हनुमान जी के दर्शन कर प्रार्थना की। मध्यप्रदेश का भविष्य सुरक्षित रहे। आज प्रदेश में जो चुनौतियां हैं, इन चुनौतियां का सामना हम सब मिलकर करें। महाराज ने मुझे अवश्य आशीर्वाद दिया। वह सभी को आशीर्वाद देते हैं।</p>\r\n<p>कमलनाथ सुबह 10.15 पर खजुराहो विमानतल पर&lrm; चार्टर्ड विमान से पहुंचे।&lrm; उनके साथ पूर्व प्रदेश अध्यक्ष अरुण यादव भी नजर आए। यहां जिलाध्यक्ष लखन लाल पटेल की&lrm; अगुवाई में जिले के विधायक, पूर्व&lrm; विधायक, संगठन प्रभारी, संगठन&lrm; मंत्री सहित पार्टी पदाधिकारियों ने&lrm; उनका स्वागत किया। यहां से कमलनाथ हेलीकॉप्टर&lrm; के जरिए करीब साढ़े 10 बजे&lrm; बागेश्वर धाम पहुंचे। जहां उन्होंने बालाजी&lrm; सरकार के दर्शन एवं पूजा-पाठ कर&lrm; पंडित धीरेंद्र कृष्ण शास्त्री से&lrm; मुलाकात की। यहां से वे पन्ना जिले की अजयगढ़ तहसील&lrm; के लिए रवाना हो गए।</p>\r\n<p>कमलनाथ ने यहां पहुंचकर किसी भी राजनीतिक मुद्दे पर बात नहीं की। यहां वे पूरी तरह से भक्ति के रंग में नजर आए। हनुमान जी के दर्शन के बाद वे कार में सवार होकर सीधे हेलीपैड के लिए रवाना हुए। इस दौरान पहले वे गाड़ी में बैठे-बैठे लोगों का अभिवादन स्वीकार करते रहे, लेकिन बाद में कार का गेट खोलकर खड़े हो गए और फिर हाथ हिलाते हुए आगे बढ़े। यहां उन्होंने बच्चों से बात की और उनके सिर पर हाथ रखकर दुलारा भी।</p>', 3, 'uploads/images/202302/image_870x580_63ea06310a90f.jpg', 'uploads/images/202302/image_870x_63ea0631155f6.jpg', 'uploads/images/202302/image_694x532_63ea06311e6d7.jpg', 'uploads/images/202302/image_430x256_63ea063122f54.jpg', 'uploads/images/202302/image_140x98_63ea063124c4e.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-13 15:14:11'),
(14, 1, 'भोपाल में  भीम आर्मी का शक्ति प्रदर्शन, जानिये MP में इसका कितना असर ?', 'bhim-armys-show-of-strength-in-bhopal-know-its-impact-in-mp', NULL, NULL, 'मध्यप्रदेश में इस साल के अंत में विधानसभा के चुनाव होने हैं। चुनावी साल की शुरुआत में ही प्रदेश में जातिगत और सामाजिक आंदोलन सत्ताधारी दल बीजेपी और कांग्रेस की मुसीबत बढ़ा रहे हैं। पहले 8 जनवरी को राजधानी के जंबूरी मैदान पर करणी सेना परिवार ने अपनी मांगों को लेकर शक्ति प्रदर्शन किया। इस आंदोलन के एक महीने बाद भीम आर्मी और आजाद समाज पार्टी ने 12 फरवरी को अपनी ताकत दिखाई।', '<p>मध्यप्रदेश में इस साल के अंत में विधानसभा के चुनाव होने हैं। चुनावी साल की शुरुआत में ही प्रदेश में जातिगत और सामाजिक आंदोलन सत्ताधारी दल बीजेपी और कांग्रेस की मुसीबत बढ़ा रहे हैं। पहले 8 जनवरी को राजधानी के जंबूरी मैदान पर करणी सेना परिवार ने अपनी मांगों को लेकर शक्ति प्रदर्शन किया। इस आंदोलन के एक महीने बाद भीम आर्मी और आजाद समाज पार्टी ने 12 फरवरी को अपनी ताकत दिखाई।</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63ea12eb60b56.jpg\" alt=\"\"></p>\r\n<p>आजाद समाज पार्टी के राष्ट्रीय अध्यक्ष चंद्रशेखर आजाद ने विधानसभा चुनाव तक एमपी में 5 यात्रा निकालने और सत्ता परिवर्तन के लिए लड़ाई जारी रखने का ऐलान कर दिया। आरक्षण के समर्थन में दलित और आदिवासी वर्ग के साथ ही ओबीसी महासभा ने भी इस आंदोलन को समर्थन दिया। भीम आर्मी के आंदोलन के पीछे की बड़ी वजह करणी सेना के आंदोलन में आरक्षण में संशोधन और एट्रोसिटी एक्ट के नियमों में बदलाव की मांगों को माना जा रहा है। जनवरी में करणी सेना के आंदोलन के दौरान ही भीम आर्मी ने भोपाल में आरक्षण के समर्थन में बड़े शक्ति प्रदर्शन की तैयारी शुरू कर दी थी। इन दोनों आंदोलन का चुनावी सियासत पर कितना असर पड़ेगा।&nbsp;</p>\r\n<p>जनवरी में आंदोलन करने वाले करणी सेना परिवार के प्रमुख जीवन सिंह शेरपुर कहते हैं कि हमारे आंदोलन के बाद सरकार ने लिखित में आश्वासन दिया था। अफसरों की कमेटी बनाकर दो महीने में कार्रवाई करने का भरोसा दिया था। एक महीने का वक्त निकल चुका है। अब तक कुछ भी नहीं हुआ, बल्कि हमारे कार्यकर्ताओं पर लगातार मुकदमे बनाए जा रहे हैं। जो गलती हमारे लोगों से हुई थी, हम सबने उसके लिए सार्वजनिक तौर पर माफी भी मांगी थी। मुख्यमंत्री जी ने भी ट्वीट कर सबको माफ करने की बात कही थी, लेकिन सीएम के माफ कर देने के बाद भी हमारे साथियों पर केस लगाए जा रहे हैं। एक साथी तो जेल में बंद हैं। उनकी जैसे ही एक मामले में जमानत होती है, दूसरे थाने में केस दर्ज करके गिरफ्तार कर लिया जाता है।</p>\r\n<p>शेरपुर ने कहा कि अगर सरकार ने हमारी बात नहीं सुनी तो हम फिर बड़ा आंदोलन करेंगे। जहां तक बात आरक्षण में संशोधन और एट्रोसिटी एक्ट में बिना जांच गिरफ्तारी वाले मामले की है, उन्हें हमने केन्द्र के अधीन छोड़ दिया, लेकिन सरकार राज्य के मामलों पर जल्दी फैसला ले। वरना आने वाले चुनाव में हम बीजेपी को सबक सिखाएंगे।</p>\r\n<p>आजाद समाज पार्टी मध्यप्रदेश के अध्यक्ष सुनील आस्तेय ने बताया कि जब दलितों के खिलाफ अन्याय के मामले बढ़ने लगे तो पिछले साल 16 अक्टूबर को हमने प्रदेशभर में यात्रा निकालने की रणनीति बनाई थी। अन्याय के खिलाफ सामाजिक न्याय यात्रा 2 जनवरी को हम भोपाल में खत्म करने वाले थे, लेकिन भोपाल में प्रशासन ने अनुमति नहीं दी। फिर हमने 10 जनवरी की परमिशन मांगी, वह भी नहीं दी। फिर 12 फरवरी को भोपाल में आंदोलन की डेट फाइनल हुई। हमने पिछले साल 9 दिसंबर को इसकी घोषणा की थी। इसी बीच करणी सेना के आंदोलन में आरक्षण को लेकर बात छेड़ दी। सरकार ने भी करणी सेना का साथ दिया। फिर हमने तय किया कि हम आरक्षण के समर्थन में लड़ेंगे और प्रदेशभर में विधानसभा से लेकर संभाग स्तर पर प्रचार किया।</p>\r\n<p>सुनील आस्तेय ने बताया कि कई जिलों में परमिशन नहीं दी। हमारे साथ ऐसा भेदभाव किया गया। करणी सेना के आंदोलन में तीन हजार पुलिस के जवान लगाए गए, लेकिन भीम आर्मी के आंदोलन में पुलिस नजर नहीं आई। इसको लेकर पुलिस कमिश्नर से मिलेंगे। हमारे आंदोलन स्थल पर पानी के टैंकर तक नहीं भेजे गए।</p>\r\n<p>हमारी मुख्य मांगें एक महीने के अंदर नहीं मानी गई तो हम फिर दोगुनी संख्या में आएंगे। अबकी बार जंबूरी मैदान पर ही अपनी ताकत दिखाएंगे। अगर सरकार नहीं सुनती है, तो जयस, गोंडवाना गणतंत्र पार्टी, ओबीसी महासभा के साथ मिलकर आदिवासी मुख्यमंत्री बनाएंगे। दलित, ओबीसी और अल्पसंख्यक वर्ग के तीन डिप्टी सीएम बनाएंगे।​​​​​​</p>\r\n<p>करणी सेना परिवार के प्रमुख जीवन सिंह शेरपुर अपने साथियों के साथ जंबूरी मैदान पर ही भूख हड़ताल पर बैठ गए। उनके समर्थन में जंबूरी मैदान पर भारी जन सैलाब नजर आया। हजारों की संख्या में वाहन जुटे। दोपहर में जब भीड़ जुटी और करणी सेना परिवार ने विधानसभा घेराव का ऐलान किया तो पुलिस के जरिए सरकार का संदेश पहुंचा कि आपसे मिलने के लिए सरकार की ओर से प्रतिनिधि आएंगे, लेकिन शाम तक कोई नहीं आया। इसके बाद एक दिन के आंदोलन को अनिश्चितकालीन धरने में बदलकर करणी सेना के कार्यकर्ता जंबूरी मैदान पर ही धरने पर बैठ गए।</p>\r\n<p>इधर, सरकार के मंत्री अरविंद भदौरिया से करणी सेना परिवार के प्रतिनिधिमंडल से चर्चा की, लेकिन वार्ता विफल रही। इसके बाद अगले दिन कार्यकर्ताओं ने एमपी नगर की ओर कूच कर दिया। पुलिस ने भेल के महात्मा गांधी चौराहे पर ही करणी सेना के कार्यकर्ताओं को रोक दिया। इसके बाद करणी सेना के लोग वहीं धरने पर चार दिन तक बैठे रहे। अंत में चौथे दिन की रात आठ बजे शिवराज सरकार के मंत्री अरविंद भदौरिया धरनास्थल पर पहुंचे और आश्वासन देकर धरना समाप्त कराया। मंत्री भदौरिया ने करणी सेना परिवार की मांगों पर विचार कर रिपोर्ट देने के लिए जीएसडी के पीएस की अध्यक्षता में अफसरों की कमेटी बनाने की घोषणा की।</p>', 3, 'uploads/images/202302/image_870x580_63ea12f629f22.jpg', 'uploads/images/202302/image_870x_63ea12f638c3c.jpg', 'uploads/images/202302/image_694x532_63ea12f644cab.jpg', 'uploads/images/202302/image_430x256_63ea12f64a7cc.jpg', 'uploads/images/202302/image_140x98_63ea12f64c6e7.jpg', 'jpg', 'local', NULL, 2, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-13 16:08:00'),
(15, 1, 'क्या राहुल गांधी सच में फंस गए ? जानिए विशेषाधिकार हनन नोटिस पर आगे  का  फैसला', 'is-rahul-gandhi-really-trapped-know-further-decision-on-breach-of-privilege-notice', NULL, NULL, 'कांग्रेस सांसद राहुल गांधी मुश्किल में फंस सकते हैं। उन्हें लोकसभा सचिवालय से विशेषाधिकार हनन के नोटिस पर जवाब देने को कहा गया है। 15 फरवरी को उनका जवाब मिलने पर लोकसभा अध्यक्ष तय करेंगे कि आगे क्या कदम उठाया जाए। जान लीजिए लोकसभा अध्यक्ष के पास क्या-क्या विकल्प हैं।', '<p>कांग्रेस सांसद राहुल गांधी मुश्किल में फंस सकते हैं। उन्हें लोकसभा सचिवालय से विशेषाधिकार हनन के नोटिस पर जवाब देने को कहा गया है। 15 फरवरी को उनका जवाब मिलने पर लोकसभा अध्यक्ष तय करेंगे कि आगे क्या कदम उठाया जाए। जान लीजिए लोकसभा अध्यक्ष के पास क्या-क्या विकल्प हैं।</p>\r\n<p>नियमों के तहत लोकसभा अध्यक्ष तय करेंगे कि राहुल गांधी के खिलाफ ऐक्शन<br>नई दिल्ली: कांग्रेस के पूर्व अध्यक्ष और लोकसभा सांसद राहुल गांधी को विशेषाधिकार हनन का नोटिस दिया गया है। लोकसभा सचिवालय की तरफ से जारी नोटिस में राहुल गांधी को जवाब देने के लिए 15 फरवरी की मियाद दी गई है। केरल के वायनाड से सांसद राहुल गांधी ने राष्ट्रपति के अभिभाषण के लिए पेश धन्यवाद प्रस्ताव पर बोलेत हुए आरोप लगाया था कि प्रधानमंत्री के अरबपति गौतम अडानी के साथ संबंध हैं। इसी के खिलाफ संसदीय कार्य मंत्री प्रह्लाद जोशी और बीजेपी सांसद निशिकांत दुबे ने राहुल को विशेषाधिकार हनन नोटिस भेजा था।</p>\r\n<p>नियम के मुताबिक, अब राहुल गांधी नोटिस का जवाब देंगे। उस पर लोकसभा अध्यक्ष विचार करेंगे। अगर उन्हें लगेगा कि राहुल गांधी के जवाब पर विशेषाधिकार समिति को विचार करना चाहिए तो वह समिति के पास नोटिस का जवाब भेज सकते हैं। अगर लोकसभा अध्यक्ष ओम बिरला को राहुल गांधी के जवाब को समिति के पास भेजने की जरूरत नहीं महसूस होगी तब वह इस पर लोकसभा में ही चर्चा करवाएंगे। लोकसभा की वेबसाइट पर दिए गए गए रूल बुक के मुताबिक, लोकसभा अध्यक्ष पर निर्भर है कि वह मामले को सदन में ही उठाने का निर्णय करें या फिर उसे विशेषाधिकार समिति के पास भेजें।</p>\r\n<p>नियम कहता है, \'विशेषाधिकार का प्रश्न उठाए जाने के लिए सभा द्वारा अनुमति दिए जाने के बाद उस मामले पर सभा द्वारा स्वयं विचार और निर्णय किया जा सकता है या उसे सभा द्वारा, किसी सदस्य के प्रस्ताव पर परीक्षण, अन्वेषण और प्रतिवेदन के लिए विशेषाधिकार समिति को सौंपा जा सकता है। हालांकि, सामान्य प्रथा यह है कि शिकायत वाला मामला विशेषाधिकार समिति को सौंप दिया जाता है और सभा अपना निर्णय समिति का प्रतिवेदन सभा में पेश किए जाने तक स्थगित रखती है। हालांकि, जहां सभा देखती है कि मामला बहुत ही मामूली है या अपराधी ने पर्याप्त क्षमा याचना कर ली है, उस मामले में आगे की कोई कार्यवाही न करने का निर्णय करके सभा स्वयं उस मामले को निपटा देती है।\'</p>\r\n<p>अगर लोकसभा अध्यक्ष मामले को विशेषाधिकार समिति के पास भेजने का मन बनाएंगे तो 15 सदस्यों की समिति का गठन किया जाएगा। लोकसभा अध्यक्ष ओम बिरला को अलग-अलग दलों के सदस्यों से समिति का गठन करेंगे। यही समिति विचार करेगी कि विशेषाधिकार हनन का प्रस्ताव सही है या नहीं। अगर समिति ने राहुल गांधी को विशेषाधिकार हनन का दोषी पाया तो उनके खिलाफ कार्रवाई की सिफारिश की जाएगी। रूल बुक में कहा गया है, \'अध्यक्ष विशेषाधिकार या अवमानना का कोई मामला खुद ही विशेषाधिकार समिति को परीक्षण, अन्वेषण और प्रतिवेदन के लिए सौंप सकता है। ऐसा करते हुए अध्यक्ष को यह विचार और निर्णय करने के लिए कि क्या वह मामला समिति को इस प्रकार सौंपा जाए, उस मामले को सभा में लाने की आवश्यकता नहीं होती है। ऐसे उल्लिखित मामलों पर समिति के प्रतिवेदन अध्यक्ष को प्रस्तुत किए जाते हैं जो प्रतिवेदन को सभा पटल पर रखने के लिए निर्देश दे सकता है।\'</p>\r\n<p>ध्यान रहे कि संसदीय कार्य मंत्री प्रह्लाद जोशी ने राहुल गांधी पर लोकसभा के कामकाज के नियम 353 और 369 के उल्लंघन का आरोप लगाया है। उन्होंने कहा कि नियम 353 के तहत जो सदन में मौजूद नहीं हो, उसके खिलाफ आरोप नहीं लगाए जा सकते क्योंकि वह अपना बचाव नहीं कर सकता है। नियम 353 ही कहता है कि किसी सदस्य को किसी अन्य सदस्य के खिलाफ आरोप मढ़ने से पहले लोकसभा सचिवालय को बताना होता है और लोकसभा अध्यक्ष से अनुमति लेनी होती है। वहीं, नियम 369 के तहत कोई सदस्य सदन में कोई कागज दिखाए तो उसे उसकी सत्यता का प्रमाण पेश करना होता है। संसदीय कार्य मंत्री का कहना है कि राहुल गांधी ने इन दोनों ही नियमों की अवहेलना की है।</p>\r\n<p>राष्ट्रपति के अभिभाषण पर धन्यवाद प्रस्ताव पर चर्चा में भाग लेने के दौरान राहुल गांधी ने लोकसभा में अपने भाषण के दौरान प्रधानमंत्री पर यह आरोप लगाया था। कांग्रेस सांसद ने 2014 में भाजपा के नेतृत्व वाले एनडीए के सत्ता में आने के बाद व्यवसायी की संपत्ति में अचानक वृद्धि की ओर इशारा करते हुए अडानी के साथ प्रधानमंत्री मोदी के संबंधों पर सवाल उठाया था। राहुल गांधी ने प्रधानमंत्री नरेंद्र मोदी पर क्रोनी कैपिटलिज्म का आरोप लगाया था।</p>\r\n<p>लोकसभा सचिवालय के सूत्रों के अनुसार, नोटिस में 7 फरवरी को लोकसभा में राष्ट्रपति के अभिभाषण पर चर्चा के दौरान भ्रामक, अपमानजनक, असंसदीय और आपत्तिजनक बयान देने के कारण कांग्रेस नेता राहुल गांधी से जवाब मांगा गया है। 10 फरवरी को लिखे एक पत्र में सचिवालय ने राहुल गांधी से 15 फरवरी तक नोटिस पर अपना जवाब देने को कहा है। भाजपा सांसद निशिकांत दुबे ने 8 फरवरी को स्पीकर ओम बिरला को पत्र लिखकर राहुल गांधी के खिलाफ विशेषाधिकार हनन का नोटिस दिया था। नोटिस में कांग्रेस नेता पर प्रधानमंत्री मोदी&nbsp;</p>', 7, 'uploads/images/202302/image_870x580_63ea2ac038079.jpg', 'uploads/images/202302/image_870x_63ea2ac045f50.jpg', 'uploads/images/202302/image_694x532_63ea2ac05206e.jpg', 'uploads/images/202302/image_430x256_63ea2ac057360.jpg', 'uploads/images/202302/image_140x98_63ea2ac0593c2.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, NULL, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, '2023-02-13 17:49:43', '2023-02-13 17:11:54'),
(16, 1, 'सुप्रीम कोर्ट ने जम्मू कश्मीर में विधानसभा सीटों के  परिसीमन को सही ठहराया, चुनौती देने वाली याचिका को किया खारिज', 'supreme-court-upholds-delimitation-of-assembly-seats-in-jammu-and-kashmir-dismisses-petition-challenging-it', NULL, NULL, 'देश की सर्वोच्च अदालत सुप्रीम कोर्ट ने सोमवार को जम्मू कश्मीर में विधानसभा सीटों की परिसीमन को सही ठहराया है। सुप्रीम कोर्ट ने परिसीमन की प्रक्रिया की चुनौती देने वाली याचिका को खारिज कर दिया है।', '<p>&nbsp;जम्मू कश्मीर में धारा 370 समाप्त किए जाने के बाद राज्य के विधानसभा सीटों के सीमांकन के लिए परिसीमन किया गया था। राज्य परिसीमन आयोग ने काफी परिश्रम के बाद अपनी रिपोर्ट सरकार को सौंपी थी। इस रिपोर्ट में जम्मू संभाग में विधानसभा सीट बढाने की बात कही गई थी। जिसका कश्मीर की कई राजनीतिक पार्टियां विरोध कर रही थी। बाद में मामला सुप्रीम कोर्ट पहुंचा। जहां आज जम्मू कश्मीर के परिसीमन को सही ठहराया गया है। सोमवार को सुप्रीम कोर्ट ने जम्मू कश्मीर के विधानसभा सीटों के परिसीमन की प्रक्रिया की चुनौती देने वाली याचिका पर सुनवाई की। सुनवाई में अदालत ने परिसीमन की प्रक्रिया को सही ठहराया। और उसे चुनौती देने वाली याचिका को खारिज कर दिया। सुनवाई के दौरान कोर्ट ने यह भी कहा कि अनुच्छेद 370 के निष्क्रिय होने के बाद जम्मू-कश्मीर और लद्दाख के पुनर्गठन का मसला उसके पास लंबित है। इस सुनवाई में उसने इस पहलू पर विचार नहीं किया है।</p>\r\n<p>गौरतलब हो कि श्रीनगर के रहने वाले हाजी अब्दुल गनी खान और मोहम्मद अयूब मट्टू ने परिसीमन की प्रक्रिया की चुनौती देने हुए सुप्रीम कोर्ट में याचिका दाखिल की थी। इन लोगों ने अपनी याचिका में कहा था कि परिसीमन में सही प्रक्रिया का पालन नहीं किया गया है। केंद्र सरकार, जम्मू-कश्मीर प्रशासन और चुनाव आयोग ने इस दलील को गलत बताया था।</p>\r\n<p>पिछले साल 13 मई 2022 को सुप्रीम कोर्ट ने इस मामले पर नोटिस जारी किया था। तब भी कोर्ट ने साफ किया था कि सुनवाई सिर्फ परिसीमन पर होगी। जम्मू-कश्मीर में अनुच्छेद 370 हटाने से जुड़े मसले पर विचार नहीं किया जाएगा। फिर 1 दिसंबर 2022 को जस्टिस संजय किशन कौल और अभय एस ओका की बेंच ने मामले में फैसला सुरक्षित रखा था।</p>', 1, 'uploads/images/202302/image_870x580_63ea22f5b5bfe.jpg', 'uploads/images/202302/image_870x_63ea22f5bf6dd.jpg', 'uploads/images/202302/image_694x532_63ea22f5c8c52.jpg', 'uploads/images/202302/image_430x256_63ea22f5cda1d.jpg', 'uploads/images/202302/image_140x98_63ea22f5cf71d.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-13 17:16:04'),
(17, 1, 'बदमाश ने 2 मिनट में बैंक से 5.40 लाख रुपए  लूटे, पिस्टल के दम पर तीन लोगों को किया बंद, बैंक अधिकारी की बाइक लेकर हुआ फरार', 'the-miscreant-looted-540-lakh-rupees-from-the-bank-in-2-minutes-stopped-three-people-on-the-basis-of-pistol-escaped-with-the-bank-officers-bike', NULL, NULL, 'हथियारबंद बदमाश ने 2 मिनट में बैंक से 5.40 लाख रुपए लूट लिए। पिस्टल के दम पर कैशियर समेत तीन लोगों को लॉकर रूम में बंद किया। बैंक अफसर की बाइक से फरार हो गया।', '<p>हथियारबंद बदमाश ने 2 मिनट में बैंक से 5.40 लाख रुपए लूट लिए। पिस्टल के दम पर कैशियर समेत तीन लोगों को लॉकर रूम में बंद किया। बैंक अफसर की बाइक से फरार हो गया। वारदात अजमेर जिले के किशनगढ़ में टांक पेट्रोल पंप के पास आदर्श को-ऑपरेटिव बैंक में सोमवार दोपहर 2.20 बजे हुई।</p>\r\n<p>कैशियर मुकेश सेवदा ने बताया- बदमाश ने बैंक में घुसते ही गाली-गलौज करना शुरू कर दिया था। इस दौरान बदमाश के साथ उसकी धक्का-मुक्की भी हुई। जब उसने पिस्टल निकाली तो वह चुपचाप खड़ा हो गया। बदमाश ने पहले पिस्टल की दम पर तीन लोगों को लॉकर रूम में बंद कर दिया। बाद में बैग में नकदी डालकर फरार हो गया।</p>\r\n<p>जानकारी के अनुसार बदमाश रुपए लूटने के बाद बैंक के बाहर खड़ी अफसर की बाइक को ही लेकर फरार हो गया। सूचना पर पहुंची पुलिस ने बदमाश को पकड़ने के लिए नाकाबंदी कराई।</p>\r\n<p>पुलिस उपाधीक्षक लोकेंद्र दादरवाल ने बताया- बदमाश करीब 2 मिनट में कैश लेकर फरार हो गया। घटना की जानकारी मिलते ही जिले में नाकाबंदी करवाई गई है। मौके पर थाना अधिकारी पहुंचे है। स्पेशल टीम को मौके पर बुलाकर सबूत इकट्&zwnj;ठा किए जा रहे हैं।</p>', 4, 'uploads/images/202302/image_870x580_63ea329a0a40f.jpg', 'uploads/images/202302/image_870x_63ea329a186c7.jpg', 'uploads/images/202302/image_694x532_63ea329a2389c.jpg', 'uploads/images/202302/image_430x256_63ea329a2a9a1.jpg', 'uploads/images/202302/image_140x98_63ea329a2e0d7.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-13 18:23:37');
