(18, 1, 'क्रिकेटर हार्दिक पंड्या और नताशा एक बार फिर शादी रचाएंगे, वैलेटाइन-डे पर उदयपुर में लेंगे फेरे, 15 फरवरी तक चलेगी छड़ी की रसमे', 'cricketer-hardik-pandya-and-natasha-will-get-married-once-again-will-take-rounds-in-udaipur-on-valentines-day-stick-rituals-will-continue-till-february-15', NULL, NULL, NULL, '<p>इंडिया टी-20 क्रिकेट टीम के कप्तान हार्दिक पंड्या और नताशा स्टेनकोविक एक बार फिर से शादी करने जा रहे हैं। फंक्शन आज से उदयपुर में शुरू हो चुका है। यह अगले दो दिन तक चलेगा। 14 तारीख यानी वैलेंटाइन डे को शादी होगी। इससे पहले दोनों ने 31 मई 2020 को कोर्ट मैरिज की थी। हालांकि इस बार वे पारंपरिक रीति-रिवाज से शादी करेंगे। फंक्शन रैफल्स होटल में होंगे। बता दें कि उनका दो साल का बेटा अगस्त्या भी है।</p>\r\n<p>शादी के लिए हार्दिक पंड्या और नताशा स्टेनकोविक आज उदयपुर पहुंचे। उनके साथ परिवार के सदस्य और इंडियन क्रिकेटर ईशान किशन भी आए हैं। आज शाम से शादी की रस्में शुरू हो जाएंगीं, जो 15 फरवरी तक चलेंगीं। इनमें हल्दी, मेहंदी और संगीत सहित अन्य कार्यक्रम होंगे।</p>\r\n<p>सर्बिया की एक्ट्रेस नताशा स्टेनकोविक नच बलिए सीजन-9 में अपने एक्स बॉयफ्रेंड अली गोनी के साथ नजर आई थीं। हार्दिक और नताशा की मुलाकात एक नाइट क्लब में हुई थी। यहीं से दोनों के बीच लव स्टोरी शुरू हुई थी।</p>\r\n<p>हार्दिक ने 1 जनवरी 2020 को नताशा से सगाई की थी। इसकी जानकारी भी उन्होंने सोशल मीडिया के जरिए दी थी। इसके बाद 31 मई 2020 को नताशा और हार्दिक ने सोशल मीडिया पर बताया था कि वे पेरेंट्स बनने वाले हैं। 30 जुलाई को एक फोटो शेयर करते हुए हार्दिक ने बेटा होने की जानकारी दी थी। तब उन्होंने लिखा था- हमें बेटे के रूप में आशीर्वाद मिला है। दोनों ने कोर्ट मैरिज की थी। इसमें परिवार के लोग ही शामिल हुए थे।</p>', 5, 'uploads/images/202302/image_870x580_63ea376e8eba4.jpg', 'uploads/images/202302/image_870x_63ea376e9b41b.jpg', 'uploads/images/202302/image_694x532_63ea376ea4c52.jpg', 'uploads/images/202302/image_430x256_63ea376ea9ae3.jpg', 'uploads/images/202302/image_140x98_63ea376eaba78.jpg', 'jpg', 'local', NULL, 3, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-13 18:43:52'),
(19, 1, 'महाशिवरात्रि पर उज्जैन में शिव ज्योति अर्पणम कार्यक्रम, मुख्यमंत्री शिवराज सिंह चौहान बोले -मै भी परिवार के साथ आकर दीप जलाऊंगा', 'shiv-jyoti-arpanam-program-in-ujjain-on-mahashivratri-chief-minister-shivraj-singh-chouhan-said-i-will-also-light-the-lamp-with-my-family', NULL, NULL, 'महाशिवरात्रि पर उज्जैन में शिव ज्योति अर्पणम कार्यक्रम होगा। महाशिवरात्रि 18 फरवरी को मनाई जाएगी।', '<p>उज्जैन: महाशिवरात्रि पर उज्जैन में शिव ज्योति अर्पणम कार्यक्रम होगा। महाशिवरात्रि 18 फरवरी को मनाई जाएगी। इस दिन उज्जैन को 21 लाख दीपों से जगमग किया जाएगा। मुख्यमंत्री शिवराज सिंह चौहान ने कहा, मैं भी परिवार के साथ आकर दीप जलाऊंगा। उज्जैन के लोगों से आह्वान करते हुए कहा, आप भी अपने परिवार के साथ दीप जलाएं । बाबा महाकाल की नगरी और मध्यप्रदेश के वैभव को बढ़ाएं। बता दें, पिछले साल भी महाशिवरात्रि पर दीपोत्सव कार्यक्रम हुआ था। 11 लाख 71 हजार से अधिक दीप जलाए गए थे।</p>', 3, 'uploads/images/202302/image_870x580_63eb37519d5dd.jpg', 'uploads/images/202302/image_870x_63eb3751ad3d1.jpg', 'uploads/images/202302/image_694x532_63eb3751b7cf9.jpg', 'uploads/images/202302/image_430x256_63eb3751beffc.jpg', 'uploads/images/202302/image_140x98_63eb3751c1682.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-14 12:55:34'),
(20, 1, 'जॉब इंटरव्यू के लिए बुलाकर इंजीनियर का रेप हादसा , गुरुग्राम मॉल की पार्किंग में खड़ी कार में हैवानियत  की वारदात', 'ingeniero-violado-tras-ser-llamado-para-una-entrevista-de-trabajo-brutalidad-en-un-auto-estacionado-en-el-estacionamiento-de-gurugram-mall', NULL, NULL, 'हरियाणा में एक इंजिनियरिंग ग्रेजुएट महिला को जॉब इंटरव्यू का झांसा देकर रेप करने का मामला सामने आया है। 27 साल की महिला के साथ एक मॉल की पार्किंग में हैवानियत की वारदात को अंजाम दिया गया। महिला को बुलाने वाले शख्स ने अपनी कार को मॉल के बेसमेंट में पार्क किया था। गुरुग्राम पुलिस का कहना है कि सिकंदरपुर के एमजी रोड स्थित मॉल में ये हिला देने वाली घटना हुई है। हैवानियत से पहले पीड़िता को ड्रग्स दिया गया और इसके बाद कार के अंदर ही उसके साथ बलात्कार हुआ। पुलिस मामले की जांच कर रही है।', '<p>हरियाणा में एक इंजिनियरिंग ग्रेजुएट महिला को जॉब इंटरव्यू का झांसा देकर रेप करने का मामला सामने आया है। 27 साल की महिला के साथ एक मॉल की पार्किंग में हैवानियत की वारदात को अंजाम दिया गया। महिला को बुलाने वाले शख्स ने अपनी कार को मॉल के बेसमेंट में पार्क किया था। गुरुग्राम पुलिस का कहना है कि सिकंदरपुर के एमजी रोड स्थित मॉल में ये हिला देने वाली घटना हुई है। हैवानियत से पहले पीड़िता को ड्रग्स दिया गया और इसके बाद कार के अंदर ही उसके साथ बलात्कार हुआ। पुलिस मामले की जांच कर रही है।<br>घटनाक्रम के मुताबिक 11 फरवरी को आरोपी ने इंजिनियरिंग ग्रेजुएट महिला को नौकरी का इंटरव्यू देने के लिए गुरुग्राम के मॉल में बुलाया। जब महिला मॉल में पहुंची तो आरोपी शख्स उसे मॉल के बेसमेंट में ले गया। यहां पर उसने पीड़िता को पानी में नशीली दवा मिलाकर पीने को दिया। नशे में बेसुध होने के बाद उसके साथ रेप को अंजाम दिया गया। महिला की शिकायत पर सेक्टर-51 के महिला पुलिस थाने में एक एफआईआर दर्ज की गई है।<br>\'नशीली चीज देने के बाद कार के अंदर रेप\'<br>पीड़िता ने अपनी शिकायत में आरोपी की पहचान तुषार कपूर के रूप में की है। आरोपी ने अपना परिचय युवा ग्रेजुएट्स को रोजगार देने वाले रिक्रूटर के रूप में दिया था। महिला ने पुलिस को दी अपनी शिकायत में कहा है, \'वह मुझसे मॉल के गेट पर मिला और मुझे बेसमेंट की ओर ले गया। इसके बाद उसने मुझे पानी पीने के लिए दिया। इसे पीने के बाद मैं होशोहवास खो बैठी और वह मुझे अपनी कार के अंदर ले गया। कार के अंदर ही उसने मेरे साथ बलात्कार किया। पार्किंग में मुझे छोड़कर वह मौके से फरार हो गया।\' पीड़िता का कहना है कि आरोपी ने पुलिस के सामने मुंह खोलने पर उसे जान से मारने की धमकी भी दी है।</p>\r\n<p>जॉब इंटरव्यू के बाद कराया लंच: गुरुग्राम पुलिस<br>गुरुग्राम पुलिस का कहना है कि जॉब इंटरव्यू के बाद आरोपी महिला को लंच के लिए लेकर गया। इसके बाद उसने महिला को घर तक छोड़ने का ऑफर दिया। महिला को अपने साथ लेकर वह मॉल के बेसमेंट तक गया। पुलिस के मुताबिक यहां पर कथित तौर पर ड्रग्स देने के बाद महिला से रेप किया गया। महिला पुलिस थाने की एसएचओ इंस्पेक्टर सुमन सुरा का कहना है, \'हमने महिला के आरोपों के बाद भारतीय दंड संहिता (आईपीसी) की धारा 328 (जहर देकर किसी को<br>नुकसान पहुंचाना), धारा 376 (बलात्कार) और धारा 506 (आपराधिक धमकी) के तहत केस दर्ज कर लिया है। अभी हम आरोपों की जांच कर रहे हैं। हमने मॉल के मैनेजमेंट से आगे की कार्रवाई के लिए सीसीटीवी फुटेज मांगे हैं।\' महिला का मेडकल टेस्ट भी कराया जा रहा है।</p>', 4, 'uploads/images/202302/image_870x580_63eb38a560d82.jpg', 'uploads/images/202302/image_870x_63eb38a572b36.jpg', 'uploads/images/202302/image_694x532_63eb38a5808a3.jpg', 'uploads/images/202302/image_430x256_63eb38a589415.jpg', 'uploads/images/202302/image_140x98_63eb38a58e323.jpg', 'jpg', 'local', NULL, 1, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-14 13:02:48'),
(21, 1, 'पानीपत के ITBP जवान सत्यवान पंचतत्व में विलीन, 1989 में हुए थे भर्ती', 'itbp-jawan-de-panipat-se-fusiono-con-satyawan-panchatattva-fue-reclutado-en-1989', NULL, NULL, 'हरियाणा के पानीपत के गांव अहर निवासी करीब 52 वर्षीय ITBP के जवान सत्यवान की हार्ट अटैक से मौत हो गई। उनकी ड्यूटी पंचकूला में थी।', '<p>हरियाणा के पानीपत के गांव अहर निवासी करीब 52 वर्षीय ITBP के जवान सत्यवान की हार्ट अटैक से मौत हो गई। उनकी ड्यूटी पंचकूला में थी। ड्यूटी के दौरान अचानक सिर में दर्द होने के बाद घर चले गए थे। जहां अटैक आने पर अस्पताल में भर्ती करवाया गया। अस्पताल में डॉक्टरों ने उन्हें मृत घोषित कर दिया।</p>\r\n<p>मृतक ITBP जवान सत्यवान का मंगलवार को राजकीय सम्मान के साथ अंतिम संस्कार किया गया। शहीद जवान सत्यवान के चार बच्चे हैं, जिनमें तीन लड़के और एक लड़की है। उनके अंतिम संस्कार में जनसैलाब उमड़ा।</p>\r\n<p>50 बटालियन रामगढ़ पंचकूला के इंस्पेक्टर प्रदीप कुमार ने बताया कि कॉन्स्टेबल सत्यवान ITBP में 1989 को भर्ती हुए थे। फिलहाल वह पंचकूला में तैनात थे।</p>\r\n<p>उन्होंने कहा कि करीब 3 महीने पहले भी सत्यवान को अधरंग का अटैक आया था, लेकिन उस समय वे ठीक हो गए थे। तीन दिन पहले सत्यवान ड्यूटी पर थे। साथ ड्यूटी करने वाले साथियों ने बताया कि अचानक सिर में दर्द हुआ। इसके बाद सत्यवान अपने घर पर गए तो वहां अटैक आ गया, इससे उनकी जान चली गई।</p>', 1, 'uploads/images/202302/image_870x580_63eb66ca70c39.jpg', 'uploads/images/202302/image_870x_63eb66ca7e18a.jpg', 'uploads/images/202302/image_694x532_63eb66ca87b37.jpg', 'uploads/images/202302/image_430x256_63eb66ca8c7ad.jpg', 'uploads/images/202302/image_140x98_63eb66ca8e4ae.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-14 16:17:52'),
(22, 1, 'नहीं बच पाया 8  साल का मासूम, मंगलवार की सुबह गौतम ने ली आखिरी सांस', 'inocente-de-8-anos-no-pudo-sobrevivir-gautam-respiro-por-ultima-vez-el-martes-por-la-manana', NULL, NULL, 'कांकेर सड़क हादसे में गंभीर रूप से घायल 8 साल का गौतम बच नहीं पाया। पिछले कुछ दिनों से रायपुर के अंबेडकर अस्पताल में गौतम का इलाज चल रहा था। मंगलवार की सुबह गौतम ने आखिरी सांस ली। बच्चे की मौत के बाद अब पोस्टमार्टम की प्रक्रिया को पूरा करने के बाद परिजनों को शव सौंप दिया जाएगा । गौतम के सिर समेत शरीर के कई हिस्सों में फ्रैक्चर हुआ था। वहीं जिन 7 बच्चों की मौत हुई, उनमें से 5 बच्चों का अंतिम संस्कार गुरुवार रात को ही कर दिया गया।', '<p><span>रायपुर: </span>कांकेर सड़क हादसे में गंभीर रूप से घायल 8 साल का गौतम बच नहीं पाया। पिछले कुछ दिनों से रायपुर के अंबेडकर अस्पताल में गौतम का इलाज चल रहा था। मंगलवार की सुबह गौतम ने आखिरी सांस ली। बच्चे की मौत के बाद अब पोस्टमार्टम की प्रक्रिया को पूरा करने के बाद परिजनों को शव सौंप दिया जाएगा । यह हादसा कांकेर जिले के कोरर के पास बीते गुरुवार को हुआ था। गौतम अपने 7 दोस्तों के साथ ऑटो में उस स्कूल से लौट रहा था तभी ऑटो को ट्रक ने टक्कर मार दी थी।</p>\r\n<p>टक्कर इतनी जबरदस्त थी कि ऑटो के परखच्चे उड़ गए । दूर जाकर ऑटो सड़क के किनारे गिरा और हादसे में 7 बच्चों की मौत हो चुकी थी । गौतम बुरी तरह से घायल अवस्था में रायपुर लाया गया था। गौतम के शरीर के कई हिस्सों में फ्रैक्चर था सिर में भी गंभीर चोट आई हुई थी। रायपुर के अंबेडकर अस्पताल में डॉक्टर्स की निगरानी में उसे बचाने की जद्दोजहद की जा रही थी मगर गौतम की जान नहीं बच पाई।</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63eb6d10b517b.jpg\" alt=\"\"></p>\r\n<p>कांकेर के कोरर में हुए भीषण सड़क हादसे में घायल स्कूली छात्र को बीते गुरुवार देर रात रायपुर लाया गया था। 8 साल के गौतम कुमार मंडावी को अंबेडकर अस्पताल में एडमिट किया गया था। इस सड़क हादसे ने 7 बच्चों की जान ले ली। वहीं ऑटो का ड्राइवर भावेश पोया गंभीर रूप से घायल है, जिसका इलाज किया जा रहा है। पुलिस ने आरोपी ट्रक ड्राइवर दीपक साहू को गिरफ्तार कर लिया था।</p>\r\n<p>इधर घायल बच्चे का इलाज कर रहे डॉक्टरों ने बताया कि गौतम का इलाज कैजुअल्टी विभाग में करने के बाद उसे वेंटिलेटर पर रखा गया था। उसका इलाज क्रिटिकल केयर यूनिट (CCU) में किया गया। 4 डॉक्टरों की टीम बच्चे की सेहत पर नजर रख रही थी।</p>\r\n<p>गौतम के सिर समेत शरीर के कई हिस्सों में फ्रैक्चर हुआ था। वहीं जिन 7 बच्चों की मौत हुई, उनमें से 5 बच्चों का अंतिम संस्कार गुरुवार रात को ही कर दिया गया। 2 बच्चे मानव साहू और कुमकुम साहू के शव को उनके पैतृक गांव बालोद के गुरुर विकासखंड के धनेली ग्राम लाया गया था। सातों बच्चों के शवों को उनके गांवों में दफनाया गया।</p>\r\n<p>2 बच्चों मानव साहू और कुमकुम साहू का पैतृक गांव बालोद जिले के गुरूर विकासखंड में है। शुक्रवार सुबह इन दोनों भाई-बहन का अंतिम संस्कार गुरूर विकासखंड के ग्राम धनेली में किया गया। गुरूर के ग्राम धनेली में भाई-बहन की मौत से परिवार सदमे में है। भाई मानव साहू (6 वर्ष) कांकेर के बीएसएन डिजिटल पब्लिक स्कूल में दूसरी कक्षा का छात्र था। वहीं उसकी बहन कुमकुम साहू (8 वर्ष) कक्षा चौथी में पढ़ती थी।</p>\r\n<p>संजारी-बालोद की विधायक संगीता सिन्हा पीड़ित परिजनों के दुख में शामिल होने के लिए शुक्रवार सुबह उनके ग्राम धनेली स्थित घर पहुंचीं थी। वे दोनों भाई-बहन के शव के पास बैठीं और परिवार के साथ संवेदना जताते हुए उन्हें हरसंभव मदद का आश्वासन दिया । पड़ोसियों ने बताया कि दोनों बच्चे मानव और कुमकुम का परिवार मूल रूप से बालोद जिले का रहने वाला है, लेकिन उन्होंने कांकेर के कोरर क्षेत्र में घर खरीदा था और वहीं खेती करते थे। बच्चों के पिता महेश्वर साहू और मां का रो-रोकर बुरा हाल है और लोग उन्हें संभालने की कोशिश कर रहे हैं।</p>\r\n<p>संजारी बालोद विधानसभा क्षेत्र की विधायक संगीता सिन्हा शोक कार्यक्रम से लौटकर अपने सोशल मीडिया अकाउंट पर एक भावुक पोस्ट भी डाला। उन्होंने लिखा कि \"बच्चे परिवार की जान होते हैं। उनकी खिलखिलाती हंसी अगर किसी दुर्घटना की भेंट चढ़ जाए, तो माता-पिता और परिवार को असहनीय पीड़ा देती है और यह पीड़ा उम्र भर दिलों में घर कर जाती है।\"</p>\r\n<p>कांकेर जिले के ग्राम धोड़दे में दो सगे भाईयों के बेटों की जान भी कोरर सड़क हादसे में एक साथ चली गई। दोनों बच्चे निशांत और पीयूष गावड़े रोज की तरह ही गुरुवार को भी एक साथ स्कूल गए थे। परिवार में 2 बच्चों की मौत से घर में मातम पसर गया है। इनका अंतिम संस्कार गुरुवार रात में ही कर दिया गया। वहीं आरोपी ट्रक ड्राइवर दीपक साहू को पुलिस ने गिरफ्तार कर लिया है।</p>\r\n<p>कांकेर जिले के कोरर के पास भीषण सड़क हादसे में 7 फरवरी गुरुवार को 7 स्कूली बच्चों की मौत हो गई थी। मंगलवार को हादसे में घायल गौतम ने रायपुर में दम तोड़ा है। स्कूल की छुट्टी होने के बाद ऑटो चालक 8 बच्चों को लेकर जा रहा था, तभी एक ट्रक ने उसे जोरदार टक्कर मार दी। हादसा इतना भीषण था कि ऑटो के परखच्चे उड़ गए। बच्चे बीएसएन डिजिटल पब्लिक स्कूल में पढ़ते थे। हादसा गुरुवार को कोरर के चिलहटी चौक के पास हुआ था।</p>\r\n<p>सभी बच्चों की उम्र 5 से 8 साल के बीच थी। 2 बच्चों की मौके पर ही मौत हो गई, वहीं 5 बच्चों ने कोरर अस्पताल में दम तोड़ा था। ऑटो ड्राइवर भावेश पोया और एक बच्चे गौतम मंडावी को गंभीर हालत में कांकेर से रायपुर रेफर किया गया है। हादसे की सूचना मिलने पर पुलिस मौके पर पहुंची। शवों का पोस्टमॉर्टम कराकर उन्हें परिजनों को सौंपा गया। सभी बच्चों के शवों का अंतिम संस्कार किया जा चुका है।</p>', 4, 'uploads/images/202302/image_870x580_63eb6cfbc3b26.jpg', 'uploads/images/202302/image_870x_63eb6cfbd4360.jpg', 'uploads/images/202302/image_694x532_63eb6cfbe0641.jpg', 'uploads/images/202302/image_430x256_63eb6cfbe69bb.jpg', 'uploads/images/202302/image_140x98_63eb6cfbeb463.jpg', 'jpg', 'local', NULL, 1, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-14 16:44:47'),
(23, 1, 'हाथों में ढोल लेकर ग्रामीणों संग थिरके विधायक, कलेक्टर और SP , वीडियो हुआ वायरल', 'mla-collector-and-sp-danced-with-villagers-with-drums-in-their-hands-video-went-viral', NULL, NULL, 'छत्तीसगढ़ के बीजापुर जिले के एक नक्सल प्रभावित गांव में विधायक, कलेक्टर और SP हाथों में ढोल लेकर पारंपरिक नृत्य करते नजर आए। अफसर और नेता गांव वालों के साथ जमकर थिरके।', '<p>छत्तीसगढ़ के बीजापुर जिले के एक नक्सल प्रभावित गांव में विधायक, कलेक्टर और SP हाथों में ढोल लेकर पारंपरिक नृत्य करते नजर आए। अफसर और नेता गांव वालों के साथ जमकर थिरके। इनके पारंपरिक डांस करने का वीडियो अब सोशल मीडिया में खूब वायरल हो रहा है। इनका यह अंदाज इलाके के लोगों को खूब पसंद आया। विधायक ने कहा कि, यह हमारी संस्कृति है। नाच-गान कर हम खुशियां बांटते हैं।</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63eb7d293e5de.jpg\" alt=\"\"></p>\r\n<p>दरअसल, एक दिन पहले जिले के कुटरू गांव में ग्रामीण खेलकूद प्रतियोगिता का आयोजन हुआ था। इस खेलकूद प्रतियोगिता में शामिल होने के लिए बीजापुर विधानसभा क्षेत्र से विधायक विक्रम मंडावी, कलेक्टर राजेंद्र कटारा और SP अंजनेय वार्ष्णेय शामिल हुए थे। यहां खिलाड़ियों का उत्साह बढ़ाया। इस मौके पर इस खेलकूद प्रतियोगिता में शामिल इलाके के ग्रामीणों ने इन्हें अपने साथ पारंपरिक नृत्य करने का आह्वान किया।</p>\r\n<p>जिसके बाद विधायक, कलेक्टर और SP इन तीनों ने हाथों में पारंपरिक ढोल पकड़कर बजाते हुए जमकर थिरके। क्षेत्रीय विधायक विक्रम मंडावी ने कलेक्टर और SP को नृत्य के स्टेप्स भी सिखाए। नक्सलगढ़ इलाके में ग्रामीणों संग पारंपरिक नृत्य करने इनकी वीडियो सोशल मीडिया में अब खूब वायरल हो रही है।</p>', 4, 'uploads/images/202302/image_870x580_63eb7d3408d90.jpg', 'uploads/images/202302/image_870x_63eb7d3419b34.jpg', 'uploads/images/202302/image_694x532_63eb7d34235e1.jpg', 'uploads/images/202302/image_430x256_63eb7d3428247.jpg', 'uploads/images/202302/image_140x98_63eb7d342a054.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-14 17:53:32'),
(24, 1, 'कुबेरेश्वर धाम में रुद्राक्ष महोत्सव आज से , 24 घंटे में 30 काउंटर से बांटे जाएंगे 24 लाख रुद्राक्ष', 'rudraksh-festival-in-kubereshwar-dham-from-today-24-lakh-rudraksh-will-be-distributed-from-30-counters-in-24-hours', NULL, NULL, 'कुबेरेश्वर धाम‎ में 16 फरवरी से शुरू होने वाली कथा को‎ सुनने के लिए हजारों की संख्या में‎ श्रद्धालु पहुंचने लगे हैं।‎ कथास्थल पर लगे डोम फुल हो चुके‎ हैं, इसलिए श्रद्धालु गांव में ही अपना‎ ठिकाना ढूंढ रहे हैं। यही वजह है कि‎ ग्रामीणों ने अपने घरों को होटल-धर्मशाला‎ की तरह बना लिया है।', '<p>इंदौर-भोपाल नेशनल हाईवे पर बसे गांव&lrm; चितावलिया हेमा का माहौल&lrm; बदला-बदला सा है। यहां कुबेरेश्वर धाम&lrm; में 16 फरवरी से शुरू होने वाली कथा को&lrm; सुनने के लिए हजारों की संख्या में&lrm; श्रद्धालु पहुंचने लगे हैं।&lrm; कथास्थल पर लगे डोम फुल हो चुके&lrm; हैं, इसलिए श्रद्धालु गांव में ही अपना&lrm; ठिकाना ढूंढ रहे हैं। यही वजह है कि&lrm; ग्रामीणों ने अपने घरों को होटल-धर्मशाला&lrm; की तरह बना लिया है। खेत तक किराए&lrm; पर दे दिए हैं। जहां जगह खाली बची,&lrm; वहां पार्किंग बना ली है, जिसका बाकायदा&lrm; चार्ज लिया जा रहा है।&lrm;</p>\r\n<p>मंगलवार सुबह से शाम के बीच&lrm; महाराष्ट्र, गुजरात, राजस्थान, उप्र, बिहार,&lrm; झारखंड और छत्तीसगढ़ से हजारों श्रद्धालु&lrm; यहां पहुंचे। रुकने के लिए डोम में जगह&lrm; नहीं मिली तो गांव में कमरा किराए से लेने&lrm; निकले। कानपुर (उप्र) से आईं उमा यादव ने&lrm; बताया कि एक घर में रुकने के लिए एक दिन&lrm; का किराया पांच हजार रुपए मांग रहे हैं&lrm;, जबकि किसी निजी स्कूल में रुकना हो तो&lrm; 1200 रुपए प्रतिदिन देना होंगे। बच्चे, बूढ़े&lrm; और घर के युवक-युवतियां भी साथ में&lrm; हैं। नहाने के लिए कुएं-बोरिंग के इस्तेमाल&lrm; के भी 50 रुपए देना पड़ रहे हैं, जबकि&lrm; घर के बाथरूम में नहाने के 100-100&lrm; रुपए वसूले जा रहे हैं।&lrm;</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63ec7877d2767.jpg\" alt=\"\"></p>\r\n<p>खेत में खाने-पीने की चीजें बेचने&lrm; वाले दुकानदार ने बताया कि खेत के 10&lrm; बाय 20 फीट के टुकड़े पर 8 दिन&lrm; (15 से 21) फरवरी तक दुकान लगाने के&lrm; लिए 15 हजार रु. खेत मालिक को देना&lrm; पड़ेंगे। कुछ एडवांस दे चुके हैं। बाकी&lrm; भी दो-तीन दिन में दे देंगे। फल का ठेला&lrm; लगाने वाले रामप्रसाद ने बताया कि हमने&lrm; भी इतना ही टुकड़ा किराए पर लिया है।&lrm; आठ दिन तक ठेला लगाने के लिए 10&lrm; हजार रु. चुकाना पड़ेंगे।&lrm;</p>\r\n<p>चितावलिया हेमा, भटोनी रोड,&lrm; नापलाखेड़ी और गुडबेला के आसपास&lrm; जहां भी जगह खाली पड़ी है, वहां&lrm; पुलिस ने पार्किंग व्यवस्था की है, वहीं&lrm; जिन रास्तों से कुबेरेश्वर धाम का रूट&lrm; बनाया गया है, उन रास्तों पर पड़ने&lrm; वाले खेत के मालिकों ने भी पार्किंग&lrm; बना ली है। कथा स्थल पर आने वाले&lrm; श्रद्धालुओं से टू- व्हीलर के 10 व&lrm; फोर व्हीलर के 20 रुपए पार्किंग शुल्क&lrm; लिया जा रहा है।&lrm;</p>\r\n<p>महोत्सव में 16 से 21 फरवरी के बीच हर दिन 24 घंटे 30 काउंटरों से रुद्राक्ष बांटे जाएंगे। 22 एकड़ में बने रुद्राक्ष वितरण केंद्र तक पहुंचने के लिए पुलिस ने जिग-जैग पाइप लगाए हैं, ताकि श्रद्धालु आसानी से कतार में लगकर रुद्राक्ष प्राप्त कर सकें। सात दिन में 24 लाख रुद्राक्ष बांटने का लक्ष्य रखा गया है। इसकी पुष्टि खुद पं. प्रदीप मिश्रा ने की है। पुलिस ने भी सुरक्षा का दायरा बढ़ा दिया है।</p>\r\n<p>रुद्राक्ष महोत्सव में शामिल हाेने के लिए&lrm; महाराष्ट्र और बिहार की ट्रेनों से आए श्रद्धालुओं ने&lrm; सीहोर में उतरने के लिए मंगलवार रात चेन&lrm; पुलिंग तक कर दी। रात 8.30 से 10.30 बजे के&lrm; बीच तीन ट्रेनों से 15 हजार से अधिक श्रद्धालु&lrm; सीहोर रेलवे स्टेशन पर उतरे। स्टेशन पर उतरने&lrm; के बाद सभी लोग ऑटो और अन्य यात्री वाहनों से कुबेरेश्वर धाम का पता पूछते नजर&lrm; आए। सबसे पहले रात 9.30 बजे सोमनाथ&lrm; एक्सप्रेस सीहोर स्टेशन पहुंची। बैरागढ़ से सीहोर&lrm; के बीच तीन जगह चेन पुलिंग की गई। इस वजह&lrm; से पचामा रेलवे स्टेशन पर 10 मिनट तक ट्रेन&lrm; खड़ी रही। पटना के आदित्य कुमार ने बताया कि&lrm; बैरागढ़ से सीहोर के बीच तीन जगह चेन की&lrm; पुलिंग की गई। महाराष्ट्र के नागपुर से आई&lrm; सुलोचना ठाकरे ने बताया कि वह ट्रेन से कथा&lrm; सुनने और रुद्राक्ष लेने के लिए आए हैं। वह&lrm; सोमनाथ एक्सप्रेस से आई हैं, रास्ते में कई जगह&lrm; चेन पुलिंग हुई है। पश्चिम रेलवे रतलाम मंडल&lrm; ने बीते दिनाें भोपाल से इंदौर के बीच कई ट्रेनों&lrm; को निरस्त कर दिया था। लाेगाें ने रुद्राक्ष महोत्सव&lrm; और महाशिवरात्रि काे लेकर ट्रेनें फिर से चलाने&lrm; की मांग की थी। इसके बाद इंदौर-भोपाल&lrm; एक्सप्रेस और उज्जैन-भोपाल स्पेशल ट्रेन को 15&lrm; से 23 फरवरी तक के लिए फिर से शुरू कर&lrm; दिया है। इनका सीहोर स्टेशन पर स्टॉपेज भी&lrm; दिया गया है।&lrm;</p>\r\n<p>मंगलवार शाम तक कथास्थल पर देशभर से 50 हजार से ज्यादा श्रद्धालु पहुंच चुके थे। उनके आने का क्रम लगातार जारी है। 52 एकड़ में फैले कुबरेश्वर धाम के कथा स्थल और पास में 18-18 हजार स्क्वेयर फीट के 5 डोम में श्रद्धालुओं के रुकने की व्यवस्था है। सभी डोम फुल हो चुके हैं और बड़ी संख्या में श्रद्धालुओं ने किराए से मकान भी ले लिए हैं। वाहन फोरलेन पर खड़ा किया तो चालान बनेगा, जब्त भी होगा। पुलिस ने इंदौर-भोपाल फोरलेन पर वाहन खड़ा करना प्रतिबंधित कर दिया है। ट्रैफिक पुलिस के वाहन माइक पर बार-बार अनाउंस कर रहे हैं कि सड़क पर वाहन खड़े नहीं करें। वहीं बड़े-बड़े पोस्टर भी लगाए गए हैं कि वाहन फोरलेन पर खड़ा करने पर जुर्माना भरना पड़ेगा और वाहन भी जब्त हो जाएगा।</p>\r\n<p>इंदौर-भोपाल फोरलेन पर बसे चितावलिया हेमा गांव से होकर गुजरने वाले कुबेरेश्वर धाम के मुख्य मार्ग से आवाजाही बंद कर दी गई है। श्रद्धालुओं को इंदौर वाले मार्ग पर एक किमी दूर भटोनी रोड कट से पांच किमी का फेरा लगाकर कथास्थल तक पहुंचाना होगा। हालांकि श्रद्धालु अपने निजी या किराए के वाहन को कथा स्थल से डेढ़ सौ मीटर पहले वाहन पार्किंग में खड़ा करके पैदल पहुंच सकते हैं। हादसे रोकने के लिए फोरलेन पर स्थित चितावलिया हेमा और सामने बसे गुड़भेला गांव के बीच के कट पॉइंट को पुलिस ने जेसीबी से खुदवाकर ट्रेंच बनवा दिया है, ताकि बीच से बाइक, ऑटो या छोटे वाहन क्रॉस न कर सकें।</p>', 3, 'uploads/images/202302/image_870x580_63ec7877c3d1a.jpg', 'uploads/images/202302/image_870x_63ec7877d2767.jpg', 'uploads/images/202302/image_694x532_63ec7877df344.jpg', 'uploads/images/202302/image_430x256_63ec7877e5bde.jpg', 'uploads/images/202302/image_140x98_63ec7877e8a07.jpg', 'jpg', 'local', NULL, 1, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-15 11:45:58'),
(25, 1, 'राजस्थान में 20 फरवरी तक मौसम रहेगा साफ, टेम्प्रेचर 30 डिग्री सेल्सियस से ऊपर', 'weather-will-remain-clear-in-rajasthan-till-february-20-temperature-above-30-degree-celsius', NULL, NULL, 'अजमेर, भीलवाड़ा, चित्तौड़़गढ़, जोधपुर, बीकानेर समेत कइ शहरों में दिन का अधिकतम तापमान 30 डिग्री सेल्सियस से ऊपर चले गए है। रात में भी सर्दी इन शहरों में सर्दी का असर कम हो गया और तापमान में 2-3 डिग्री सेल्सियस तक की बढ़ोतरी दर्ज हुई है।', '<p>राजस्थान में अब फिर से तापमान बढ़ने लगा है। अजमेर, भीलवाड़ा, चित्तौड़़गढ़, जोधपुर, बीकानेर समेत कइ शहरों में दिन का अधिकतम तापमान 30 डिग्री सेल्सियस से ऊपर चले गए है। रात में भी सर्दी इन शहरों में सर्दी का असर कम हो गया और तापमान में 2-3 डिग्री सेल्सियस तक की बढ़ोतरी दर्ज हुई है। मौसम केन्द्र जयपुर के मुताबिक अगले 5 दिन राज्य में मौसम शुष्क रहेगा और तापमान में इजाफा होगा। 21-22 फरवरी से मौसम में बदलाव देखने को मिलेगा और उत्तरी हवाओं के असर से एक बार फिर टेम्प्रेचर गिरने लगेंगे।</p>\r\n<p>मौसम केन्द्र जयपुर से जारी रिपोर्ट देखे तो आज उदयपुर, सीकर, पिलानी, जोधपुर, गंगानगर में रात का मिनिमम टेम्प्रेचर सिंगल डिजिट से बढ़कर डबल डिजिट यानी 10 डिग्री सेल्सियस से ऊपर आ गए। अजमेर में न्यूनतम तापमान 3 डिग्री सेल्सियस बढ़कर 14 पर आ गया। इधर राजधानी जयपुर और जैसलमेर में भी टेम्प्रेचर 14 डिग्री सेल्सियस से नजदीक पहुंच गया। तापमान बढ़ने से इन शहरों में दिन और रात में सर्दी का असर बहुत कम हो गया।</p>\r\n<p>मौसम विशेषज्ञों ने 20 फरवरी तक राजस्थान में सर्दी का असर कम रहने और तापमान बढ़ने की संभावना जताई है। उत्तर भारत में दो बैक टू बैक वेर्स्टन डिर्स्टबेंस आने से उत्तरी हवाएं रूक गई है, जिससे राज्य में तापमान बढ़ने लगे है। 21-22 फरवरी से जब इन सिस्टम का असर खत्म हो जाएगा तो एक बार फिर मैदानी राज्यों में मौसम में बदलाव देखने को मिलेगा।</p>', 4, 'uploads/images/202302/image_870x580_63ec7d30f1a91.jpg', 'uploads/images/202302/image_870x_63ec7d310ca8b.jpg', 'uploads/images/202302/image_694x532_63ec7d31194f5.jpg', 'uploads/images/202302/image_430x256_63ec7d3120504.jpg', 'uploads/images/202302/image_140x98_63ec7d312371f.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-15 12:06:06'),
(26, 1, 'स्टूडेंट से गैरहाजिर रहने का कारण पूछा तो महिला प्रिंसिपल से की मारपीट , धमकी देकर भागा', 'when-the-student-was-asked-the-reason-for-being-absent-the-female-principal-was-assaulted-threatened-and-ran-away', NULL, NULL, 'फरीदाबाद स्थित एक कॉलेज की प्रिंसिपल के साथ BSC थर्ड ईयर के स्टूडेंट ने न केवल मारपीट की, बल्कि उन्हें जान से मारने की धमकी भी दी। आरोपी कई दिनों से कॉलेज से गैर हाजिर था।', '<p>हरियाणा: फरीदाबाद स्थित एक कॉलेज की प्रिंसिपल के साथ BSC थर्ड ईयर के स्टूडेंट ने न केवल मारपीट की, बल्कि उन्हें जान से मारने की धमकी भी दी। आरोपी कई दिनों से कॉलेज से गैर हाजिर था। प्रिंसिपल के कारण पूछने पर उसने वारदात को अंजाम दिया। भोपानी थाना पुलिस ने आरोपी छात्र के खिलाफ केस दर्ज कर लिया है।</p>\r\n<p>मिली जानकारी के अनुसार, मूलरूप से तमिलनाडु निवासी पद्यावती फिलहाल फरीदाबाद के सेक्टर-88 स्थित RPS सवाना में रहती है। वह लिग्यांज इंस्टीट्यूट ऑफ हेल्थ साइंस कॉलेज में प्रिंसिपल के पद पर कार्यरत है। उन्होंने बताया कि फरीदाबाद के गांव छांयसा निवासी पंकज कॉलेज में BSC थर्ड ईयर का स्टूडेंट है।</p>\r\n<p>प्रिंसिपल ने बताया कि कॉलेज की कक्षाएं 1 फरवरी से लगनी शुरू हो गई थी। आरोपी पंकज 1 से 12 फरवरी के बीच कॉलेज में नहीं आया। इसके बाद कॉलेज लौटा तो पंकज को बुलाकर गैर हाजिर रहने का कारण पूछा। पंकज ने उससे गाली-गलौज करते हुए मारपीट की।</p>\r\n<p>पहले उसके हाथों को पकड़ लिया और फिर धक्का देकर गिरा दिया। साथ ही धमकी दी कि अगर घटना के बारे में किसी को बताया तो जान से मार देगा। वारदात की सूचना पाकर पुलिस पहुंची तो आरोपी छात्र मौके से भाग गया। पुलिस ने आरोपी के खिलाफ केस दर्ज कर लिया है।</p>', 4, 'uploads/images/202302/image_870x580_63ec809cd8367.jpg', 'uploads/images/202302/image_870x_63ec809ce7913.jpg', 'uploads/images/202302/image_694x532_63ec809cf2113.jpg', 'uploads/images/202302/image_430x256_63ec809d033f9.jpg', 'uploads/images/202302/image_140x98_63ec809d0622e.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-15 12:20:14'),
(27, 1, 'स्कूटी चालक से लिफ्ट लेना पुलिसकर्मी को पड़ा महंगा, कॉल करने के बहाने लेकर भागा था कांस्टेबल का मोबाइल; आरोपी काबू में', 'taking-a-lift-from-the-scooty-driver-cost-the-policeman-he-ran-away-with-the-constables-mobile-on-the-pretext-of-making-a-call-accused-under-control', NULL, NULL, 'अंबाला सिटी में DAV पुलिस स्कूल के सामने स्कूटी चालक से लिफ्ट लेना पुलिसकर्मी को महंगा पड़ गया। एक्टिवा सवार ने फोन मिलाने की बात कह पुलिस कर्मी का मोबाइल झपट लिया और धक्का देकर भाग निकला।', '<p>हरियाणा : अंबाला सिटी में DAV पुलिस स्कूल के सामने स्कूटी चालक से लिफ्ट लेना पुलिसकर्मी को महंगा पड़ गया। एक्टिवा सवार ने फोन मिलाने की बात कह पुलिस कर्मी का मोबाइल झपट लिया और धक्का देकर भाग निकला। हालांकि, पुलिस ने मोबाइल लोकेशन ट्रैकिंग करके आरोपी को काबू कर लिया। आरोपी की पहचान दीपू राणा के रूप में हुई है। पुलिस आरोपी को हिरासत में लेकर पूछताछ कर रही है।</p>\r\n<p>सेक्टर-9 पुलिस में मूल रूप से भिवानी के गांव सुई निवासी कॉन्स्टेबल प्रविंद्र कुमार ने बताया कि उसकी ड्यूटी GRP पुलिस लाइन में है। वह मंगलवार दोपहर बाद पौने 3 बजे भिवानी जाने के लिए लाइन से निकला था।</p>\r\n<p>कॉन्स्टेबल ने बताया कि उसने पुलिस DAV स्कूल के पास एक स्कूटी चालक से लिफ्ट मांगी। उसने स्कूटी का नंबर भी नोट कर लिया था। उसने अग्रसेन चौक पहुंचने से पहले पीर बाबा टी पॉइंट पर स्कूटी रोक ली और कहने लगा कि उसे सेक्टर-7 जाना है।</p>\r\n<p>शिकायतकर्ता ने बताया कि वह स्कूटी से उतरा तो वह कहने लगा अपने मोबाइल से एक नंबर डायल कर उसकी बात करवा दो, उसका फोन नहीं लग रहा है। जैसे ही उसने फोन निकाला तो स्कूटी चालक उसे धक्का देकर उसका एमआई नोट 7 प्रो मोबाइल छीनकर स्कूटी भगा ले गया। उसे इस दौरान हल्की चोटें भी आई। मोबाइल के कवर में ही उसका पुलिस विभाग का आइडेंटिटी कार्ड था। लोकेशन ट्रैक कर आरोपी को पकड़ लिया गया।</p>', 4, 'uploads/images/202302/image_870x580_63ec848fa2534.jpg', 'uploads/images/202302/image_870x_63ec848fb3637.jpg', 'uploads/images/202302/image_694x532_63ec848fc305d.jpg', 'uploads/images/202302/image_430x256_63ec848fc9e32.jpg', 'uploads/images/202302/image_140x98_63ec848fcf2e1.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-15 12:37:15'),
(28, 1, 'कार में शादी की बात को लेकर झगड़ा हुआ... मोबाइल केबल से गला घोंटा,  फ्रिज में रखी बॉडी', 'there-was-a-fight-in-the-car-over-the-matter-of-marriage-strangled-with-mobile-cable-body-kept-in-fridge', NULL, NULL, 'दिल्ली में निक्की यादव मर्डर केस में अब बड़े खुलासे हो रहे हैं। पुलिस सूत्रों के मुताबिक, 9 फरवरी की शाम को शादी को लेकर निक्की और साहिल गहलोत का कार में झगड़ा हुआ था। बात इतनी बिगड़ गई की गुस्साए साहिल ने कश्मीरी गेट स्थित ISBT पर मोबाइल की केबल (तार) से निक्की का गला घोंट दिया।', '<p>दिल्ली में निक्की यादव मर्डर केस में अब बड़े खुलासे हो रहे हैं। पुलिस सूत्रों के मुताबिक, 9 फरवरी की शाम को शादी को लेकर निक्की और साहिल गहलोत का कार में झगड़ा हुआ था। बात इतनी बिगड़ गई की गुस्साए साहिल ने कश्मीरी गेट स्थित ISBT पर मोबाइल की केबल (तार) से निक्की का गला घोंट दिया। इसके बाद 35 किमी दूर मित्रांव गांव पहुंचा।</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63ec8a16aead9.jpg\" alt=\"\"></p>\r\n<p>साहिल ने यहां अपने ढाबे के फ्रिज में निक्की का शव छिपा दिया। साहिल निक्की की लाश को ठिकाने लगा पाता इससे पहले ही किसी ने पुलिस को खबर कर दी। दिल्ली पुलिस की क्राइम ब्रांच ने आरोपी साहिल को मंगलवार को अरेस्ट कर लिया। कोर्ट ने मंगलवार को ही उसे 5 दिन की रिमांड पर भेज दिया है।<br>वहीं, आज दिल्ली के दीन दयाल उपाध्याय अस्पताल में निक्की का पोस्टमॉर्टम होगा।</p>\r\n<p>DCP क्राइम ब्रांच सतीश कुमार ने बताया कि साहिल की शादी परिवार ने कहीं और तय कर दी थी। 10 फरवरी को शादी थी। यह बात निक्की को 9 फरवरी को पता चली। इसी दिन दोनों ने गोवा जाने का प्लान बनाया था। लेकिन साहिल ने जाने से इनकार कर दिया। फिर दोनों को झगड़ा हुआ।</p>\r\n<p>इसके बाद शाम को साहिल ने निक्की को बुलाया और दोनों कार से घूमने निकल गए। दोनों ISBT कश्मीरी गेट के पास पहुंचे। यहां फिर से उनका झगड़ा हुआ और गुस्साए साहिल ने कार में ही मोबाइल केबल से निक्की का गला घोंट दिया।</p>\r\n<p>पुलिस सूत्रों के मुताबिक, इसके बाद साहिल निक्की की लाश को लेकर दिल्ली की सड़कों पर घूमता रहा है। फिर वह नजफगढ़ होते हुए अपने गांव मित्रांव गांव पहुंचा। ISBT से यहां की दूरी करीब 35 किमी है। साहिल ने लाश यहां अपने ढाबा के फ्रिज में छुपा दी और घर चला गया। इसके बाद घरवालों के कहने पर 10 फरवरी को दूसरी लड़की से शादी कर ली।</p>\r\n<p>साहिल ने उस वक्त फंस गया, जब किसी ने पुलिस को खबर दी। पुलिस ने साहिल के ढाबे के फ्रिज से निक्की की लाश बरामद कर ली। साहिल का ढाबा गांव वाले घर से 700 मीटर की दूरी पर है। सूत्रों के मुताबिक, शादी के बाद वह लाश को ठिकाने लगाने वाला था, लेकिन पकड़ा गया।</p>\r\n<p>रिपोर्ट्स के मुताबिक निक्की के पिता सुनील की शनिवार से बेटी से बात नहीं हुई तो उन्होंने बेटी की दोस्त को फोन किया। उससे पता चला कि निक्की बिंदापुर वाले घर पर नहीं है। उसे आखिरी बार साहिल के साथ देखा गया था। सुनील ने एक दोस्त से साहिल का नंबर लिया।</p>\r\n<p>निक्की के पिता साहिल को फोन करके 3 दिन तक बेटी के बारे में पूछते रहे। हर बार साहिल बहाने बनाता रहा। आखिर में उसने बताया कि वह छुट्&zwnj;टी मनाने देहरादून-मसूरी गई है। साहिल ने यह भी कहा कि वह अपनी शादी में बिजी है।</p>\r\n<p>इसके बाद सुनील ने साहिल के पैरेंट्स से बात की। उन्होंने बताया साहिल बाहर गया है। बाद में उन्होंने कहा कि वे निक्की के बारे में नहीं जानते। सुनील ने ये सारी बातें फोन में रिकॉर्ड कर रखी हैं।</p>\r\n<p>निक्की के पिता सुनील यादव ने बताया कि डेढ़ महीने पहले ही निक्की घर आई थी। वह 3-4 दिन रुकी थी, तब न तो वह किसी टेंशन में थी न ही उसने साहिल गहलोत या गोवा प्लान के बारे में किसी से कुछ बताया था। पिता को बेटी की मौत का पता तब चला जब दिल्ली क्राइम ब्रांच ने उन्हें फोन किया। सुनील यादव ने आरोपी साहिल को फांसी दिए जाने की मांग की है।</p>\r\n<p>22 साल की निक्की हरियाणा के झज्जर की रहने वाली थी। वहीं, 24 साल का साहिल नजफगढ़ के मित्रांव गांव से है। दोनों 2018 से साउथ दिल्ली के उत्तम नगर में लिव इन में रहते थे।</p>\r\n<p>निक्की-साहिल की मुलाकात 2018 में कोचिंग में हुई थी। साहिल स्कूल के बाद जनवरी 2018 में उत्तम नगर की करियर पॉइंट कोचिंग में SSC एग्जाम की तैयारी करने लगा। इस दौरान निक्की ने उत्तम नगर के ही आकाश इंस्टीट्यूट में मेडिकल एंट्रेस एग्जाम की तैयारी शुरू की थी। दोनों एक ही बस में आते-जाते थे। दोनों में दोस्ती हुई और बाद में प्यार हो गया।</p>\r\n<p>साहिल ने फरवरी 2018 में ग्रेटर नोएडा के गलगोटिया कॉलेज में डी. फार्मा में एडमिशन लिया और निक्की ने भी इसी कॉलेज में बीए (इंग्लिश ऑनर्स) जॉइन किया। इसके बाद दोनों ग्रेटर नोएडा में किराए के मकान में साथ रहने लगे।</p>', 1, 'uploads/images/202302/image_870x580_63ec89aa6a9e7.jpg', 'uploads/images/202302/image_870x_63ec89aa7588c.jpg', 'uploads/images/202302/image_694x532_63ec89aa7fde4.jpg', 'uploads/images/202302/image_430x256_63ec89aa844eb.jpg', 'uploads/images/202302/image_140x98_63ec89aa86cc2.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-15 13:06:48'),
(29, 1, 'तुर्की-सीरिया में मौत का आंकड़ा 40 हजार पार,  मलबे से शवों के निकलने का सिलसिला जारी', 'death-toll-in-turkey-syria-crosses-40-thousand-process-of-getting-dead-bodies-out-of-debris-continues', NULL, NULL, 'तुर्की और सीरिया में आए भूकंप के बाद इमारतों के मलबे से शवों के निकलने का सिलसिला जारी है।  दोनों देशों में मलबे से 40 हजार से ज्यादा के शवों को निकाला जा चुका है।', '<p>Turkey-Syria : तुर्की और सीरिया में आए भूकंप के बाद इमारतों के मलबे से शवों के निकलने का सिलसिला जारी है। ताजा रिपोर्ट के अनुसार, दोनों देशों में मलबे से 40 हजार से ज्यादा के शवों को निकाला जा चुका है। बचावकर्मी तबाही के दो सौ घंटे से अधिक समय बीत जाने के बाद भी लोगों के जीवित मिलने की कुछ उम्मीद में मलबा हटाने के काम में लगे हैं।</p>\r\n<p>तुर्की और सीरिया में छह फरवरी को आए विनाशकारी भूकंप से तबाही मची हुई है। शक्तिशाली भूकंप ने कई शहरों के बर्बाद कर दिया। दोनों देशों में मलबे से 41 हजार से ज्यादा के बॉडी निकाली जा चुकी है। इमारतों के मलबे से शवों के निकलने का सिलसिला जारी है। दुनिया भर से आए बचावकर्मी लगातार लोगों को ढूंढने में जुटे हुए हैं। हालांकि स्थिति भयावह होने के चलते मदद हर किसी तक तत्काल नहीं पहुंच पा रही है। वहीं संयुक्त राष्ट्र की ओर से बताया गया है कि सीरिया में रेस्क्यू ऑपरेशन बंद होने जा रहा है।</p>\r\n<p>तुर्की और सीरिया में भूकंप से अब तक 41 हजार से ज्यादा लोगों की मौत हो चुकी है। दक्षिण-पूर्वी तुर्की और उत्तरी सीरिया में 6 फरवरी को नौ घंटे के अंतराल पर आए 7.8 और 7.5 तीव्रता के भूकंप से मरने वालों की संख्या 41 हजार को पार हो गई है। दमिश्क में सीरियाई स्वास्थ्य मंत्रालय ने कहा कि बचाव समूह व्हाइट हेल्मेट्स के अनुसार, विद्रोहियों के कब्जे वाले उत्तर-पश्चिमी क्षेत्र में मृतक संख्या 2,166 तक पहुंच गई है, जबकि 1,414 लोग सरकारी कब्जे वाले क्षेत्रों में मारे गए हैं। सीरिया में मरने वालों की कुल संख्या 5,814 है।</p>\r\n<p>तुर्की में भूकंप से प्रभावित लोगों के लिए दिन रात रेस्क्यू ऑपरेशन चलाया जा रहा है। भूकंप प्रभावित तुर्की में बचावकर्मी तबाही के 200 घंटे से अधिक समय बीत जाने के बाद भी लोगों के जीवित मिलने की कुछ उम्मीद में मलबा हटाने के काम में लगे हैं। इसी बीच 212 घंटे बाद 77 वर्षीय एक व्यक्ति को मलबे से सुरक्षित निकाला गया। सहायता एजेंसियों और सरकारों ने तुर्की और सीरिया के भूकंप प्रभावित हिस्सों में मदद भेजने के लिए अभियान तेज कर दिया है।</p>\r\n<p>बचावकर्मी तबाही के दो सौ घंटे से अधिक समय बीत जाने के बाद भी लोगों के जीवित मिलने की कुछ उम्मीद में मलबा हटाने के काम में लगे हैं। न्यूज एजेंसी रॉयटर्स के मुताबिक, तुर्की में बीते मंगलवार को मलबे से 9 लोगों को बचाया गया। अब रेस्क्यू उन लोगों पर केंद्रित हो गया है, जिनके पास इस कड़कड़ाती हुई सर्दी में भोजन और रहने की व्यवस्था नहीं है। तुर्की के राष्ट्रपति तैयप एर्दोगन ने कहा कि भूकंप के बाद अब हालात नियंत्रण में हैं।</p>\r\n<p>तुर्की और सीरिया में राहत और बचाव कार्य के लिए एनडीआरएफ की टीमें तैनात हैं। ये टीमें रेस्क्यू ऑपरेशन से लेकर इलाज तक का काम कर रही है। सेना के C-17 ग्लोबमास्टर विमान के जरिए तुर्की और सीरिया में मोबाइल, अस्पताल, दवाइयां और कई राहत सामग्रियों से भरी 5 फ्लाइट भेजी जा चुकी हैं। इसके अलावा एक C-130 जे विमान पर भी राहत सामग्री भेजी गई है।</p>', 2, '', '', '', '', '', 'jpg', 'local', NULL, 2, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-15 13:25:14'),
(30, 1, 'हमेशा विवादों से दूर रहने वाले अक्षय कुमार पड़े बड़ी मुसीबत में, भारत के नक्शे पर चलकर अक्षय कुमार ने मोल ली मुसीबत', 'akshay-kumar-who-always-stayed-away-from-controversies-was-in-big-trouble-akshay-kumar-bought-trouble-by-following-the-map-of-india', NULL, NULL, 'हमेशा विवादों से दूर रहने वाले अक्षय कुमार एक बड़ी मुसीबत में पड़ते दिखाई दे रहे हैं। उनपर भावनाओं को आहत करने का आरोप लगाया गया है। जिसके चलते अक्षय के खिलाफ एक वकील ने शिकायत दर्ज कराई है।', '<p>बॉलीवुड के खिलाड़ी अक्षय कुमार इन दिनों अपनी नई फिल्म \'सेल्फी\' के प्रमोशन में जुटे हुए हैं। इस फिल्म में उनके साथ पहली बार इमरान हाशमी दिखाई देंगे। लेकिन इन सब के बीच वह एक बड़ी मुसीबत में फंस गए हैं। मीडिया रिपोर्ट के मुताबिक, अक्षय कुमार के खिलाफ एक वकील ने जिले के एसपी और केंद्रीय गृहमंत्री को खत लिखकर उनपर भारत के नक्शे का अपमान करने का आरोप लगाया है। साथ ही उनके खिलाफ शिकायत भी दर्ज करवाई है। जिसके चलते अब एक्टर फिलहाल मुसीबत में पड़ते नजर आ रहे हैं।</p>\r\n<p>बता दें कि पिछले दिनों ही दिनों अक्षय कुमार एक अंतरराष्ट्रीय एयरलाइंस का प्रचार करते नजर आए थे। जिसकी वीडियो सोशल मीडिया पर काफी वायरल हुई थी। इस वीडियो में एक्टर मूविंग ग्लोब के ऊपर चलते हुए दिखाई दिए थे। तभी वीडियो में एक ऐसा सीन देखने को मिला जिसमें उनके पैर के नीचे भारत का मैप होता है। इसी विज्ञापन की वजह से एडवोकेट वीरेंद्र पंजाबी ने अक्षय कुमार के खिलाफ शिकायत दर्ज कराई गई है। साथ ही एक्टर पर भावनाओं को आहत करने का आरोप लगाया गया है।</p>', 6, 'uploads/images/202302/image_870x580_63ec92f898bea.jpg', 'uploads/images/202302/image_870x_63ec931a75161.jpg', 'uploads/images/202302/image_694x532_63ec931aa6df5.jpg', 'uploads/images/202302/image_430x256_63ec931b0f759.jpg', 'uploads/images/202302/image_140x98_63ec931b12d11.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-15 13:42:04'),
