(32, 1, 'भोपाल में एक कॉल से किया मोबाइल हैक ; वॉट्सऐप के जरिए पीड़ित के दोस्त से ठगे एक लाख रुपये', 'mobile-hacked-with-one-call-in-bhopal-victims-friend-cheated-one-lakh-rupees-through-whatsapp', NULL, NULL, 'भोपाल में एक कॉल से मोबाइल हैक करने का मामला सामने आया है। घटना रविवार की है।', '<p>भोपाल में एक कॉल से मोबाइल हैक करने का मामला सामने आया है। घटना रविवार की है। पीड़ित प्रियंका गुप्ता ने बताया कि मेरे पास एक कॉल आया और बोला गया कि 5G नेटवर्क के लिए टेस्टिंग चल रही है। इसलिए मैं एक नंबर दे रहा हूं, आप उसपर कॉल कर लीजिए। जैसे ही मैंने उस नंबर पर कॉल किया मेरे सारे कॉल और मैसेजेस उसके पास डॉयवर्ट हो गए।</p>\r\n<p>प्रियंका ने बताया- हैकर ने मुझे मोबाइल नंबर- 9153801883 से कॉल किया और पूछा कि क्या आपके मोबाइल में 5G नेटवर्क अच्छा चल रहा है, तो मैंने जवाब दिया कि नहीं। इसके बाद ही उसने एक नंबर ( *401# 9153801883) पर कॉल करने के लिए कहा था। अब आरोपी वॉट्सऐप के जरिए मेरे दोस्तो से पैसे मांग रहा है। मेरे दोस्त से उसने एक लाख की ठगी भी कर ली है।</p>\r\n<p>प्रियंका ने बताया कि हैकर के पास मेरे कॉन्टेंट लिस्ट, मैसेजेस के अलावा पूरा सोशल मीडिया है। पीड़ित ने कहा कि आरोपी अब वॉट्सऐप के जरिए मेरे पहचान के लोगों से पैसे मांग रहा है। किसी से 5 हजार तो किसी से 10 और 15 हजार मांग रहा है। पीड़ित का कहना है कि आरोपी 9153801883399@paytm पर पैसे मंगा रहा है। जब इस आईडी को सर्च किया जा रहा है तो उसमें रघुनंदन यादव नाम आ रहा है।</p>\r\n<p>प्रियंका का कहना है कि मेरी दोस्त शिल्पा देशमुख के साथ भी रविवार की सुबह इसी तरह की घटना हुई है। हैकर ने शिल्पा के दोस्तों से सेम paytm आईडी से पैसे मांगे तो उसके दोस्तों ने लगभग 1 लाख रुपए भेज दिए। शिल्पा ने भी इंदौर साइबर सेल में केस दर्ज करवाया है। पुलिस का कहना है कि दोनों मामलों को एक साथ जोड़कर जांच की जा रही है।</p>', 3, 'uploads/images/202302/image_870x580_63ec9d2dbf83c.jpg', 'uploads/images/202302/image_870x_63ec9d2dcb272.jpg', 'uploads/images/202302/image_694x532_63ec9d2dd4283.jpg', 'uploads/images/202302/image_430x256_63ec9d2dd882d.jpg', 'uploads/images/202302/image_140x98_63ec9d2dda47e.jpg', 'jpg', 'local', NULL, 1, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-15 14:22:34'),
(33, 1, 'PAK मीडिया में छाए मोदी.... पीएम मोदी के मुरीद बन गए हैं पाकिस्‍तानी', 'modi-dominates-pak-media-pakistanis-have-become-followers-of-pm-modi', NULL, NULL, 'पाकिस्‍तान जमकर भारत सरकार की नीतियों की तारीफ कर रहा है। पाकिस्‍तान मीडिया में तुर्की के साथ रूस और यूक्रेन के भारत के स्‍टैंड की काफी चर्चा है। पाकिस्तानी एक्‍सपर्ट्स इसके लिए पीएम मोदी की सराहना कर रहे हैं।', '<p>गंभीर आर्थिक संकट झेल रहे पाकिस्&zwj;तान में प्रधानमंत्री नरेंद्र मोदी चर्चा में हैं। पाकिस्&zwj;तानी अपने मुल्&zwj;क में पीएम मोदी जैसा नेता चाहते हैं। प्रधानमंत्री मोदी को लेकर पाकिस्&zwj;तानी मीडिया के रुख में अचानक यू-टर्न आ गया है। उनकी तारीफ करते वह थक नहीं रहा है। वहां के चैनलों में भारत की आर्थिक और विदेश नीति सुर्खियों में आ गई है। तुर्की में मदद से लेकर रूस और यूक्रेन युद्ध में भारत के रुख को पाक&zwj;िस्&zwj;तानी एक्&zwj;सपर्ट्स खुलकर सराह रहे हैं। वे भारत के साथ रिश्&zwj;ते सुधारने की मांग करने लगे हैं। पाकिस्&zwj;तान आज जिस कंगाली में आकर खड़ा हो गया है, उसके लिए वे पाकिस्&zwj;तानी हुकूमत को कसूरवार मानते हैं।</p>\r\n<p>अपनी ही कारगुजारियों ने पाकिस्&zwj;तान को मुश्किल में फंसा दिया है। उसका आर्थिक संकट गहराता जा रहा है। वहां का मीडिया शहबाज शरीफ सरकार की खुलकर धज्जियां उड़ाने में लगा है। इसके उलट पानी पी-पीकर भारतीय प्रधानमंत्री नरेंद्र मोदी को कोसने वाले पाकिस्&zwj;तानी मीडिया का रुख एकदम बदल गया है। चर्चा में शिरकत करने वाले तमाम पाक&zwj;िस्&zwj;तानी एक्&zwj;सपर्ट्स भारत की विदेश और आर्थिक नीति की वाहवाही कर रहे हैं।</p>\r\n<p>पाकिस्&zwj;तान मीडिया खुलकर कहने लगा है कि अब भारत से प्रतिस्&zwj;पर्धा भूल जानी चाहिए। वह बहुत आगे निकल चुका है। तुर्की से दुश्&zwj;मनी भुलाकर जिस तरह भारत ने मदद भेजी, उसे भी बहुत सराहा गया है। अलबत्&zwj;ता, पाकिस्&zwj;तान सरकर ने भूकंप के वक्&zwj;त जिस बेशर्मी से इस मदद को तुर्की तक पहुंचने में अड़ंगा लगाया, उसकी आलोचना वहां भी हुई है।</p>\r\n<p>पाकिस्&zwj;तानी एक्&zwj;सपर्ट्स के मुताबिक, उनकी हुकूमत के पास दुनिया को देने के लिए कुछ नहीं है। दूसरी ओर भारत आज अपनी पॉलिसियों की वजह से संयुक्&zwj;त राष्&zwj;ट्र सुरक्षा परिषद (UNSC) में स्&zwj;थायी सीट पाने का प्रबल दावेदार बन गया है। रूस और यूक्रेन के बीच जारी युद्ध को रुकवाने में वह मध्&zwj;यस्&zwj;थता निभाने में जुटा है। कोई भी देश उसे नजरअंदाज नहीं कर सकता है। सभी पश्चिमी देश भारत को हाथोंहाथ लेने को खड़े हैं। ब्रिटेन को पछाड़ पांचवीं सबसे बड़ी अर्थव्&zwj;यवस्&zwj;था बनना सबूत है कि वह किस तेजी के साथ अपनी योजनाओं को पूरा करने में लगा है।</p>\r\n<p>पाकिस्&zwj;तानी एक्&zwj;सपर्ट्स शहबाज शरीफ सरकार को पीएम मोदी से सीखने की नसीहत देने में लगे हैं। चीन पर भारत के रुख की भी उन्&zwj;होंने सराहना की है। वे यह भी कह रहे हैं कि प्रधानमंत्री मोदी ने जिस तरह का माहौल बन दिया है, उससे पाकिस्&zwj;तान की बात सुनने वाला कोई नहीं रह गया है। मोदी की पॉलिसियों के कारण आज कश्&zwj;मीर मुद्दा भी कहीं पीछे चला गया है। तमाम मुस्&zwj;ल&zwj;िम मुमालिक भी पाकिस्&zwj;तान से दूर होकर भारत के साथ रिश्&zwj;ते बनाने में लगे हैं। उन्&zwj;हें भारत की अहमियत का अंदाजा लग चुका है। उन्&zwj;हें पता कि पाकिस्&zwj;तान सिर्फ भीख मांग सकता है। उसके पास देने को कुछ नहीं है। अंतरराष्&zwj;ट्रीय मुद्राकोष (IMF) से भी वह बस इसी जुगाड़ में है। इसके लिए वह हर शर्त मान लेगा।</p>', 2, 'uploads/images/202302/image_870x580_63edcb678985e.jpg', 'uploads/images/202302/image_870x_63edcb6796ba2.jpg', 'uploads/images/202302/image_694x532_63edcb67a1548.jpg', 'uploads/images/202302/image_430x256_63edcb67a70ec.jpg', 'uploads/images/202302/image_140x98_63edcb67a9374.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-16 11:51:35'),
(34, 1, 'पहले सगाई में दोस्तों संग किया जमकर डांस, फिर की निक्की की हत्या', 'danced-fiercely-with-friends-in-the-first-engagement-then-killed-nikki', NULL, NULL, 'निक्की यादव की हत्या के मामले में चौंकाने वाला खुलासा हुआ है। पुलिस पूछताछ में आरोपी साहिल गहलोत ने घटना वाली रात की पूरी कहानी बताई।', '<p>दिल्ली: लिव इन पार्टनरों की बेरहमी से हत्या के मामले से राजधानी दिल्ली शर्मसार है। दोस्ती, प्यार और फिर बेरहमी से पार्टनर की कत्ल की कहानी जानकर लोगों में गुस्से का भाव है। श्रद्धा वाल्कर के बाद प्रेमी की बेवफाई की शिकार हुई निक्की यादव की कहानी इन दिनों में सुर्खियों में बनी है। निक्की मर्डर केस में पुलिस की जांच में कई चौंकाने वाले खुलासे हुए। निक्की का हत्यारा साहिल गहलोत इस समय पुलिस हिरासत में है। कहानी की तह तक जाने के लिए पुलिस उससे पूछताछ कर रही है। इस पूछताछ में उसने खुलासा किया कि निक्की की हत्या से पहले उसने अपनी सगाई में दोस्तों के साथ जमकर डांस किया था। मामले की जांच में जुटे एक वरिष्ठ अधिकारी ने बताया कि पूछताछ में गहलोत ने बताया कि वह यह फैसला नहीं कर पा रहा था कि उसे अपनी लिव-इन पार्टनर निक्की के साथ रहना है या माता-पिता की पसंद की लड़की से शादी करनी है। इसी पशोपेश में उनसे घर वालों की मर्जी के अनुसार दूसरी लड़की के साथ शादी की। और उससे पहले लिव इन पार्टनर निक्की की हत्या कर उसके लाश को फ्रिज में छिपा दिया।</p>\r\n<p>दिल्ली पुलिस के अनुसार आरोपी साहिल गहलोत ने 9 फरवरी को अपने सगाई समारोह में दोस्तों के साथ जमकर डांस किया था और बाद में अपनी लिव-इन पार्टनर निक्की यादव की गला घोंटकर हत्या कर ही। हत्या के बाद उसका शव फ्रिज में रख दिया और अगले दिन 24 वर्षीय आरोपी गहलोत ने शादी कर ली। पूछताछ में आरोपी ने पुलिस को बताया कि वह घटना से करीब 15 दिन पहले निक्की यादव के घर से निकल गया था, लेकिन 9 फरवरी को अपनी सगाई के बाद, वह उत्तम नगर में उसके घर गया और उसने उसके साथ समय बिताया।</p>\r\n<p>दिल्ली पुलिस के अधिकारियों ने बताया कि निक्की की हत्या नौ-दस फरवरी की दरमियानी रात को हुई थी। 9 फरवरी को साहिल की सगाई थी। जिसमें उसने दोस्तों संग खूब मस्ती की। फिर रात में निक्की की हत्या कर उसके शव को दक्षिण-पश्चिम दिल्ली स्थित अपने ढाबे के रेफ्रिजरेटर में रखा और उसी दिन दूसरी महिला से शादी रचाने के लिए रवाना हो गया।</p>\r\n<p>उल्लेखनीय हो कि इस मामले का खुलासा मंगलवार को हुआ था। पुलिस ने साहिल को गिरफ्तार करते हुए उसकी निशानदेही पर फ्रिज से निक्की यादव की लाश बरामद की थी। बुधवार को दिल्ली पुलिस ने आरोपी को साकेत कोर्ट में पेश किया था। जहां से कोर्ट ने उसे 5 दिन की रिमांड पर भेज दिया है। बुधवार को ही निक्की के शव का पोस्टमार्टम हुआ। जिसके बाद उसकी डेडबॉडी परिजनों को सौंप दी गई। निक्की के परिजनों ने हरियाणा के झज्जर स्थित अपने घर पर अंतिम संस्कार कर दिया।</p>', 1, 'uploads/images/202302/image_870x580_63edd27c3654b.jpg', 'uploads/images/202302/image_870x_63edd27c41044.jpg', 'uploads/images/202302/image_694x532_63edd27c4a036.jpg', 'uploads/images/202302/image_430x256_63edd27c4e74c.jpg', 'uploads/images/202302/image_140x98_63edd27c50385.jpg', 'jpg', 'local', NULL, 1, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-16 12:21:55');
