(35, 1, 'MP में मौसम ने बदला अपना रुख, दिन में चुभने लगी धूप ; भोपाल, इंदौर-ग्वालियर में भी दिन में गर्मी', 'the-weather-changed-its-attitude-in-mp-the-sun-started-stinging-during-the-day-day-heat-in-bhopal-indore-gwalior-too', NULL, NULL, 'मध्यप्रदेश में मौसम ने यू-टर्न ले लिया है। भोपाल, इंदौर और ग्वालियर में भी गर्मी का असर है। वहीं, राजगढ़ में 35 डिग्री के ज्यादा तापमान है। कुछ शहरों में रात के तापमान में भी बढ़ोतरी हो गई है।', '<p>मध्यप्रदेश में मौसम ने यू-टर्न ले लिया है। दो दिन गिरावट के बाद पारे में फिर से बढ़ोतरी हुई है। खासकर दिन के तापमान में। कई शहरों में तापमान 30 डिग्री के पार पहुंच चुका है। भोपाल, इंदौर और ग्वालियर में भी गर्मी का असर है। वहीं, राजगढ़ में 35 डिग्री के ज्यादा तापमान है। कुछ शहरों में रात के तापमान में भी बढ़ोतरी हो गई है।</p>\r\n<p>मौसम वैज्ञानिक एचएस पांडे ने बताया कि महाशिवरात्रि तक ठंड का असर रहेगा। इसके बाद रात का पारा भी बढ़ने लगेगा। फरवरी के आखिरी दिनों में सभी शहरों में दिन का तापमान 30-32 और रात में 12 डिग्री के पार पहुंच जाएगा।</p>\r\n<p>राजगढ़ में दिन का तापमान 35.6 डिग्री के पार पहुंच गया है। रतलाम, गुना में 33 डिग्री, दमोह, सिवनी, धार, खंडवा, खरगोन, उज्जैन में 32 डिग्री से ज्यादा तापमान है। पचमढ़ी, रीवा, नरसिंहपुर में पारा 26 डिग्री से कम है।</p>\r\n<p>इधर, रात के तापमान में भी बढ़ोतरी हो रही है। खजुराहो, मंडला, नरसिंहपुर, रीवा, दतिया, धार, ग्वालियर और रायसेन में तापमान 10 डिग्री के नीचे है। बाकी शहरों में पारा चढ़ा हुआ है।</p>\r\n<p>यहां फरवरी के दूसरे पखवाड़े के बाद से ही हल्की गर्मी की शुरुआत होती है। महीने का आखिरी हफ्ता सबसे ज्यादा तपता है। ट्रेंड के मुताबिक महीनेभर में दिन का सबसे ज्यादा तापमान आखिरी हफ्ते में ही रिकॉर्ड किया गया है। इस साल 10 फरवरी को पारा 33 डिग्री के पार पहुंच गया था।</p>\r\n<p>मौसम विशेषज्ञों के अनुसार फरवरी के आखिरी हफ्ते से मप्र में गर्मी दस्तक दे सकती है। मार्च के आखिरी हफ्ते से लू चलने के हालात बन जाएंगे। आमतौर पर मप्र में तेज गर्मी 15 मार्च से शुरू होती है, जो 10 जून तक चलती है। इसके बाद प्री-मानसून गतिविधियां शुरू होती हैं।</p>\r\n<p>मार्च में सूर्य भूमध्य रेखा के करीब पहुंच जाता है, इससे दक्षिण भारत तपने लगता है। अप्रैल में सूर्य की स्थिति बदलने के बाद ही मप्र के दक्षिणी हिस्सों से तेज गर्मी की शुरुआत होती है, जो मई मध्य तक पूरे प्रदेश को कवर कर लेती है। जून के दूसरे पखवाड़े में सूर्य की स्थिति बदलने पर मौसम भी बदलने लगता है, लेकिन इस बार गर्मी का दौर लंबा चलने के संकेत हैं।</p>', 3, 'uploads/images/202302/image_870x580_63edd56e121a3.jpg', 'uploads/images/202302/image_870x_63edd56e2104a.jpg', 'uploads/images/202302/image_694x532_63edd56e2c55f.jpg', 'uploads/images/202302/image_430x256_63edd56e324be.jpg', 'uploads/images/202302/image_140x98_63edd56e34940.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-16 12:34:30'),
(36, 1, 'आदि महोत्सव दिल्ली में दिखेगी देश की जनजातीय संस्कृति की झलका, PM मोदी ने किया कार्यक्रम का उद्घाटन', 'tribal-culture-of-the-country-will-be-seen-in-aadi-mahotsav-delhi-pm-modi-inaugurated-the-program', NULL, NULL, 'प्रधानमंत्री नरेंद्र मोदी ने आज यानी की 16 फरवरी को राजधानी दिल्ली के मेजर ध्यान चंद राष्ट्रीय स्टेडियम में आदि महोत्सव 2023 का उद्घाटन किया। दिल्ली के मेजर ध्यानचंद स्टेडियम में भारत की जनजातीय कला-संस्कृति, शिल्प, शैली और पारंपरिक कला को प्रदर्शित करने के उद्देश्य से इस कार्यक्रम का आयोजन किया जा रहा है।', '<p>दिल्ली: प्रधानमंत्री नरेंद्र मोदी ने आज यानी की 16 फरवरी को राजधानी दिल्ली के मेजर ध्यान चंद राष्ट्रीय स्टेडियम में आदि महोत्सव 2023 का उद्घाटन किया। इस दौरान आदिवासी मामलों के मंत्री अर्जुन मुंडा भी पीएम मोदी के साथ थे। आदि महोत्सव के उद्घाटन के दौरान पीएम मोदी ने आदिवासियों के भगवान कहे जाने वाले बिरसा मुंडा को नमन किया। इसके बाद वो आदि महोत्सव में लगाए गए विभिन्न स्टॉल तक पहुंचे। उन्होंने स्टॉल में दिखाई जा रही चीजों के बारे में जानकारी ली। इस कार्यक्रम में जनजातीय संस्कृति, शिल्प, खान-पान, वाणिज्य और पारंपरिक कला को प्रदर्शित किया जा रहा है। इस महोत्सव में जनजातीय समुदायों द्वारा उपजाए जाने वाले श्री अन्न कार्यक्रम का केंद्र-बिंदु है। प्रधानमंत्री मोदी देश की जनजातीय आबादी के कल्याण के लिये लगातार कई तरह के कदम उठाते रहे हैं। इसके साथ ही वे देश की उन्नति और विकास में जनजातीय समुदाय के योगदान को उचित सम्मान भी देते रहे हैं। राष्ट्रीय मंच पर जनजातीय संस्कृति को प्रकट करने के इन्ही प्रयासों के तहत प्रधानमंत्री आदि महोत्सव का आयोजन किया जा रहा है।</p>\r\n<p>आदि महोत्सव जनजातीय संस्कृति, शिल्प, खान-पान, वाणिज्य और पारंपरिक कला का उत्सव मनाने वाला कार्यक्रम है। यह जनजातीय कार्य मंत्रालय के अधीन भारतीय जनजातीय सहकारी विपणन विकास महासंघ लिमिटेड (ट्राइफेड) की वार्षिक पहल है। इस वर्ष इसका आयोजन 16 से 27 फरवरी तक दिल्ली के मेजर ध्यान चंद राष्ट्रीय स्टेडियम में किया जा रहा है।</p>\r\n<p>कार्यक्रम में देशभर के जनजातीय समुदायों की समृद्ध और विविधतापूर्ण धरोहर को प्रदर्शित किया जायेगा। इसके लिये आयोजन-स्थल पर 200 से अधिक स्टॉल लगाये जायेंगे। महोत्सव में लगभग एक हजार जनजातीय शिल्पकार हिस्सा लेंगे।</p>\r\n<p>वर्ष 2023 से अंतर्राष्ट्रीय पोषक अनाज वर्ष मनाया जा रहा है, जिसके साथ हस्तशिल्प, हथकरघा, मिट्टी के पात्र बनाने की कला, आभूषण कला आदि भी आकर्षण होंगे। महोत्सव में जनजातीय समुदायों द्वारा उपजाये जाने वाले श्री अन्न को केंद्र में रखा गया है।</p>\r\n<p>11 दिवसीय आदि महोत्सव मेले में 28 राज्यों के लगभग 1000 आदिवासी कारीगर और कलाकार शामिल होंगे। 13 राज्यों के आदिवासी रसोइए मिलेट्स में जायके का तड़का लगाएंगे। आदिवासी संस्कृति शिल्प, व्यंजन, व्यापार और पारंपरिक कला की भावना का जश्न मनाने वाला आदि महोत्सव जनजातीय मामलों के मंत्रालय के तहत जनजातीय सहकारी विपणन विकास संघ लिमेटेड की एक पहल है।</p>', 4, 'uploads/images/202302/image_870x580_63edd91498df3.jpg', 'uploads/images/202302/image_870x_63edd914a965a.jpg', 'uploads/images/202302/image_694x532_63edd914b5a0b.jpg', 'uploads/images/202302/image_430x256_63edd914bc7d9.jpg', 'uploads/images/202302/image_140x98_63edd914bf2a9.jpg', 'jpg', 'local', NULL, 1, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-16 12:51:01'),
(37, 1, '500 करोड़ कमाने वाली पहली बॉलीवुड फिल्म बनी पठान, यश स्टारर फिल्म केजीएफ 2 के हिंदी वर्जन को पीछे छोड़ा', 'pathan-became-the-first-bollywood-film-to-earn-500-crores-leaving-behind-the-hindi-version-of-yash-starrer-film-kgf-2', NULL, NULL, 'फिल्म ने 500 करोड़ के क्लब में ग्रैंड एंट्री कर ली है।  22वें दिन बॉक्स ऑफिस पर कतई बवाल काट दिया है। फिल्म रिलीज होने के बाद से ही तूफान बनकर टूटी है और सभी रिकॉर्ड को ब्रेक करते हुए महारत हासिल कर ली है।उम्मीद है कि जल्द ही यह बाहुबली 2 को पीछे छोड़ने वाली है।', '<p>शाहरुख खान की फिल्म \'पठान\' ने 22वें दिन बॉक्स ऑफिस पर कतई बवाल काट दिया है। फिल्म रिलीज होने के बाद से ही तूफान बनकर टूटी है और सभी रिकॉर्ड को ब्रेक करते हुए महारत हासिल कर ली है। आलम ये है कि पठान ने कई बड़ी फिल्मों जैसे आमिर खान की दंगल, साउथ स्टार यश की केजीएफ जैसी ब्लॉकबस्टर फिल्मों को भी पानी पिला दिया, जिन्हें पीछे छोड़ना नामुमकिन लग रहा था। चार साल के लंबे गैप के बाद वापस सिल्वर स्क्रीन पर आकर शाहरुख खान ने हंगामा मचा दिया है। दर्शकों ने भी इसमें पूरा साथ दिया। ताबड़तोड़ टिकट की बुकिंग हुई लोगों ने फिल्म को जबरदस्त प्यार दिया। नतीजा ये हुआ कि टिकट खिड़की पर पैसों की बरसात होने लगी। अब पठान ने 500 करोड़ के क्लब में ग्रैंड एंट्री ली है।</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63ede0214ce3f.jpg\" alt=\"\"></p>\r\n<p>बता दें कि पठान 25 जनवरी को सिनेमाघरों में रिलीज हुई थी। फिल्म ने रिलीज के पहले दिन ही 55 करोड़ रुपये की कमाई कर ली थी। कहना गलत नहीं होगा कि पहले ही दिन बादशाह खान ने बॉक्स ऑफिस (Pathaan Box Office) पर बादशाहत हासिल कर ली जो अब तक कायम है। फिल्म ताबड़तोड़ कमाई कर रही है। फिल्म को सिनेमाघरों में आए 22 दिन पूरे हो चुके हैं और इसकी धुंआधार कमाई बॉक्स ऑफिस पर सुनामी ला रही है। अपने तीसरे सोमवार को पठान ने 4.20 करोड़ का कलेक्शन किया और मंगलवार को ये आंकड़ा बढ़कर 5.6 करोड़ के पास पहुंच गया। इंडिया में नेट 500 करोड़ कमाने वाली पठान पहली बॉलीवुड की फिल्म बन गई है।</p>\r\n<p>वेलेंटाइन डे पर शाहरुख खान की पठान ने बॉक्स ऑफिस पर काटा गदर<br>हालांकि शुरुआती आकड़े जो आए हैं, उनके मुताबिक बुधवार को शाहरुख खान की पठान ने 3.50 करोड़ की कमाई की है और इसके साथ ही फिल्म ने सभी भाषाओं को मिलाकर अब तक 502.35 करोड़ का कलेक्शन कर लिया है। सिद्धार्थ आनंद के निर्देशन में बनी पठान कमाई के मामले में यश स्टारर फिल्म केजीएफ 2 के हिंदी वर्जन को कब का पीछे छोड़ चुकी है। ये एक्शन थ्रिलर फिल्म हिंदी की सबसे ज्यादा कमाई करने वाली फिल्म बन गई है।</p>\r\n<p>गौरतलब है कि सिद्धार्थ आनंद की एक्शन थ्रिलर \'पठान\' ने अब तक कई रिकॉर्ड ब्रेक किए हैं। फिल्म ने दंगल, केजीएफ चैप्टर 2, द कश्मीर फाइल्स और कई अन्य फिल्मों के लाइफटाइम कलेक्शन का रिकॉर्ड तोड़ा है। वहीं घरेलू बॉक्स ऑफिस पर गदर मचा रही फिल्म अब 500 करोड़ के क्लब में शामिल हो चुकी है। वहीं वर्ल्ड वाइड भी फिल्म 1000 करोड़ के क्लब में शामिल होने से बस कुछ ही दूर है। इस बीच जल्द ही पर्दे पर कार्तिक आर्यन की शहजादा रिलीज होगी, जो इस फिल्म को कड़ी टक्कर देने वाली है।</p>', 6, 'uploads/images/202302/image_870x580_63eddfef4449d.jpg', 'uploads/images/202302/image_870x_63eddfef546ba.jpg', 'uploads/images/202302/image_694x532_63eddfef60875.jpg', 'uploads/images/202302/image_430x256_63eddfef6569c.jpg', 'uploads/images/202302/image_140x98_63eddfef675b2.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, NULL, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, '2023-02-16 13:21:45', '2023-02-16 13:20:17'),
(38, 1, 'कुबेरेश्वर धाम - रुद्राक्ष महोत्सव की भीड़ में तीन महिलाएं लापता, इंदौर-भोपाल हाईवे पर 27km जाम', 'kubereshwar-dham-three-women-missing-in-the-crowd-of-rudraksh-festival-27km-jam-on-indore-bhopal-highway', NULL, NULL, 'कुबेरेश्वर धाम में रुद्राक्ष महोत्सव की शुरुआत हो चुकी है। 16 फरवरी से 22 फरवरी तक रुद्राक्ष महोत्सव चलेगा। अब तक करीब 10 लाख लोग इस महोत्सव में शामिल होने सीहोर पहुंचे हैं। भीड़ इतनी है कि पैदल चलना तक मुश्किल है। तीन महिलाएं लापता हो गईं।', '<p>मध्यप्रदेश में कथावाचक पंडित प्रदीप मिश्रा के सीहोर स्थित कुबेरेश्वर धाम में रुद्राक्ष महोत्सव की शुरुआत हो चुकी है। 16 फरवरी से 22 फरवरी तक रुद्राक्ष महोत्सव चलेगा। अब तक करीब 10 लाख लोग इस महोत्सव में शामिल होने सीहोर पहुंचे हैं। भीड़ इतनी है कि पैदल चलना तक मुश्किल है। तीन महिलाएं लापता हो गईं। एक महिला छत्तीसगढ़ के भिलाई से आई हैं, दूसरी राजस्थान के गंगापुर की रहने वाली हैं, तीसरी महाराष्ट्र के बुलढाणा की रहने वाली महिला भी लापता है।</p>\r\n<p>सुबह 10 बजे तक 5 लाख श्रद्धालुओं को रुद्राक्ष बांटे गए। एक दिन पहले भी डेढ़ लाख रुद्राक्ष बांटे गए थे। 40 काउंटर से रुद्राक्ष बांटे जा रहे हैं। दोपहर 3 बजे तक मुख्यमंत्री शिवराज सिंह चौहान भी कुबेरेश्वर धाम पहुंचेंगे।18 फरवरी को पूर्व मुख्यमंत्री कमलनाथ भी यहां पहुंच सकते हैं।</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63edecc8c7676.jpg\" alt=\"\"></p>\r\n<p>कुबेरेश्वर धाम से इछावर रोड तक 7 किमी का लंबा जाम लगा है। सीहोर से इंदौर की तरफ हाईवे पर 17 किलोमीटर लंबा जाम लगा हुआ है। भोपाल की ओर हाईवे पर 10 किलोमीटर लंबा जाम लगा हुआ है। यानी इंदौर-भोपाल हाईवे पर 27km लंबा जाम लगा हुआ है। अधिक भीड़ होने के कारण फोन नेटवर्क्स भी काम नहीं कर पा रहे। पुलिस और प्रशासन की टीम के अलावा RSS, बजरंग दल, स्थानीय लोग, समिति सदस्य सहित कुल 15000 लोग व्यवस्थाएं संभाल रहे हैं। इनकी ड्यूटियां कथा पंडाल, भोजन पंडाल, रुद्राक्ष वितरण केंद्र पर लगी हुई है।</p>\r\n<p>महोत्सव में सुरक्षा व्यवस्था की जिम्मेदारी ASP गितेश गर्ग संभाल रहे हैं। नगर पुलिस अधीक्षक निरंजन सिंह राजपूत और मंडी थाना प्रभारी हरिसिहं परमार को दूसरी श्रेणी में जिम्मेदारी दी गई। पुलिस 2 शिफ्ट में काम करेगी। पहली शिफ्ट सुबह 8 बजे से दोपहर 2 बजे तक और दूसरी शिफ्ट दोपहर 8 बजे से लेकर रात 8 बजे तक रहेगी। 700 जवान तैनात किए गए हैं। SP सीहोर मयंक अवस्थी के साथ 12 जवान रहेंगे। ASP और नगर पुलिस अधीक्षक के साथ 8-8 जवान रहेंगे। 100 जवानों को रिजर्व रखा गया है। ट्रैफिक पुलिस के जवान भी व्यवस्था संभाल रहे हैं।</p>\r\n<p>भक्तों की भारी भीड़ को देखते हुए धाम में पं. प्रदीप मिश्रा ने बुधवार को रुद्राक्ष वितरण शुरू कर दिया था। समिति ने 20 काउंटर्स से श्रद्धालुओं को रुद्राक्ष बांटे। बुधवार शाम तक करीब डेढ़ लाख से अधिक श्रद्धालुओं को रुद्राक्ष दिए गए। समिति के पंडित विनय मिश्रा, समीर शुक्ला, आशीष वर्मा, मनोज दीक्षित, आकाश शर्मा कथा स्थल पर नजर बनाए हुए हैं। वे एक-एक चीज का जायजा ले रहे हैं। पुलिस-प्रशासन भी मौके पर मुस्तैद है।</p>\r\n<p>शहर में श्रद्धालुओं की सेवा के लिए क्षेत्रवासी लगे हैं। सेवा करने जिले और आस-पास के क्षेत्रों से कई संगठन आगे आए हैं। जिस कारण शहर शिवमय हो गया है। नगर पालिका अध्यक्ष प्रिंस राठौर ने आधा दर्जन से अधिक यात्री बस को भक्तों की सेवा में लगाया है। बुधवार को कुबेरेश्वर धाम महादेव के दर्शन करने के लिए 2 किमी लंबी लाइनें लगी हैं। महोत्सव में मध्यप्रदेश के अलावा हरियाणा, राजस्थान, दिल्ली, गुजरात, महाराष्ट्र सहित देश के अन्य राज्यों से भक्त आ रहे हैं।</p>', 3, 'uploads/images/202302/image_870x580_63edec38f2f1b.jpg', 'uploads/images/202302/image_870x_63edec390e3ae.jpg', 'uploads/images/202302/image_694x532_63edec391a690.jpg', 'uploads/images/202302/image_430x256_63edec392091f.jpg', 'uploads/images/202302/image_140x98_63edec3923445.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-16 14:15:33'),
(39, 1, 'सुसाइड करने वाले IIT स्टूडेंट के परिवार का आरोप - भेदभाव हुआ ; कहा- जाति पर प्रताड़ित करते थे साथी', 'family-of-iit-student-who-committed-suicide-alleges-discrimination-said-friends-used-to-harass-on-caste', NULL, NULL, 'IIT बॉम्बे के स्टूडेंट दर्शन सोलंकी के सुसाइड करने के तीन दिन बाद उसकी बहन और चाची ने उसके दोस्तों पर आरोप लगाया है। उन्होंने कहा- दर्शन ने बताया था कि उसके दोस्त उसके साथ जातिगत भेदभाव करते थे।', '<p>मुंबई: IIT बॉम्बे के स्टूडेंट दर्शन सोलंकी के सुसाइड करने के तीन दिन बाद उसकी बहन और चाची ने उसके दोस्तों पर आरोप लगाया है। उन्होंने कहा- दर्शन ने बताया था कि उसके दोस्त उसके साथ जातिगत भेदभाव करते थे। हालांकि IIT बॉम्बे की अथॉरिटी ने कहा कि कैंपस में किसी भी तरह का भेदभाव नहीं किया जाता।</p>\r\n<p>दर्शन की बहन जाह्नवी सोलंकी ने कहा कि जब वह पिछले महीने वह घर आया था तो उसने मुझे और माता-पिता को बताया था कि उसे प्रताड़ित किया जा रहा है। उसके दोस्तों को जब से पता चला है कि वह अनुसूचित जाति का है, उनका व्यवहार बदल गया है। इतना ही नहीं दोस्तों ने दर्शन से बात करना और साथ रहना भी बंद कर दिया था। वह इन सब से परेशान था। इसलिए उसने ऐसा कदम उठाया।</p>\r\n<p>बहन और चाची के मुताबिक, दर्शन कहता था कि कई स्टूडेंट्स को यह पसंद नहीं है मैं फ्री में पढ़ रहा हूं। लोग मुझसे जलते हैं। वे कहते हैं कि हम लोग पैसे देते हैं तो तुम मुफ्त में क्यों पढ़ रहे हो। उन लोगों ने मेरी कई दोस्तों से बात भी बंद करवा दी थी।</p>\r\n<p>दर्शन के पिता रमेशभाई सोलंकी ने कहा कि घटना के कुछ घंटे पहले उन्होंने अपने बेटे से बात की थी। उसने मुझसे पूछा कि आप कैसे हैं। उसने मेरे बड़े भाई की बेटी को जन्मदिन की शुभकामना देने के लिए कहा। इसके बाद उसने कहा कि वह बाहर जाएगा तो मैंने उसे कुछ पैसे भी भेजे, लेकिन उसने कहा कि मेरे पास पैसे हैं, मुझे पैसे की जरूरत नहीं है। लेकिन फिर भी मैंने पैसे भेजे। मुझे नहीं पता था कि ऐसा कुछ हो जाएगा।</p>\r\n<p>18 साल के दर्शन सोलंकी ने रविवार सुबह 11:30 बजे कैंपस में बने हॉस्टल की सातवीं मंजिल से कूदकर आत्महत्या कर ली थी। वह गुजरात के अहमदाबाद का रहने वाला था। तीन महीने पहले ही IIT में बीटेक (केमिकल इंजिनियरिंग) की पढ़ाई के लिए उसका एडमिशन हुआ था। दर्शन 16B हॉस्टल की आठवीं मंजिल पर रहता था। रिपोर्ट्स के मुताबिक शनिवार को ही दर्शन की पहले सेमिस्टर की परीक्षा खत्म हुई थी।</p>\r\n<p>दर्शन के कूदने पर जोर से आवाज आई जिससे कुछ ही देर में दूसरे स्टूडेंट्स और सुरक्षाकर्मी मौके पर पहुंच गए। वह खून से लथपथ हो चुका था। छात्र को अस्पताल ले जाया गया, जहां डॉक्टरों ने उसे मृत घोषित कर दिया। मौत के बाद APPSC (अंबेडकर पेरियार फुले स्टडी सर्कल) IIT बॉम्बे नाम के संगठन ने सोशल मीडिया पर पोस्ट कर दलित स्टूडेंट्स के साथ परिसर में जातिगत भेदभाव का आरोप लगाया है।</p>\r\n<p>इस घटना के बाद APPSC ने अंग्रेजी में ट्वीट किया- हम एक 18 साल के दलित स्टूडेंट दर्शन सोलंकी के निधन पर शोक जताते हैं। उन्होंने 3 महीने पहले बीटेक के लिए IIT बॉम्बे में एडमिशन लिया था। हमें यह समझना चाहिए कि यह एक निजी मुद्दा नहीं, बल्कि हत्या है।</p>\r\n<p>एक अन्य ट्वीट में APPSC ने आरोप लगाया- हमारी शिकायतों के बावजूद संस्थान ने दलित, बहुजन आदिवासी छात्रों के लिए कैंपस को सुरक्षित बनाने की परवाह नहीं की। प्रथम वर्ष के छात्रों को आरक्षण विरोधी भावनाओं और गैर-योग्यता के ताने के मामले में सबसे अधिक उत्पीड़न का सामना करना पड़ता है।</p>', 4, 'uploads/images/202302/image_870x580_63edfe3b3f8b4.jpg', 'uploads/images/202302/image_870x_63edfe3b4b191.jpg', 'uploads/images/202302/image_694x532_63edfe3b53f43.jpg', 'uploads/images/202302/image_430x256_63edfe3b59739.jpg', 'uploads/images/202302/image_140x98_63edfe3b5b7b1.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-16 15:29:08'),
(40, 1, 'कार हटाने की बात पर विवाद, BJP नेता ने मेकअप आर्टिस्ट को मारा थप्पड़', 'controversy-over-car-removal-bjp-leader-slaps-make-up-artist', NULL, NULL, 'जबलपुर की एक मेकअप आर्टिस्ट ने भाजपा प्रदेश कार्यकारिणी के सदस्य पंडित राममूर्ति मिश्रा पर थप्पड़ मारने का  आरोप लगाया हैं। मेकअप आर्टिस्ट ख्याति चौहान ने भाजपा नेता के खिलाफ पुलिस में शिकायत भी दर्ज करवाई है।', '<p>जबलपुर: मैंने उनसे कहा, अंकल गाड़ी थोड़ा साइड कर लीजिए। वे मुझसे बदतमीजी करते रहे। मुझे सरेराह थप्पड़ मार दिया।... यह आरोप जबलपुर की एक मेकअप आर्टिस्ट ने भाजपा प्रदेश कार्यकारिणी के सदस्य पंडित राममूर्ति मिश्रा पर लगाए हैं। मेकअप आर्टिस्ट ख्याति चौहान ने भाजपा नेता के खिलाफ पुलिस में शिकायत भी दर्ज करवाई है। भाजपा नेता और महिला के विवाद का एक VIDEO भी सामने आया है। महिला का कहना है कि पीएम मोदी को भी शिकायत की है। ख्याति चौहान के पति सेना में मेजर हैं। घटना गुरुवार को जबलपुर के रामपुर में हुई है।</p>\r\n<p>कोई ना कोई गाड़ी खड़ा कर देता है तो हम हॉर्न बजाते हैं। फिर वो गाड़ी अलग कर लेते हैं। आज भी मैं हॉर्न बजा रही थी। 5 मिनट तक लगातार हॉर्न बजाती रही। सामने खड़ी गाड़ी की लाइट जल रही थी, मुझे लगा कि गाड़ी छोड़कर कोई चला गया होगा। मैंने दुकान वालों से पूछा, लेकिन उन्होंने कहा- हमारे यहां कोई नहीं आया। मैंने 5 मिनट इंतजार किया। थोड़ी देर बाद उसमें से बुजुर्ग से आदमी निकलते हैं। मैंने उन्हें इशारा किया कि मेरा घर है, मुझे उधर जाना है। 10 मिनट तक वेट किया। मुझे लगा अब वो गाड़ी अलग करेंगे, लेकिन वो नहीं उतरे। मुझे लगा उनके आगे कोई दूसरी गाड़ी खड़ी है, इसलिए वो साइड नहीं हो पा रहे। थोड़ी देर रुकने के बाद मैं ही गाड़ी से उतरी। उन्होंने तुरंत अपनी कार आगे बढ़ा दी। जैसे वो मेरा ही वेट कर रहे थे कि मैं उतरकर उनसे रिक्वेस्ट करूं। मैंने कहा- अंकल आपको सुनाई नहीं दे रहा, मैं 10 मिनट से हॉर्न बजा रही हूं। उन्होंने इशारा किया कि जैसे सुनाई नहीं दे रहा है। मैंने कहा- अंकल जैसे मैंने अभी बोला वो आपको सुनाई दे गया? उन्होंने फिर नहीं सुनने का इशारा किया। मैंने कहा- मैं आपकी गाड़ी पंक्चर कर दूं तो आपको सुनाई देगा? मेरे घर के बगल में पंक्चर की दुकान है। मैंने दुकानवाले से गाड़ी पंक्चर करने के लिए कहा। इसके बाद अंकल बदतमीजी करने लगे, बोले- तू करके दिखा पंक्चर। तू कौन है बे, सुन बे, तू समझती क्या है अपने आपको...और थप्पड़ मार दिया।</p>\r\n<p>मेकअप आर्टिस्ट ख्याति चौहान का कहना है कि मुझे सबके सामने अपमानित किया गया। अंकल ने अपनी गाड़ी मेरे घर के सामने खड़ी कर रखी थी। मैं बार-बार हार्न बजा रही थी, लेकिन अंकल ने गाड़ी आगे नहीं की। उन्होंने मुझते अभद्रता की, मुझे थप्पड़ भी मारा। अगर वह मुझसे सबके सामने माफी मांग लेते तो मैं उन्हें माफ भी कर देती और थाने भी नहीं जाती, लेकिन उन्होंने ऐसा कुछ भी नहीं किया। इसलिए मजबूर होकर मैं थाने गई और फिर वहां पर अपनी शिकायत दर्ज करवाई। भाजपा नेता को भी सार्वजनिक रूप से माफी मांगना चाहिए। वहीं इस मामले में भाजपा नेता का कहना है कि मैंने किसी तरह की गलती नहीं की है। माफी मांगने का तो कोई सवाल ही नहीं उठता।</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63ee073e7e85a.jpg\" alt=\"\"></p>\r\n<p>विवाद के दौरान मेकअप आर्टिस्ट ख्याति चौहान ने मोबाइल से भाजपा नेता राममूर्ति मिश्रा का VIDEO बनाया। भाजपा नेता ने भी ख्याति का वीडियो बनाया है। ख्याति ने VIDEO सोशल मीडिया पर अपलोड कर दिया। CSP प्रतिष्ठा सिंह राठौर ने बताया कि मेकअप आर्टिस्ट ने भाजपा नेता पंडित राममूर्ति मिश्रा के खिलाफ शिकायत गोरखपुर थाने में दर्ज कराई है। पुलिस इस पूरे मामले की जांच कर रही है।</p>\r\n<p>भाजपा प्रदेश कार्यकारिणी के सदस्य पंडित राममूर्ति मिश्रा का कहना है कि महिला ने जैसे ही अपनी गाड़ी का हॉर्न बजाया तो मैंने अपनी गाड़ी आगे कर ली थी। उसके बाद महिला ने अपने घर जाकर गाड़ी खड़ी की और फिर मुझसे लड़ने आ गई। मैंने महिला को थप्पड़ नहीं मारा है, और ना ही मैंने उससे अभद्रता की है। मैं एक नेता हूं, मेरे ऊपर आरोप लगाने वाले तमाम लोग हैं, लेकिन मैंने किसी भी तरह से उसके साथ अभद्रता नहीं की है। अगर महिला ने थाने में शिकायत दर्ज करवाई है तो हमने भी अपनी शिकायत पुलिस को दी है। महिला बोल रही थी कि मैं उससे माफी मांग लूँ , लेकिन जब मैंने किसी भी तरह की गलती नहीं की है तो मैं माफी नहीं मांगूंगा।</p>\r\n<p>जबलपुर में GRC मेस के सामने शरद चौहान का घर है। उनकी मेकअप आर्टिस्ट बेटी ख्याति चौहान उमेदपुर से इन दिनों जबलपुर आई हुई हैं। ख्याति के पति तन्मय अग्रवाल सेना में मेजर के पद पर हैं। गुरुवार शाम को वह कार से बाजार गई थी। बाजार से घर लौटने के दौरान ये पूरा विवाद हुआ।</p>', 4, 'uploads/images/202302/image_870x580_63ee07ab5af78.jpg', 'uploads/images/202302/image_870x_63ee07ab66f2a.jpg', 'uploads/images/202302/image_694x532_63ee07ab73273.jpg', 'uploads/images/202302/image_430x256_63ee07ab783f4.jpg', 'uploads/images/202302/image_140x98_63ee07ab7a1f9.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-16 16:10:02'),
(41, 1, 'जीनत को याद आई 1977 की ये तस्वीर, राज कपूर को लेकर किया बड़ा खुलासा', 'zeenat-remembered-this-picture-of-1977-made-a-big-disclosure-about-raj-kapoor', NULL, NULL, 'साल 1978 में आई राज कपूर के निर्देशन में बनी फिल्म सत्यम शिवम सुंदरम पर अश्लील होने के आरोप लगाए गए थे. फिल्म में जीनत अमान लीड रोल में दिखाई दी थीं और रूपा के उनके किरदार को काफी बोल्ड दिखाया गया था. अब सालों बाद जीनत अमान ने उन आरोपों पर खुद जवाब दिया है.', '<p>साल 1978 में आई राज कपूर के निर्देशन में बनी फिल्म सत्यम शिवम सुंदरम पर उस दौर में खूब छींटाकशी की गई थी. फिल्म पर अश्लील होने के आरोप लगाए गए थे. फिल्म में जीनत अमान लीड रोल में दिखाई दी थीं और रूपा के उनके किरदार को काफी बोल्ड दिखाया गया था. अब सालों बाद जीनत अमान ने उन आरोपों पर खुद जवाब दिया है. साथ ही उन्होंने फिल्म के लिए कराए गए फोटोशूट की एक तस्वीर भी शेयर की है.</p>\r\n<p>जीनत अमान ने हाल ही में सोशल मीडिया प्लेटफॉर्म इंस्टाग्राम पर डेब्यू किया है. 71 साल की उम्र में इंस्टा डेब्यू करने वाली वो शायद पहली अभिनेत्री हैं. इंस्टा पर आने के बाद से जीनत लगातार एक्टिव हैं. गुरुवार को उन्होंने फिल्म सत्यम शिवम सुंदरम से जुड़ी कुछ यादा ताज़ा की और विवाद पर अपनी बात भी रखी. जीनत अमान ने पोस्ट में कहा कि इंसान की शरीर में उन्हें कुछ भी अश्लील नहीं दिखता.</p>\r\n<p>पोस्ट लिखने के साथ जीनत ने एक तस्वीर शेयर की है. उन्होंने लिखा, &ldquo;सत्यम शिवम सुंदरम के दौरान लुक टेस्ट के लिए ये तस्वीर 1977 में जेपी सिंघल ने ली थी. हमने आरके स्टूडियोज़ में सीरीज़ शूट किया था और मेरे कॉस्ट्यूम्स को ऑस्कर विजेता भानु अथैया ने डिजाइन किया था.&rdquo;</p>\r\n<p>पोस्ट में अश्लीलता के आरोपों पर जीनत अमान ने कहा, &ldquo;सत्यम शिवम सुंदरम में मेरे कैरेक्टर रूपा को लेकर काफी हो हल्ला और विवाद हुआ था. मैं अश्लीलता के आरोपों से हमेशा ही हैरान रही क्योंकि मैंने वैसा कुछ नहीं किया और मुझे इंसानी शरीर में कभी अश्लीलता नहीं दिखी. मैं डायरेक्टर की एक्टर हूं और ये लुक्स मेरे काम का हिस्सा थे. रूपा की सेंसुआलिटी कहानी का लब्बोलुआब नहीं थी, बल्कि उसका सिर्फ हिस्सा थी.&rdquo;<br>जीनत अमान ने आगे लिखा, &ldquo;सेट कोई ऐसी जगह नहीं है जो सेंशुअल हो. हर हरकत की कोरियाग्राफी की जाती है, रिहर्सल किया जाता फिर दर्जनों क्रू मेंबर्स के सामने परफॉर्म किया जाता है.&rdquo; जीनत ने बताया कि फिल्म में लेने से पहले राजकपूर फिक्रमंद थे, क्योंकि पहले उनकी इमेज वेस्टर्न टाइप थी. वो असमंजस में थे कि दर्शक उन्हें इस रोल में अपना सकेंगे या नहीं. हालांकि बाद में उन्होंने छोटा सा शूट किया और स्क्रीनिंग रखकर डिस्ट्रीब्यूटर्स का रिस्पॉन्स लेने के लिए दिखाया गया. स्क्रीनिंग के बाद हर क्षेत्र के राइट्स उसी वक्त बिक गए थे.</p>', 6, 'uploads/images/202302/image_870x580_63ee10484c1b0.jpg', 'uploads/images/202302/image_870x_63ee104857c7b.jpg', 'uploads/images/202302/image_694x532_63ee104861174.jpg', 'uploads/images/202302/image_430x256_63ee104865ba9.jpg', 'uploads/images/202302/image_140x98_63ee104868180.jpg', 'jpg', 'local', NULL, 2, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-16 16:45:28'),
(42, 1, 'ओडिशा में BJP नेता  ने महिला इंस्पेक्टर को मारा धक्का, इंस्पेक्टर ने कहा- जयनारायण ने मुझ पर रिश्वत का आरोप लगाया', 'in-odisha-a-bjp-leader-pushed-a-woman-inspector-the-inspector-said-jayanarayan-accused-me-of-bribery', NULL, NULL, 'भाजपा कार्यकर्ता बुधवार को जिला कलेक्टर के परिसर के बाहर प्रदर्शन कर रहे थे। इस दौरान उनके और महिला इंस्पेक्टर के बीच कहासुनी हो गई थी। बाहर प्रदर्शन कर रहे राज्य के नेता विपक्ष जयनारायण मिश्रा ने महिला पुलिस इंस्पेक्टर को धक्का दे दिया। इस विवाद का वीडियो भी वायरल हो रहा है।', '<p>ओडिशा के संबलपुर में राज्य की बदहाल कानून व्यवस्था के विरोध में कलेक्टर के कार्यालय के बाहर प्रदर्शन कर रहे राज्य के नेता विपक्ष जयनारायण मिश्रा ने महिला पुलिस इंस्पेक्टर को धक्का दे दिया। इस विवाद का वीडियो भी वायरल हो रहा है। घटना के बाद दोनों पक्षों की तरफ से शिकायत दर्ज कराई गई है।</p>\r\n<p>इंस्पेक्टर प्रधान ने बताया- जब भाजपा कार्यकर्ता कलेक्टर के परिसर में घुसने की कोशिश कर रहे थे, तब मैंने कार्यकर्ताओं को रोकने की कोशिश की। इस दौरान जयनारायण मेरे सामने आए और पूछने लगे की मैं कौन हूं। जब मैंने अपनी पहचान बताई तो उन्होंने मुझ पर रिश्वत लेने का आरोप लगाया और मुझे डकैत कहा। मैंने जयनारायण से पूछा की वह मुझ पर ऐसे आरोप क्यों लगा रहे हैं तो उन्होंने मेरा चेहरा पकड़ कर धक्का दे दिया।</p>\r\n<p>भाजपा विधायक और विधानसभा में नेता विपक्ष जयनारायण मिश्रा ने अपने ऊपर लगे आरोप को खारिज कर दिया। उन्होंने कहा, जब महिला पुलिस भाजपा महिला कार्यकर्ताओं के साथ दुर्व्यवहार कर रही थी, तो मैं पुलिस के पास यह पूछने गया कि मामला क्या है। तभी उनमें से एक ने मेरे पैर पर मार दिया। जब मैंने बैरिकेड ही पार नहीं किए तो इंस्पेक्टर को धक्का कैसे दे सकता हूं। इंस्पेक्टर ने मुझसे कहा कि मैं पुलिस के खिलाफ नारेबाजी कर रहा था और उन्होंने मुझे धक्का दे दिया।</p>\r\n<p>संबलपुर SP बी गंगाधर ने कहा कि उन्होंने घटना की फील्ड रिपोर्ट मांगी है और मामले की जांच की जाएगी। हालांकि, ओडिशा पुलिस सर्विस एसोसिएशन ने मिश्रा के खिलाफ कार्रवाई की मांग करते हुए DIG से बात की है।</p>\r\n<p>भाजपा प्रवक्ता ललितेंदु विद्याधर ने कहा कि झारसुगुडा जिले में एक पुलिसकर्मी ने मंत्री की कथित तौर पर हत्या कर दी। अब एक महिला पुलिस अधिकारी विपक्ष के नेता को परेशान कर रही है। ओडिशा में कानून का कोई शासन नहीं है। हम इस पर मुख्यमंत्री की कार्रवाई का इंतजार कर रहे हैं। उन्होंने कहा कि सत्तारूढ़ पार्टी मिश्रा से डरती है, क्योंकि वह 21 फरवरी से शुरू हो रहे विधानसभा सत्र में कानून व्यवस्था का मुद्दा उठा रहे हैं।</p>\r\n<p>राज्य की सत्ताधारी पार्टी बीजू जनता दल (BJD) प्रवक्ता श्रीमयी मिश्रा ने कहा कि जयनारायण मिश्रा आदतन अपराधी है। उनके खिलाफ हत्या सहित 14 मामले दर्ज हैं, जिसके कारण वह जेल भी जा चुके हैं। वह लोगों को धमकाने और मारपीट करने के लिए जाने जाते हैं।</p>', 4, 'uploads/images/202302/image_870x580_63ee1e4e01fb4.jpg', 'uploads/images/202302/image_870x_63ee1e4e10f39.jpg', 'uploads/images/202302/image_694x532_63ee1e4e1bebc.jpg', 'uploads/images/202302/image_430x256_63ee1e4e22698.jpg', 'uploads/images/202302/image_140x98_63ee1e4e24ecd.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-16 17:46:07'),
(43, 1, 'उदयपुर में परिवार से बिछड़ा मासूम ; सरकारी हॉस्पिटल से  11 दिन का बच्चा चोरी', 'innocent-separated-from-family-in-udaipur-11-day-old-baby-stolen-from-government-hospital', NULL, NULL, 'उदयपुर के MB (महाराणा भूपाल) हॉस्पिटल से गुरुवार सुबह 11 दिन का बच्चा चोरी हो गया। बच्चा चोरी करने का आरोप एक महिला पर लगा है।', '<p>उदयपुर के MB (महाराणा भूपाल) हॉस्पिटल से गुरुवार सुबह 11 दिन का बच्चा चोरी हो गया। बच्चा चोरी करने का आरोप एक महिला पर लगा है। वह पीड़ित परिवार के साथ रातभर हॉस्पिटल की पार्किंग में रही थी। मेल-जोल उसने इतना बढ़ा लिया कि बच्चे की मां भी उस पर भरोसा करने लगी थी। मौका मिलते ही वह नवजात को लेकर फरार हो गई।</p>\r\n<p>उदयपुर शहर के भटेवर निवासी कमला देवी (26) पति राजू भील (28) ने 10 दिन पहले बेटे को जन्म दिया था। सर्जरी करके MB हॉस्पिटल के डॉक्टरों ने डिलीवरी कराई थी। 15 फरवरी की शाम करीब 5 बच्चे इन्हें डिस्चार्ज कर दिया गया था। बच्चे की मां के साथ उसका पिता, बुआ और दादी भी हॉस्पिटल में थे। परिवार रात को हॉस्पिटल की पार्किंग में ही रुक गया। राजू भील ने सोचा था कि सुबह बर्थ सर्टिफिकेट बनवाने की औपचारिकता पूरी करते हुए घर जाएंगे। पार्किंग में पहले से ही काफी लोग थे। उसी में एक महिला भी थी। वह बिना किसी मतलब के ही राजू के परिवार से मेल-जोल बढ़ाती रही।</p>\r\n<p>गुरुवार सुबह कमला अपने बच्चे को साथ लेकर लेटी थी। इस दौरान उसके पास कोई नहीं था। सुबह करीब 9 बजे महिला बच्चे की मां के पास आकर बोली, तुम्हारा पति और सास प्रमाण पत्र बनवा रहे हैं। वे बच्चे को फोटो लेने के लिए मंगा रहे हैं।</p>\r\n<p>इतने में उस अज्ञात महिला ने मां के पास लेटे मासूम को वहां से उठा लिया और लेकर फरार हो गई। बाद में राजू आया तो उसके होश उड़ गए। इधर, मां को सच्चाई पता लगी तो वह बेसुध हो गई। हो-हल्ला सुनकर पार्किंग में काफी संख्या में लोग जमा हो गए। कमला का एक 7 साल का बेटा पहले से ही है।</p>\r\n<p>ये फोटो हॉस्पिटल की पार्किंग की है। यहीं से कमला के गोद से नवजात को लेकर अनजान महिला चली गई। पूरी रात पीड़ित परिवार इसी पार्किंग में सो रहा था।<br>ये फोटो हॉस्पिटल की पार्किंग की है। यहीं से कमला के गोद से नवजात को लेकर अनजान महिला चली गई। पूरी रात पीड़ित परिवार इसी पार्किंग में सो रहा था।<br>पति बोला, मेरे नंबर लिया और मैसेज कर रही थी।</p>\r\n<p>राजू भील ने बताया कि चोरी करने वाली महिला रात को हमारे पास घूम रही थी। उसने मेरा नंबर लिया और रात को मोबाइल पर बार-बार मैसेज कर रही थी। मैसेज कर बताया कि वह विधवा है और अकेली रहती है। लकड़ी के टाल पर काम करती है। पति ने बताया कि इसके बाद वह परिवार से बात करने लगी और हमें विश्वास में ले लिया। सुबह बहला-फुसलाकर बच्चा चुरा ले गई।</p>\r\n<p><br>हाथीपोल थानाधिकारी योगेश कुमार ने बताया कि संदिग्ध महिला धोखे से बच्चा चुरा ले गई। हम सीसीटीवी चेक करवा रहे हैं। सभी जगह वॉट्सऐप पर मैसेज भी करवा दिया है। पुलिस फोर्स को बस स्टैंड और रेलवे स्टेशन पर लगा दिया है। हॉस्पिटल के सीसीटीवी में आरोपी महिला पीड़ित परिवार के साथ बैठी हुई दिख रही है।</p>', 4, 'uploads/images/202302/image_870x580_63ee247ac2959.jpg', 'uploads/images/202302/image_870x_63ee247ad418e.jpg', 'uploads/images/202302/image_694x532_63ee247ae1195.jpg', 'uploads/images/202302/image_430x256_63ee247ae75e5.jpg', 'uploads/images/202302/image_140x98_63ee247ae9dfa.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-16 18:11:47'),
(44, 1, 'रुद्राक्ष महोत्सव में लोगों को हो रही  परेशानी को देखते हुए रुद्राक्ष वितरण रोका, प्रशासन की व्यवस्था पर सवाल', 'rudraksh-distribution-stopped-in-view-of-the-problems-people-are-facing-in-rudraksh-festival-questions-on-the-arrangement-of-administration', NULL, NULL, 'मध्यप्रदेश में कथावाचक पंडित प्रदीप मिश्रा के सीहोर स्थित कुबेरेश्वर धाम में आयोजित रुद्राक्ष महोत्सव का शुक्रवार को दूसरा दिन है। लाखों की संख्या में श्रद्धालु सुबह से ही रुद्राक्ष के लिए लाइन में लगे हैं। हालांकि, फिलहाल रुद्राक्ष का वितरण रोक दिया गया है।', '<p>सीहोर: मध्यप्रदेश में कथावाचक पंडित प्रदीप मिश्रा के सीहोर स्थित कुबेरेश्वर धाम में आयोजित रुद्राक्ष महोत्सव का शुक्रवार को दूसरा दिन है। लाखों की संख्या में श्रद्धालु सुबह से ही रुद्राक्ष के लिए लाइन में लगे हैं। हालांकि, फिलहाल रुद्राक्ष का वितरण रोक दिया गया है। आयोजन के पहले दिन भारी अव्यवस्थाओं का आलम दिखा।</p>\r\n<p>रुद्राक्ष की आस में दिनभर लोग लाइन में लगे रहे, लेकिन रुद्राक्ष नसीब नहीं हो पाया। रातभर भक्तों की आवाजाही लगी रही। शुक्रवार सुबह से ही धाम पर फिर से रुद्राक्ष लेने वाले लाइन में लग गए। भीड़ इतनी कि पैर रखने तक की जगह नहीं है। हालात यह हैं कि लाखों लोग आयोजन स्थल पर मौजूद हैं। हालांकि कल से उलट आज इंदौर-भोपाल हाईवे पर ट्रैफिक जाम के हालात नहीं हैं।</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63ef275b2643c.jpg\" alt=\"\"></p>\r\n<p>कुबेरेश्वर धाम और आसपास अभी करीब डेढ़ लाख लोग मौजूद हैं। बीते 2 दिनों में लगभग 5 लाख रुद्राक्ष बांटे गए हैं। गुरुवार को भोपाल-इंदौर रोड पर भारी जाम लगा था, लेकिन रात से सुबह तक पुलिस ने पूरा जाम खुलवा दिया है। भोपाल-इंदौर रोड पर और इंदौर रोड पर यातायात चल रहा है।</p>\r\n<p><br>श्रद्धालुओं का कहना है कि अभी महोत्सव में रुद्राक्ष नहीं बंट रहे हैं। बैरिकेटिंग टूटने के कारण समिति ने फिलहाल वितरण बंद करने का फैसला लिया है। अब बैरिकेटिंग सही होने के बाद ही दोबारा से रुद्राक्ष का वितरण शुरू किया जाएगा।भोपाल से सीहोर तक सड़क की दोनों ओर 15 किलोमीटर तक वाहनों की लंबी कतार दिख रही है। लेकिन भोपाल से सीहोर और भोपाल से आष्टा की ओर सड़क पर वाहनों की आवाजाही जारी है। हालांकि वाहन 10 से 20 किलोमीटर प्रति घंटे की रफ्तार से ही चल पा रहे हैं। इसकी वजह कुबेरेश्वर धाम जा रहे श्रद्धालुओं की भीड़ का सड़क पर होना है।</p>\r\n<p>गुरुवार को लगभग 20 से 25 लोग अपनों से बिछड़ गए थे। आज स्थिति नियंत्रण में है। गुरुवार को भारी भीड़ के कारण रुद्राक्ष वितरण केंद्र के पास लगे बैरिकेड्स टूट गए थे, जिसके कारण आज रुद्राक्ष वितरण नहीं किया जा रहा है।</p>\r\n<p><br>शुक्रवार को श्रद्धालुओं को संबोधित करते हुए पंडित प्रदीप मिश्रा ने कहा कि आप लोग यहां आए हैं, भगवान शंकर आप सब की मनोकामनाएं पूर्ण करें, मेरी यही विनती है। हमारे यहां 10 बजे से भोजन शुरू हो रहा है, 7 बजे तक चलता है, घबराने की आवश्यकता नहीं है। 22 कुओं का पानी यहां आ रहा है, लाइट चले जाने पर थोड़ी दिक्कत हो जाती है, इसके लिए माफी चाहता हूं।</p>\r\n<p>हेलो, हेलो... गीता, लक्ष्मी और रिंकू की मम्मी, भोपाल वाले । गेट नंबर 1 पर पुलिस सहायता केंद्र पर आ जाइए। हम लोग यहां आपका इंतजार कर रहे हैं। पूरी रात से खोज रहे हैं, लेकिन आप नहीं मिले। यह अनाउंसमेंट सीहोर के पंडित प्रदीप मिश्रा के कुबेरेश्वर आश्रम पर गुरुवार को शुरू हुए रुद्राक्ष महोत्सव एवं महाकुंभ कार्यक्रम स्थल पर हो रहा है। यह केवल एक अकेला अनाउंसमेंट नहीं है, इस तरह की घोषणाओं का सिलसिला गुरुवार रात 12:00 से लगातार जारी है। इसकी वजह रुद्राक्ष महोत्सव में श्रद्धालुओं की रिकॉर्ड तोड़ भीड़ होना है। महोत्सव में शामिल होने आए लाखों श्रद्धालु रुद्राक्ष मिलने की आस में शुक्रवार सुबह तक भी कुबेरेश्वर धाम परिसर में डेरा जमाए बैठे हैं।</p>\r\n<p>हैदराबाद से आई महिला भक्त ने कहा- इतनी अव्यवस्था होगी यह सोचा नहीं था। पीने का पानी तो छोड़िए बाथरूम में लॉक लगे थे। रुद्राक्ष फेंककर दिए तो बुजुर्ग समेत कई लोग दब गए। कोई पूजा वाले रुद्राक्षों को ऐसा फेंकता है क्या। पूरी पब्लिक परेशान है। मैं खुद चार दिन से परेशान हूं, फिर भी रुद्राक्ष नहीं मिला। जब 16 तारीख से रुद्राक्ष देने की बात कही थी, तो 15 तारीख को क्यों बांटना शुरू कर दिया। अब बिना रुद्राक्ष के लौट रहे हैं। पिछले साल भी महाराज जी ने ऐसा ही किया था। ऑटो वाले एक-एक व्यक्ति से 500-500 रुपए ले रहे हैं।</p>\r\n<p>एक भक्त ने कहा- कोई हादसा हो जाए, तो इसका जिम्मेदार कौन होगा। पंडित जी ने कहा था कि एक महीने का बच्चा आए, तो उसे भी रुद्राक्ष देंगे, कहां गया उनका यह किया हुआ वादा। पानी तक के लिए भटकते रहे। रुद्राक्ष तो छोड़िए पानी, खाने तक की व्यवस्था नहीं कर पाए।</p>\r\n<p>रायपुर छत्तीसगढ़ से आए आरके राठौड़ ने बताया दोपहर में पिता जीएल राठौड़ की तबीयत खराब है। मैं दवाइयां लेने कुबेरेश्वर धाम के स्वास्थ्य केंद्र पर आया था, लेकिन डॉक्टर मिला न दवाइयां। यही हाल अन्य बीमार श्रद्धालुओं का भी था। वो दिन से परेशान दिखे।</p>\r\n<p>पिछली बार हुई अव्यवस्थाओं से भी प्रशासन ने सबक नहीं लिया। इस साल भी हाईवे पर जाम के हालात बने हुए हैं। हाईवे पर वाहनों की कतारें लगी रहीं। लोगों को कई किलोमीटर तक पैदल चलना पड़ा। जाम से हो रही परेशानी का अंदाजा इसी बात से लगाया जा सकता है कि इस मार्ग से आ जा रहीं कई एम्बुलेंस भी फंस गईं।</p>', 3, 'uploads/images/202302/image_870x580_63ef2744c36c6.jpg', 'uploads/images/202302/image_870x_63ef2744d3ca9.jpg', 'uploads/images/202302/image_694x532_63ef2744defd2.jpg', 'uploads/images/202302/image_430x256_63ef2744e42ae.jpg', 'uploads/images/202302/image_140x98_63ef2744e6eea.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-17 12:36:18'),
(45, 1, 'उत्तर प्रदेश के कानपुर देहात में हुआ हादसा , फीस जमा नहीं हो पाई तो कॉलेज ने नहीं दिया प्रवेश पत्र, छात्रा ने जान दे दी', 'the-accident-happened-in-the-kanpur-countryside-of-uttar-pradesh-the-college-did-not-give-the-admit-card-if-the-fees-could-not-be-deposited-the-student-died', NULL, NULL, 'उत्तर प्रदेश के कानपुर देहात में एक और दिल दुखाने वाली घटना हुई। पिता ने फीस के जमा करने के लिए रुपये नहीं दे पाया तो परीक्षा से वंचित रह गई हाईस्कूल की छात्रा ने फांसी लगाकर जान दे दी। उधर, परिजनों का आरोप है कि कॉलेज प्रशासन ने फीस न जमा कर पाने की वजह से उसे प्रवेश पत्र नहीं दिया। हालांकि, कॉलेज प्रशासन का कहना है कि अगर छात्रा प्रवेश पत्र लेने आती तो उसे मना नहीं किया जाता। डीआईओएस मामले की जांच करा रहे हैं।', '<p>उत्तर प्रदेश के कानपुर देहात में एक और दिल दुखाने वाली घटना हुई। पिता ने फीस के जमा करने के लिए रुपये नहीं दे पाया तो परीक्षा से वंचित रह गई हाईस्कूल की छात्रा ने फांसी लगाकर जान दे दी। उधर, परिजनों का आरोप है कि कॉलेज प्रशासन ने फीस न जमा कर पाने की वजह से उसे प्रवेश पत्र नहीं दिया। हालांकि, कॉलेज प्रशासन का कहना है कि अगर छात्रा प्रवेश पत्र लेने आती तो उसे मना नहीं किया जाता। डीआईओएस मामले की जांच करा रहे हैं।</p>\r\n<p>डेरापुर के अगवासी गांव में श्रीपाल मजदूरी करके परिवार का पालन-पोषण करते हैं। उनकी बेटी साक्षी (15) अन्नपूर्णा इंटर कॉलेज कांधी में हाईस्कूल की छात्रा थी। साक्षी की मां की मौत दस साल पहले हो गई थी। घर का काम करने के साथ वह पढ़ाई भी करती थी। पिता मजदूरी करते हैं। वह कई माह से उसे फीस नहीं दे पा रहे थे। इससे साक्षी परीक्षा में शामिल होने को लेकर परेशान रहती थी। उसने पिता से पैसों का इंतजाम करने के लिए कहा तो उन्होंने व्यवस्था न हो पाने की बात कहकर मना कर दिया। इससे आहत होकर साक्षी ने गुरुवार को कमरे के अंदर फांसी लगाकर जान दे दी। मृतका के चाचा देशराज ने पुलिस को सूचना दी। मौके पर पहुंची पुलिस ने छानबीन के बाद शव पोस्टमॉर्टम के लिए भेज दिया।छात्रा के पिता श्रीपाल और चाचा देशराज ने बताया कि घर की आर्थिक स्थित ठीक न होने से फीस नहीं दे पा रहे थे, लेकिन साक्षी से कहा था कि वह कॉलेज जाकर प्रवेश पत्र लेकर परीक्षा में बैठे। आगे पूरी फीस जमा कर देंगे। परिजनों का आरोप है कि कॉलेज प्रशासन फीस न जमा कर पाने की वजह से प्रवेश पत्र नहीं दे रहा था। छात्रा दो बार प्रवेश पत्र लेने कॉलेज गई, लेकिन वहां से बैरंग वापस कर दिया गया। इससे वह परेशान हो गई थी।अन्नपूर्णा इंटर कॉलेज कांधी के प्रिंसपल पंकज तिवारी ने कहा कि साक्षी की फीस जुलाई में जमा हुई थी। इसके बाद कोई फीस जमा नहीं की गई। इसके बावजूद उसे कभी कॉलेज आने से नहीं रोका गया। कहा कि वह 15 दिन से कॉलेज नहीं आ रही थी और प्रवेश पत्र लेने भी नहीं आई थी। कहा कि अगर प्रवेश पत्र लेने आती तो जरूर दिया जाता। फिलहाल परिजन फीस न जमा कर पाने पर प्रवेश पत्र न देने का आरोप कॉलेज प्रशासन पर लगा रहे हैं।डीआईओएस अचल कुमार मिश्रा ने कहा कि इस प्रकरण की जानकारी उन्हें नहीं है। छात्रा और उसके परिजनों की तरफ से ऐसी कोई शिकायत भी नहीं की गई है। एक कॉलेज में छात्रा को प्रवेश पत्र न दिए जाने की जानकारी एसडीएम के माध्यम से मिली थी तो तत्काल कॉलेज संचालक से प्रवेश पत्र दिलाया गया था, अगर ये मामला भी जानकारी में आता तो छात्रा को जरूर प्रवेश पत्र दिलाया जाता। फीस न होने पर परीक्षा से वंचित नहीं किया जा सकता है। मामले की जांच कराकर कार्रवाई की जाएगी।</p>', 4, 'uploads/images/202302/image_870x580_63ef49ebb6178.jpg', 'uploads/images/202302/image_870x_63ef49fd79b8b.jpg', 'uploads/images/202302/image_694x532_63ef49ff7efa4.jpg', 'uploads/images/202302/image_430x256_63ef49ffb0a61.jpg', 'uploads/images/202302/image_140x98_63ef4a000c05b.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-17 15:07:51'),
(46, 1, '21 फरवरी तक टला शिवसेना विवाद पर फैसला, पिछली सुनवाई में कहा था- राज्यपाल को राजनीति में नहीं पड़ना चाहिए', 'decision-on-shiv-sena-dispute-postponed-till-february-21-said-in-the-last-hearing-–-governor-should-not-get-into-politics', NULL, NULL, 'सुप्रीम कोर्ट ने महाराष्ट्र में शिवसेना बनाम शिंदे गुट विवाद पर फैसला 21 फरवरी तक टाल दिया है। बेंच ने कहा, \'नबाम रेबिया के सिद्धांत इस मामले में लागू होते हैं या नहीं, केस को 7 जजों की बेंच को भेजा जाना चाहिए या नहीं, ये मौजूदा केस के गुण-दोष के आधार पर तय किया जा सकता है।', '<p>महाराष्ट्र: सुप्रीम कोर्ट ने महाराष्ट्र में शिवसेना बनाम शिंदे गुट विवाद पर फैसला 21 फरवरी तक टाल दिया है। बेंच ने कहा, \'नबाम रेबिया के सिद्धांत इस मामले में लागू होते हैं या नहीं, केस को 7 जजों की बेंच को भेजा जाना चाहिए या नहीं, ये मौजूदा केस के गुण-दोष के आधार पर तय किया जा सकता है। इसे मंगलवार को सुनेंगे।\'</p>\r\n<p>CJI की अध्यक्षता वाली पांच जजों की पीठ इस केस को 7 जजों की बेंच को रेफर करने का फैसला एक दिन पहले सुरक्षित रख लिया था। बेंच में जस्टिस एमआर शाह, जस्टिस कृष्ण मुरारी, जस्टिस हेमा कोहली और जस्टिस पीएस नरसिम्हा समेत CJI डीवाय चंद्रचूड़ भी शामिल थे।</p>\r\n<p>पिछली सुनवाई में कोर्ट ने राज्यपाल भगत सिंह कोश्यारी को फटकार लगाई थी। CJI ने कहा कि सरकार बनाने की प्रक्रिया में राज्यपाल को राजनीति से दूर रहना चाहिए। कोई भी धड़ा यदि सरकार बनाने का दावा करता है तो राज्यपाल को सदन में विश्वास मत सुनिश्चित करना चाहिए।</p>\r\n<p>महाराष्ट्र में जून 2022 में CM एकनाथ शिंदे और उनके समर्थक विधायकों को उद्धव ठाकरे गुट ने अयोग्य ठहराने की मांग की थी। हालांकि, ठाकरे गुट की मांग से पहले ही शिंदे गुट की ओर से डिप्टी स्पीकर सीताराम जिरवाल को हटाने का नोटिस लंबित था।</p>\r\n<p>अरुणाचल प्रदेश के 2016 के नबाम रेबिया मामले में सुप्रीम कोर्ट ने आदेश दिया था कि यदि स्पीकर को हटाने की याचिका लंबित हो तो स्पीकर विधायकों की अयोग्यता प्रक्रिया को आगे नहीं बढ़ सकते।</p>', 4, 'uploads/images/202302/image_870x580_63ef4ad392458.jpg', 'uploads/images/202302/image_870x_63ef4ad3a175a.jpg', 'uploads/images/202302/image_694x532_63ef4ad3adc59.jpg', 'uploads/images/202302/image_430x256_63ef4ad3b3cd9.jpg', 'uploads/images/202302/image_140x98_63ef4ad3b5e23.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 3, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-17 15:28:02'),
(47, 1, 'भागते-भागते थक गया कपल ,तो कानपुर के थाने में किया सरेंडर', 'couple-got-tired-of-running-then-surrendered-in-kanpur-police-station', NULL, NULL, 'मध्य प्रदेश के रहने वाले एक प्रेमी जोड़े ने उत्तर प्रदेश के कानपुर में थाने में सरेंडर किया है। दोनों परिवार की मर्जी के खिलाफ शादी करना चाहते थे लेकिन यह नहीं हो पाया तो घर से भाग निकले। लड़की के परिजन ने लड़के के खिलाफ एमपी में अपहरण का मुकदमा दर्ज करा दिया था, जिसके बाद से पुलिस दोनों की तलाश कर रही थी। कपल को जब इस बारे में जानकारी मिली तो उन्होंने कानपुर थाने में सरेंडर कर दिया। कानपुर पुलिस ने दोनों को मध्य प्रदेश पुलिस के हवाले कर दिया है।', '<p>&nbsp;मध्य प्रदेश के रहने वाले एक प्रेमी जोड़े ने उत्तर प्रदेश के कानपुर में थाने में सरेंडर किया है। दोनों परिवार की मर्जी के खिलाफ शादी करना चाहते थे लेकिन यह नहीं हो पाया तो घर से भाग निकले। लड़की के परिजन ने लड़के के खिलाफ एमपी में अपहरण का मुकदमा दर्ज करा दिया था, जिसके बाद से पुलिस दोनों की तलाश कर रही थी। कपल को जब इस बारे में जानकारी मिली तो उन्होंने कानपुर थाने में सरेंडर कर दिया। कानपुर पुलिस ने दोनों को मध्य प्रदेश पुलिस के हवाले कर दिया है।</p>\r\n<p>जानकारी के मुताबिक, मध्य प्रदेश के दतिया की रहने वाली नौशीन को ग्वालियर के रहने वाले फारुख से प्यार हो गया। दोनों कई साल से एक-दूसरे के प्रेम में थे और शादी करने की इच्छा रखते थे लेकिन दोनों के परिवार को यह रिश्ता मंजूर नहीं था। ऐसे में 6 महीने पहले दोनों अपने घर से भाग गए और जयपुर पहुंचे। इसके बाद दतिया में नौशीन के परिवार ने फारुख पर अपहरण का केस दर्ज करा दिया। पुलिस दोनों की तलाश करने लगी।<br>इधर, घर से भागे प्रेमी युगल के पास जब घर से लाए पैसे खत्म हो गए और उनके जयपुर में होने की सूचना पुलिस को मिल गई, तब वे वहां से भागकर कानपुर आ गए। यहां वे अपने एक रिश्तेदार के यहां ठहरने के लिए गए लेकिन दोनों की सच्चाई जानकर रिश्तेदार ने दोनों को अपने यहां रुकने से मना कर दिया। दोनों तीन दिनों तक कैंट में एक पुल के नीचे रुके। दोनों ने अपने घर फोन किया तो पता चला कि पुलिस उन्हें ढूंढते हुए कानपुर पहुंच गई है। यह जानकर दोनों ने कानपुर के जाजमऊ थाने में सरेंडर कर दिया। वहां से दोनों को दतिया पुलिस को सौंप दिया गया है। नौशीन ने उन्हें कोर्ट में पेश करने की मांग की है।</p>', 4, 'uploads/images/202302/image_870x580_63ef61adb464b.jpg', 'uploads/images/202302/image_870x_63ef61adc655b.jpg', 'uploads/images/202302/image_694x532_63ef61add4629.jpg', 'uploads/images/202302/image_430x256_63ef61addd548.jpg', 'uploads/images/202302/image_140x98_63ef61ade29c4.jpg', 'jpg', 'local', NULL, 1, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-17 16:47:57'),
(48, 1, '25 अप्रैल को केदारनाथ और 27 अप्रैल को खुलेंगे बदरीनाथ धाम के कपाट', 'the-doors-of-kedarnath-will-open-on-april-25-and-badrinath-dham-on-april-27', NULL, NULL, 'भगवान शिव के ग्यारहवें ज्योर्तिलिंग केदारनाथ धाम के कपाट 25 अप्रैल को सुबह 6 बजकर 20 मिनट पर मेष लग्न में खोले जाएंगे। आज महाशिवरात्रि के शुभ अवसर पर ओंकारेश्वर मंदिर ऊखीमठ में वेदपाठी एवं आचार्यगणों की मौजूदगी में शुभ महूर्त की घोषणा की गई। इस मौके पर ओंकारेश्वर मंदिर परिसर बम बम भोले के जयघोषों से गुंजायमान हो उठा।', '<p>भगवान शिव के ग्यारहवें ज्योर्तिलिंग केदारनाथ धाम के कपाट 25 अप्रैल को सुबह 6 बजकर 20 मिनट पर मेष लग्न में खोले जाएंगे। आज महाशिवरात्रि के शुभ अवसर पर ओंकारेश्वर मंदिर ऊखीमठ में वेदपाठी एवं आचार्यगणों की मौजूदगी में शुभ महूर्त की घोषणा की गई। इस मौके पर ओंकारेश्वर मंदिर परिसर बम बम भोले के जयघोषों से गुंजायमान हो उठा।</p>\r\n<p>महाशिवरात्रि के पवित्र मौके पर पंचकेदार गद्दीस्थल ओंकारेश्वर मंदिर ऊखीमठ में सुबह 9 बजे से पूजा अर्चना कर परम्परानुसार कार्यक्रम शुरू किया गया। बदरी-केदार मंदिर समिति के वेदपाठी, आचार्य एवं हक-हकूकधारियों की मौजूदगी में पूजा-अर्चना, पंचाग गणना के बाद 2023 यात्रा वर्ष के लिए भगवान केदारनाथ धाम के कपाट खुलने की तिथि घोषित की।</p>\r\n<p>विश्व प्रसिद्ध श्री बद्रीनाथ धाम के कपाट 27 अप्रैल को खुलेंगे। 27 अप्रैल को सुबह 7:10 पर विधि विधान से पूजा अर्चना के बाद कपाट खोले जाएंगे। 26 जनवरी यानी बसंत पंचमी के दिन नरेंद्र नगर राज महल में कपाट खुलने की तिथि तय की गई। इस दौरान बद्री केदार मंदिर समिति के पदाधिकारी एवं पंडित मौके पर मौजूद थे। बदरीनाथ के कपाट खुलने की तारीख बसत पंचमी पर तय होती है।&nbsp;</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63f07fc5e43b4.jpg\" alt=\"\"></p>', 1, 'uploads/images/202302/image_870x580_63f07fdb3f02d.jpg', 'uploads/images/202302/image_870x_63f07fdb70c01.jpg', 'uploads/images/202302/image_694x532_63f07fdb9c394.jpg', 'uploads/images/202302/image_430x256_63f07fdbc54a6.jpg', 'uploads/images/202302/image_140x98_63f07fdbe29fa.jpg', 'jpg', 'local', NULL, 2, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-18 13:06:15'),
(49, 1, 'हिंदू राष्ट्र पर बोले धीरेंद्र शास्त्री- हिन्दुस्तान का मतलब हिंदुओं का स्थान, एक ऐसा भारत जहां हर कोई गर्व से हिंदुत्व की बात कह सके', 'dhirendra-shastri-said-on-hindu-rashtra-–-hindustan-means-the-place-of-hindus-an-india-where-everyone-can-proudly-talk-about-hindutva', NULL, NULL, 'धीरेंद्र कृष्ण शास्त्री ने एक बार फिर दावा किया है कि हिन्दुस्तान जल्द ही हिंदू राष्ट्र बन जाएगा। न्यूज एजेंसी \'ANI\' से बातचीत के दौरान धीरेंद्र शास्त्री ने कहा, भारत हिंदू राष्ट्र बन जाएगा। यहां तक कि विदेश से भी लोग आज हमारे कार्यक्रम में जुटे हैं।', '<p>बागेश्वर धाम सरकार के पंडित धीरेंद्र कृष्ण शास्त्री ने एक बार फिर दावा किया है कि हिन्दुस्तान जल्द ही हिंदू राष्ट्र बन जाएगा। शनिवार को को धीरेंद्र कृष्ण शास्त्री ने यह बात कही। न्यूज एजेंसी \'ANI\' से बातचीत के दौरान धीरेंद्र शास्त्री ने कहा, भारत हिंदू राष्ट्र बन जाएगा। यहां तक कि विदेश से भी लोग आज हमारे कार्यक्रम में जुटे हैं। वो भले ही क्रिश्चन धर्म से हैं लेकिन वो सनातन धर्म में विश्वास करते हैं।&nbsp;</p>\r\n<p>धीरेंद्र कृष्ण शास्त्री ने आगे कहा, \'इसका मतलब यह कि यहां तक कि विदेशी भी चाहते हैं एक ऐसा भारत जहां हर कोई गर्व से हिंदुत्व की बात कह सके। जाति भेद को दरकिनार करिये। हम हिन्दुस्तानी हैं। हिन्दुस्तान का मतलब हिंदुओं का स्थान।\'</p>\r\n<p>धीरेंद्र शास्त्री ने आगे कहा कि ताकत हासिल कर सरकार बनाना हमारा लक्ष्य नहीं है। लेकिन अगर कोई हमें सपोर्ट करना चाहता है तो उन लोगों का स्वागत है। हम सभी हिंदुओं को हमारा समर्थन करने के लिए कहते हैं। भारत जल्द ही एक हिंदू राष्ट्र बन जाएगा। याद दिला दें कि महाराष्ट्र के एक संगठन ने नागपुर में आयोजित एक कार्यक्रम के दौरान धीरेंद्र शास्त्री को चमत्कार दिखाने की चुनौती दी थी। इसके बाद से ही धीरेंद्र शास्त्री लगातार चर्चा में है।&nbsp;</p>\r\n<p>इस चुनौती को लेकर धीरेंद्र शास्त्री ने रायपुर में कहा था कि ऐसे लोग आ रहे हैं। हम बंद दरवाजे के पीछे काम नहीं करते हैं। उन्हें (जो मुझे चुनौती देते हैं)आना चाहिए और अपने लिए यह देखना चाहिए। कैमरा पर कोई भी मेरे काम और बातों को चैलेंज कर सकता है। लाखों लोग बागेश्वर बालाजी के दरबार में आते हैं। मैं उन चीजों के बारे में लिखूंगा जिनसे मुझे प्रेरणा मिलती है। मुझे भगवान पर विश्वास है।</p>', 1, 'uploads/images/202302/image_870x580_63f1bb6bd7fed.jpg', 'uploads/images/202302/image_870x_63f1bb6be36c8.jpg', 'uploads/images/202302/image_694x532_63f1bb6bec94e.jpg', 'uploads/images/202302/image_430x256_63f1bb6bf120f.jpg', 'uploads/images/202302/image_140x98_63f1bb6bf2f3d.jpg', 'jpg', 'local', NULL, 1, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-19 11:32:29'),
(50, 1, 'भोपाल के कई इलाकों में आज 3 घंटे तक बिजली रहेगी गुल', 'in-many-areas-of-bhopal-there-will-be-power-cut-for-3-hours-today', NULL, NULL, 'भोपाल में आज 3 घंटे बिजली गुल रहेगी, जिंसी, ई-4, रविदास कॉलोनी में सप्लाई नहीं, मेंटेनेंस करेगी बिजली कंपनी।', '<p>भोपाल: राजधानी भोपाल के कई इलाकों में 19 फरवरी, रविवार को 3 घंटे तक बिजली कटौती होगी। इन इलाकों में बिजली कंपनी मेंटेनेंस करेगी। इसके चलते सप्लाई बंद रखी जाएगी।</p>\r\n<p>सुबह 10 से दोपहर 1 बजे तक बिजली कंपनी मेंटेनेंस करेगी। इसके चलते जिंसी, ई-4 एरिया, अमीन मार्केट, रविदास कॉलोनी, गुलु फैक्टरी एवं आसपास के इलाकों में तीन घंटे बिजली गुल रहेगी। ऐसे में जनता से जुड़े कई काम प्रभावित हो सकते हैं। इसलिए लोग जरूरी काम पहले से निपटा लें। ताकि, उन्हें किसी प्रकार की दिक्कत न हो।</p>', 3, 'uploads/images/202302/image_870x580_63f1be271d904.jpg', 'uploads/images/202302/image_870x_63f1be2728fa9.jpg', 'uploads/images/202302/image_694x532_63f1be2733215.jpg', 'uploads/images/202302/image_430x256_63f1be2739497.jpg', 'uploads/images/202302/image_140x98_63f1be273be36.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-19 11:44:20');
