(51, 1, '18 लाख से ज्यादा दियो से सजी बाबा महांकाल की नगरी ,  गिनीज बुक ऑफ वर्ल्ड रिकॉर्ड में नाम दर्ज', 'baba-mahankals-city-decorated-with-more-than-18-lakh-lamps-named-in-guinness-book-of-world-records', NULL, NULL, 'अवंतिका नगरी यानी उज्जैन का नाम गिनीज बुक ऑफ वर्ल्ड रिकॉर्ड में दर्ज हो गया। ‘शिव ज्योति अर्पणम्’ के तहत शनिवार शाम क्षिप्रा का तट 18 लाख 82 हजार दीयों से जगमग हो उठा, इसके साथ शहर का नाम गिनीज बुक में दर्ज हो गया। सबसे बड़ी बात ये है कि रिकॉर्ड बनने के बाद रात 10 बजे के बाद क्षिप्रा तट पर सफाई का काम भी शुरू हो गया।', '<p>उज्जैन: महाशिवरात्रि पर अवंतिका नगरी यानी उज्जैन का नाम गिनीज बुक ऑफ वर्ल्ड रिकॉर्ड में दर्ज हो गया। &lsquo;शिव ज्योति अर्पणम्&rsquo; के तहत शनिवार शाम क्षिप्रा का तट 18 लाख 82 हजार दीयों से जगमग हो उठा, इसके साथ शहर का नाम गिनीज बुक में दर्ज हो गया। सबसे बड़ी बात ये है कि रिकॉर्ड बनने के बाद रात 10 बजे के बाद क्षिप्रा तट पर सफाई का काम भी शुरू हो गया। रातभर में क्षिप्रा का किनारा पहले जैसा कर दिया गया। ताकि अमावस्या पर स्नान करने वाले लोगों को परेशानी ना हो। पूरा कार्यक्रम जीरो वेस्ट पर आयोजित किया गया था। इसके लिए 3R टेक्नीक अपनाई गई।</p>\r\n<p>इससे पहले फरवरी 2022 में मुख्यमंत्री शिवराज सिंह चौहान जब 11 सड़कों का उद्घाटन करने उज्जैन आए थे, तब उन्होंने ऐलान किया कि इस बार उज्जैन 21 लाख दीये जलाकर वर्ल्ड रिकॉर्ड बनाएगा। इसी के बाद इवेंट की तैयारी शुरू कर दी गई थी। मंत्रियों से लेकर अफसर तक इस काम को अंजाम देने में लग गए। समय-समय पर इसकी मॉनिटरिंग भी की गई। बाकायदा रिहर्सल भी हुई।</p>\r\n<p><img src=\"http://mponlinenews.com/uploads/images/202302/image_870x_63f1c3342a9ac.jpg\" alt=\"\"></p>\r\n<p>22 हजार वॉलंटियर्स ने 10 मिनट में इस कारनामे को कर दिखाया। पिछले साल अयोध्या में 15.76 लाख दीये जलाए गए थे। वर्ल्ड रिकॉर्ड का सर्टिफिकेट मिलते ही आतिशबाजी की गई। इसकी तैयारी एक साल पहले शुरू की गई थी।</p>\r\n<p>महापौर मुकेश टटवाल ने बताया कि पूरा कार्यक्रम डेढ़ महीने तैयारी के बाद किया गया था। तीन अलग-अलग शहरों से दीपक मंगवाए गए थे। दीप प्रज्जवलन के बाद 3R (रिड्यूज, रिसाइकिल, और रीयूज) टेक्नीक के माध्यम से इसका निपटारा किया जाएगा। रात 10 बजे के बाद घाटों पर सफाई का काम भी शुरू हो गया। महापौर ने बताया कि पूरा कार्यक्रम जीरो वेस्ट पर किया गया। दीप प्रज्जवलन के बाद बचे हुए तेल को गोशाला में उपयोग किया जाएगा। रुई को नगर निगम की कपड़ा बनाने वाली यूनिट में उपयोग में लाएंगे और दीपक से कलाकृति बनाई जाएगी। घाटों की सफाई करके वेस्ट का प्रबंधन कर दिया जाएगा।</p>\r\n<p>स्मार्ट सिटी के सीईओ आशीष पाठक ने बताया कि दीये जलाने में तीन तरह के तेल (सरसों, सोयाबीन और कपास) के 52 हजार लीटर, 25 लाख रुई की बाती, 600 किलो कपूर और 4 हजार माचिस लगी। शुक्रवार को दिनभर नदी के सभी घाटों पर दीप सजाए गए। दूसरे दिन यानी शनिवार सुबह सभी दीपों में तेल और रुई की बाती डाली गई।</p>\r\n<p>स्मार्ट सिटी सीईओ एवं नोडल अधिकारी आशीष पाठक ने बताया कि दीप प्रज्जवलन के लिए सभी घाटों पर 8,625 ब्लॉक बनाए। इन्हें ए, बी, सी, डी, ई और एफ छह ब्लॉक में बांटा गया। एक ब्लॉक में दो वॉलंटियर्स ने 225 दीये जलाए। इस तरह एक सब-सेक्टर में 40 से 50 ब्लॉक थे। हर ब्लॉक में 100 वॉलेंटियर्स थे। प्रति 100 वॉलेंटियर्स पर दो सुपरवाइजर लगाए गए। प्रति एक हजार वॉलेंटियर्स पर एक कंट्रोल ऑफिसर तैनात था। विभिन्न समाजों और संस्थाओं द्वारा वॉलंटियर्स की सूची दी गई। विभिन्न सेक्टर वाइज वॉलेंटियर्स के लिए प्रवेश-पत्र बनाए गए। कार्ड में होलोग्राम लगाए गए थे। वॉलेंटियर्स ने 10 मिनट में ही दीये जलाए। इसके बाद अगले पांच मिनट में ड्रोन से प्रज्ज्वलित दीयों की फोटोग्राफी की गई।</p>', 3, 'uploads/images/202302/image_870x580_63f1c32621968.jpg', 'uploads/images/202302/image_870x_63f1c3262c9a6.jpg', 'uploads/images/202302/image_694x532_63f1c3263557e.jpg', 'uploads/images/202302/image_430x256_63f1c32639c58.jpg', 'uploads/images/202302/image_140x98_63f1c3263b82c.jpg', 'jpg', 'local', NULL, 1, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-19 12:05:41'),
(52, 1, 'बच्चों संग स्पॉट हुई शिल्पा शेट्टी;बेटी समिषा के लिए रखी बर्थडे पार्टी, बहन शमिता भी आईं नजर', 'shilpa-shetty-spotted-with-children-birthday-party-for-daughter-samisha-sister-shamita-also-appeared', NULL, NULL, 'शिल्पा शेट्टी ने बेटी के बर्थडे पर अपने घर में एक शानदार पार्टी रखी थी। जिसमें कई सेलेब्स अपने बच्चों के साथ पहुंचे, इसी बीच पार्टी से जुड़ा एक वीडियो सामने आया है। जिसमें शिल्पा को उनके बच्चो के साथ स्पॉट किया गया।', '<p>बॉलीवुड एक्ट्रेस शिल्पा शेट्टी की बेटी समीषा शेट्टी 15 फरवरी को तीन साल की हो चुकी हैं। इसी बीच एक्ट्रेस ने बेटी के बर्थडे पर अपने घर में एक शानदार पार्टी रखी थी। जिसमें कई सेलेब्स अपने बच्चों के साथ पहुंचे, इसी बीच पार्टी से जुड़ा एक वीडियो सामने आया है। जिसमें शिल्पा को उनके बच्चो के साथ स्पॉट किया गया। इस वीडियो में एक्ट्रेस अपने बेटे वियान और बेटी समिषा के साथ नजर आ रही हैं। इस दौरान तीनों ने साथ में पैपराजी को पोज दिए है। लुक की बात करें तो समीषा पिंक ड्रेस में बेहद क्यूट लग रही थी। वहीं, पार्टी में शिल्पा की बहन शमिता भी पहुंचीं, जहां वह हमेशा की तरह बेहद स्टाइलिश लुक में नजर आईं। इस वीडियो के सामने आते ही फैंस इसे खूब पसंद कर रहे हैं।</p>\r\n<p>शिल्पा शेट्टी के वर्कफ्रंट की बात करें तो, तो वह जल्द ही रोहित शेट्टी के अपकमिंग वेब सीरीज इंडियन पुलिस फोर्स में नजर आएंगी। इस सीरीज में वह पहली बार पुलिस अफसर का रोल निभा रही हैं।</p>', 6, 'uploads/images/202302/image_870x580_63f1ca128e9d7.jpg', 'uploads/images/202302/image_870x_63f1ca129c5cb.jpg', 'uploads/images/202302/image_694x532_63f1ca12a80db.jpg', 'uploads/images/202302/image_430x256_63f1ca12ad3e9.jpg', 'uploads/images/202302/image_140x98_63f1ca12af96d.jpg', 'jpg', 'local', NULL, 1, 0, 0, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-19 12:35:01'),
(53, 1, 'जेल प्रशासन के डर से गोपालगंज में कैदी ने निगला फोन', 'prisoner-swallows-phone-in-gopalganj-due-to-fear-of-jail-administration', NULL, NULL, 'बिहार के गोपालगंज के चनावे स्थित मंडल कारा में बंद एक कैदी के अजीबोगरीब कारनामे ने पूरे जेल प्रशासन को हैरत में डाल दिया है। कैदी ने अपने साथ-साथ पूरे जेल प्रशासन को परेशान कर दिया है। कैदी की जान जोखिम में है। वहीं, जेल प्रशासन पर सवाल उठने लगा है कि क्या जेल के अंदर सुरक्षा में लापरवाही है। आखिर जेल के अंदर मोबाइल कैसे पहुंच रहा है। हुआ यूं है कि गोपालगंज जेल में आज जिला प्रशासन की ओर से छापेमारी की गई। सर्च अभियान चलाया गया। इसी दौरान एक कैदी जेल प्रशासन के डर से मोबाइल को निगल लिया। मोबाइल चाइनीज है। कैदी ने पकड़े जाने के डर से ऐसा किया है।', '<p>बिहार के गोपालगंज के चनावे स्थित मंडल कारा में बंद एक कैदी के अजीबोगरीब कारनामे ने पूरे जेल प्रशासन को हैरत में डाल दिया है। कैदी ने अपने साथ-साथ पूरे जेल प्रशासन को परेशान कर दिया है। कैदी की जान जोखिम में है। वहीं, जेल प्रशासन पर सवाल उठने लगा है कि क्या जेल के अंदर सुरक्षा में लापरवाही है। आखिर जेल के अंदर मोबाइल कैसे पहुंच रहा है। हुआ यूं है कि गोपालगंज जेल में आज जिला प्रशासन की ओर से छापेमारी की गई। सर्च अभियान चलाया गया। इसी दौरान एक कैदी जेल प्रशासन के डर से मोबाइल को निगल लिया। मोबाइल चाइनीज है। कैदी ने पकड़े जाने के डर से ऐसा किया है।</p>\r\n<p>थोड़ी देर बाद ही जब कैदी की तबीयत बिगड़ने लगी तब उसे जेल प्रशासन के द्वारा सदर अस्पताल के इमरजेंसी वार्ड में भर्ती कराया गया। यहां पर चिकित्सकों के द्वारा जब कैदी का एक्सरे कराया गया तो उसके पेट में मोबाइल फोन साफ देखा जा सकता था। अब इस कैदी के कारनामे की वजह से उसकी जान हलक में फंस गई है। मोबाइल कैदी के पेट में जाकर फंस गया है। एक्सरे में साफ दिख रहा है कि कैदी के शरीर के अंदर मोबाइल फंसा हुआ है। कैदी की स्थिति गंभीर बताई जा रही है। चिकित्सकों के मुताबिक मोबाइल से कई तरह के रेज निकलते हैं। इतना ही नहीं चाइनिज मोबाइल की बैट्री भी काफी खतरनाक होती है।<br>चिकित्सकों के मुताबिक अब कैदी का ऑपरेशन करना पड़ेगा। ऑपरेशन के बाद ही उसके पेट से मोबाइल फोन को बाहर निकाला जा सकता है। जेल प्रशासन के द्वारा दी गई जानकारी के मुताबिक सदर प्रखंड के रफी मोहम्मद के रहने वाले कैशर अली को 17 जनवरी 2020 को स्मैक बेचने के आरोप में गिरफ्तार किया गया था। इसकी गिरफ्तारी नगर थाना पुलिस के द्वारा हजियापुर से किया गया था। जिसे कोर्ट में पेश करने के बाद न्यायिक हिरासत में जेल भेज दिया गया था। अब आज रविवार को जेल प्रशासन के द्वारा जेल परिसर में सर्च ऑपरेशन चलाया जा रहा था। तभी यह हादसा हो गया।<br>फिलहाल, कैदी की जान को उतना खतरा नहीं है लेकिन फोन जल्द निकालना होगा। फोन समय के साथ पेट को प्रभावित कर देगा। इसके बाद फोन की बैटरी स्वास्थ्य के लिए हानिकारक साबित होगी। चिकित्सकों के मुताबिक मोबाइल निकालने के लिए कैदी की इनवेसिव सर्जरी करने पड़ेगी। डॉक्टरों के मुताबिक पेट में फोन फंस गया है। इससे पाइलोरस प्रभावित होगा। जो मांसपेशियों का एक वाल्व होता है, जो पाचन के अगले चरण तक जाने तक पेट में भोजन रखता है। गोपालगंज में कैदी की इस हरकत से जेल प्रशासन के हांथ-पांव फूल गये हैं। प्रशासन का कहना है कि जितनी जल्द हो सके, कैदी का ऑपरेशन किया जाएगा। उसके अंदर से फोन निकाला जाएगा।</p>', 1, 'uploads/images/202302/image_870x580_63f1e97447432.jpg', 'uploads/images/202302/image_870x_63f1e97472ac4.jpg', 'uploads/images/202302/image_694x532_63f1e974872d7.jpg', 'uploads/images/202302/image_430x256_63f1e974937ed.jpg', 'uploads/images/202302/image_140x98_63f1e9749c6cb.jpg', 'jpg', 'local', NULL, 1, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-19 14:49:12'),
(54, 1, 'बदलते मौसम से बढ़ी- फंगस, खुजली, फूंसी; स्वास्थ्य विभाग ने लोगों को दी सावधानी बरतने की सलह', 'aggravated-by-changing-weather-fungus-itching-pimples-health-department-advised-people-to-take-precautions', NULL, NULL, 'बदलते मौसम में अब नमी भी आने लगी है। इससे आने वाले दिनों उमस बढ़ी है। इस स्थिति में फंगस, दाद-खाज, खुजली फूंसी जैसे चर्म रोगों के मरीजों की संख्या बढ़ रही है। ऐसे में स्वास्थ्य विभाग ने लोगों को बदलते मौसम में सावधानी बरतने की सलाह दी है।', '<p>&nbsp;बदलते मौसम में अब नमी भी आने लगी है। इससे आने वाले दिनों उमस बढ़ी है। इस स्थिति में फंगस, दाद-खाज, खुजली फूंसी जैसे चर्म रोगों के मरीजों की संख्या बढ़ रही है। ऐसे में स्वास्थ्य विभाग ने लोगों को बदलते मौसम में सावधानी बरतने की सलाह दी है।<br>वातावरण में नमी बढ़ने के साथ फंगस का प्रकोप दिखने लगता है। घर-घर खुजली के मरीज मिलने लगते हैं। त्वचा की कुछ बीमारी ऐसी हो रही है कि किसी एक सदस्य को होने पर पूरा परिवार चपेट में आ रहा है। वहीं, अब सिम्स में ही रोजाना इस तरह के मामले सामने आने लगे हैं।<br>शहर के निजी अस्पतालों से जानकारी लेने पर यह बात सामने आई है कि बीते दो दिन से गर्मी बढ़ने के साथ ही उमस ने भी वातावरण में प्रवेश कर लिया है। विशेषज्ञों के अनुसार अब पूरी तरह से गर्मी बढ़ने तक फंगस एक्टिव रहेगा। ज्यादा गर्मी पड़ने पर ही फंगस का असर कम होगा। स्किन की बीमारी वाले फंगस गर्मी में एक्टिव होते हैं। इस वजह से पिछले एक महीने से खुजली के मरीज ज्यादा बढ़े हैं। सीएमएचओ डा. अनिल श्रीवास्तव ने मौसम के बदलाव को ध्यान रखते हुए जिलवासियों से कहा कि वे इस मौसम में अपने स्वास्थ्य का ध्यान रखें और शरीर की सफाई पर विशेष ध्यान दें।</p>', 1, 'uploads/images/202302/image_870x580_63f1ec75d2933.jpg', 'uploads/images/202302/image_870x_63f1ec75e529f.jpg', 'uploads/images/202302/image_694x532_63f1ec75f3d8d.jpg', 'uploads/images/202302/image_430x256_63f1ec7606911.jpg', 'uploads/images/202302/image_140x98_63f1ec760a32a.jpg', 'jpg', 'local', NULL, 2, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-19 15:02:02'),
(55, 1, 'रेलवे स्टेशन पर अब शुरू होने वाली है नई सुविधा, मिनटों में मिलेगा टिकट, खिड़की पर जाने की जरूरत नहीं पड़ेगी', 'now-a-new-facility-is-going-to-start-at-the-railway-station-tickets-will-be-available-in-minutes-there-will-be-no-need-to-go-to-the-window', NULL, NULL, 'ट्रेन में सफर करने से पहले स्टेशन पर विंडो से टिकट खरीदना हर यात्री के लिए बड़ा सिरदर्द है, क्योंकि लंबी कतारों में घंटों इंतजार करना बेहद मुश्किल भरा होता है. हालांकि, तकनीक के इस दौर में भारतीय रेलवे (Indian Railway News) ने यात्रियों की सुविधाओं को देखते हुए कई बड़े स्टेशन पर टिकट वेंडिंग मशीनें लगाई हैं लेकिन इनकी संख्या बेहद कम है. अब रेलवे ने इन ऑटोमैटिक टिकट वेंडिंग मशीन की संख्या में बढ़ोतरी करने का ऐलान किया है.', '<p>&nbsp;&nbsp;रेलवे स्टेशन: ट्रेन में सफर करने से पहले स्टेशन पर विंडो से टिकट खरीदना हर यात्री के लिए बड़ा सिरदर्द है, क्योंकि लंबी कतारों में घंटों इंतजार करना बेहद मुश्किल भरा होता है. हालांकि, तकनीक के इस दौर में भारतीय रेलवे ने यात्रियों की सुविधाओं को देखते हुए कई बड़े स्टेशन पर टिकट वेंडिंग मशीनें लगाई हैं लेकिन इनकी संख्या बेहद कम है. अब रेलवे ने इन ऑटोमैटिक टिकट वेंडिंग मशीन की संख्या में बढ़ोतरी करने का ऐलान किया है.</p>\r\n<p>देश के कई रेलवे स्टेशनों पर और ज्यादा Automatic Ticket Vending Machine के लगने से यात्रियों को आसानी से टिकट मिलेंगे और उन्हें लंबी कतारों में टिकट खरीदने की परेशानी से छुटकारा मिलेगा. इससे लोगों का समय बचने के साथ-साथ टिकट काउंटर पर लगने वाली भीड़ भी कम होगी.दक्षिण रेल डिवीजन ने कई रेलवे स्टेशनों पर 254 अतिरिक्त ATVMs लगाने का फैसला किया है. साउदर्न रेलवे ने कुल 6 मंडलों में 254 ऑटोमैटिक टिकट वेडिंग मशीन लगाने का फैसला किया है. रेलवे स्टेशनों पर उपलब्ध ATVMs मशीनों से यात्री मिनटों में टिकट निकाल सकते हैं. खास बात है कि इन मशीनों से सुपर फास्ट और मेल एक्सप्रेस समेत सभी ट्रेनों के अनारक्षित टिकट निकाले जा सकते हैं. इसके अलावा, प्लेटफॉर्म टिकट भी लिया जा सकता है.<br>रेलवे स्टेशनों पर लगी टिकट वेंडिंग मशीन भी बिल्कुल बैंक एटीएम की तरह काम करती है. जैसे आप एटीएम से पैसे निकालते हैं ठीक उसी तरह टिकट वेंडिंग मशीन से यात्रा के लिए टिकट हासिल किया जा सकता है. इस मशीन के जरिए आपको जिस शहर की यात्रा करनी है उसका नाम लिखें और सिलेक्ट करें. फिर जिस ट्रेन से सफर करना चाहते हैं उसकी कैटेगरी चुनें (जैसे सुपरफास्ट, मेल एक्सप्रेस या पैसेंजर आदि), फिर नकद, स्मार्ट कार्ड या यूपीआई से पेमेंट करें. इसके बाद मशीन टिकट प्रिंट होकर बाहर आ जाएगा.</p>', 1, 'uploads/images/202302/image_870x580_63f1f1550663a.jpg', 'uploads/images/202302/image_870x_63f1f1551f80a.jpg', 'uploads/images/202302/image_694x532_63f1f15531bda.jpg', 'uploads/images/202302/image_430x256_63f1f155411ca.jpg', 'uploads/images/202302/image_140x98_63f1f155479d9.jpg', 'jpg', 'local', NULL, 1, 0, 1, 1, 0, 1, 0, 0, 0, 1, 0, 'article', NULL, 'local', '', NULL, NULL, 2, 1, NULL, NULL, 0, NULL, 0, NULL, '2023-02-19 15:22:55');
